\u0075\u0073\u0069\u006E\u0067 \u0046\u0061\u0063\u0065\u0070\u0075\u006E\u0063\u0068;\u0075\u0073\u0069\u006E\u0067 \u004E\u0065\u0074\u0077\u006F\u0072\u006B;\u0075\u0073\u0069\u006E\u0067 \u004F\u0078\u0069\u0064\u0065.\u0043\u006F\u0072\u0065;\u0075\u0073\u0069\u006E\u0067 \u004F\u0078\u0069\u0064\u0065.\u0043\u006F\u0072\u0065.\u004C\u0069\u0062\u0072\u0061\u0072\u0069\u0065\u0073;\u0075\u0073\u0069\u006E\u0067 \u004F\u0078\u0069\u0064\u0065.\u0043\u006F\u0072\u0065.\u0050\u006C\u0075\u0067\u0069\u006E\u0073;\u0075\u0073\u0069\u006E\u0067 \u0050\u0072\u006F\u0074\u006F\u0042\u0075\u0066;\u0075\u0073\u0069\u006E\u0067 \u0052\u0075\u0073\u0074;\u0075\u0073\u0069\u006E\u0067 \u0053\u0079\u0073\u0074\u0065\u006D;\u0075\u0073\u0069\u006E\u0067 \u0053\u0079\u0073\u0074\u0065\u006D.\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073;\u0075\u0073\u0069\u006E\u0067 \u0053\u0079\u0073\u0074\u0065\u006D.\u0043\u006F\u006C\u006C\u0065\u0063\u0074\u0069\u006F\u006E\u0073.\u0047\u0065\u006E\u0065\u0072\u0069\u0063;\u0075\u0073\u0069\u006E\u0067 \u0053\u0079\u0073\u0074\u0065\u006D.\u0047\u006C\u006F\u0062\u0061\u006C\u0069\u007A\u0061\u0074\u0069\u006F\u006E;\u0075\u0073\u0069\u006E\u0067 \u0053\u0079\u0073\u0074\u0065\u006D.\u004C\u0069\u006E\u0071;\u0075\u0073\u0069\u006E\u0067 \u0053\u0079\u0073\u0074\u0065\u006D.\u0054\u0065\u0078\u0074.\u0052\u0065\u0067\u0075\u006C\u0061\u0072\u0045\u0078\u0070\u0072\u0065\u0073\u0073\u0069\u006F\u006E\u0073;\u0075\u0073\u0069\u006E\u0067 \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065;\u0075\u0073\u0069\u006E\u0067 \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0041\u0049;\u0075\u0073\u0069\u006E\u0067 \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0053\u0063\u0065\u006E\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u006D\u0065\u006E\u0074;\u0075\u0073\u0069\u006E\u0067 \u0054\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065;\u006E\u0061\u006D\u0065\u0073\u0070\u0061\u0063\u0065 \u004F\u0078\u0069\u0064\u0065.\u0050\u006C\u0075\u0067\u0069\u006E\u0073{[Info("\u0050\u0069\u0072\u0061\u0074\u0065\u004E\u0050\u0043", "\u0062\u006D\u0067\u006A\u0065\u0074", "0.0.2")][\u0044\u0065\u0073\u0063\u0072\u0069\u0070\u0074\u0069\u006F\u006E("\u0043\u0072\u0065\u0061\u0074\u0065\u0073 \u004E\u0050\u0043 \u0054\u006F \u0050\u0061\u0074\u0072\u006F\u006C \u004F\u0063\u0065\u0061\u006E,\u0053\u006B\u0069\u0065\u0073,\u004C\u0061\u006E\u0064")]\u0063\u006C\u0061\u0073\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u004E\u0050\u0043 : \u0052\u0075\u0073\u0074\u0050\u006C\u0075\u0067\u0069\u006E{[\u0050\u006C\u0075\u0067\u0069\u006E\u0052\u0065\u0066\u0065\u0072\u0065\u006E\u0063\u0065]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0050\u006C\u0075\u0067\u0069\u006E \u004B\u0069\u0074\u0073;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0048\u0049\u0042 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0052\u006F\u0077\u0042\u006F\u0061\u0074 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0075\u0062 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0073\u004D\u0069\u006E\u0069 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0063\u0072\u0061\u0070 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0048\u006F\u0072\u0073\u0065 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0070\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0050\u0069\u0072\u0061\u0074\u0065 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u004E\u0050\u0043\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079> \u0054\u0072\u0061\u0069\u006E\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0056\u006F\u0069\u0063\u0065 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0075\u006C\u006F\u006E\u0067> \u0049\u0073\u0048\u0065\u0061\u006C\u0069\u006E\u0067 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0075\u006C\u006F\u006E\u0067>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0047\u0065\u006E\u0065\u0072\u0069\u0063\u0052\u0061\u0064\u0069\u0075\u0073> \u006D\u0061\u0070\u006D\u0061\u0072\u006B\u0065\u0072\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0047\u0065\u006E\u0065\u0072\u0069\u0063\u0052\u0061\u0064\u0069\u0075\u0073>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0054\u0069\u006D\u0065\u0072 \u0073\u0070\u0061\u0077\u006E\u0065\u0072 = \u006E\u0075\u006C\u006C;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065> \u0054\u0068\u0072\u0065\u0061\u0064\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0067\u0072\u006F\u0075\u006E\u0064\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u006C\u0061\u006E\u0064\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0072\u0065\u0061\u0064\u006F\u006E\u006C\u0079 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072> _\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072>();\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0061\u0074\u0069\u0063 \u0050\u0069\u0072\u0061\u0074\u0065\u004E\u0050\u0043 \u0070\u006C\u0075\u0067\u0069\u006E;\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0061\u0074\u0069\u0063 \u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u004C\u0069\u0073\u0074<\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>>> \u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u004C\u0069\u0073\u0074<\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>>>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006F\u006E\u0073\u0074 \u0073\u0074\u0072\u0069\u006E\u0067 \u0077\u0061\u006C\u006C = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067 \u0063\u006F\u0072\u0065/\u0077\u0061\u006C\u006C/\u0077\u0061\u006C\u006C.\u0070\u0072\u0065\u0066\u0061\u0062";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006F\u006E\u0073\u0074 \u0073\u0074\u0072\u0069\u006E\u0067 \u0066\u006F\u0075\u006E\u0064\u0061\u0074\u0069\u006F\u006E = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067 \u0063\u006F\u0072\u0065/\u0066\u006F\u0075\u006E\u0064\u0061\u0074\u0069\u006F\u006E/\u0066\u006F\u0075\u006E\u0064\u0061\u0074\u0069\u006F\u006E.\u0070\u0072\u0065\u0066\u0061\u0062";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006F\u006E\u0073\u0074 \u0073\u0074\u0072\u0069\u006E\u0067 \u0066\u006C\u006F\u006F\u0072 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067 \u0063\u006F\u0072\u0065/\u0066\u006C\u006F\u006F\u0072/\u0066\u006C\u006F\u006F\u0072.\u0070\u0072\u0065\u0066\u0061\u0062";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006F\u006E\u0073\u0074 \u0073\u0074\u0072\u0069\u006E\u0067 \u0077\u0061\u006C\u006C\u0066\u0072\u0061\u006D\u0065 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067 \u0063\u006F\u0072\u0065/\u0077\u0061\u006C\u006C.\u0066\u0072\u0061\u006D\u0065/\u0077\u0061\u006C\u006C.\u0066\u0072\u0061\u006D\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006F\u006E\u0073\u0074 \u0073\u0074\u0072\u0069\u006E\u0067 \u0067\u0061\u0072\u0061\u0067\u0065\u0064\u006F\u006F\u0072 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067/\u0077\u0061\u006C\u006C.\u0066\u0072\u0061\u006D\u0065.\u0067\u0061\u0072\u0061\u0067\u0065\u0064\u006F\u006F\u0072/\u0077\u0061\u006C\u006C.\u0066\u0072\u0061\u006D\u0065.\u0067\u0061\u0072\u0061\u0067\u0065\u0064\u006F\u006F\u0072.\u0070\u0072\u0065\u0066\u0061\u0062";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u0042\u0061\u0073\u0065\u0042\u006C\u006F\u0063\u006B = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079.\u004D\u004F\u004E\u0055\u004D\u0045\u004E\u0054;\u0070\u0075\u0062\u006C\u0069\u0063 \u0063\u006C\u0061\u0073\u0073 \u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073{\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0053\u0070\u0061\u0077\u006E\u0045\u0076\u0065\u0072\u0079;\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u004C\u0065\u0061\u0076\u0065\u0041\u0066\u0074\u0065\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0053\u0068\u006F\u0077\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0053\u0069\u007A\u0065;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0041\u006C\u0070\u0068\u0061;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u0053\u0074\u0061\u0072\u0074\u0046\u0069\u0072\u0065\u0048\u0065\u0061\u006C\u0074\u0068;\u0070\u0075\u0062\u006C\u0069\u0063 \u0043\u006F\u006C\u006F\u0072 \u0041\u0069\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0043\u006F\u006C\u006F\u0072 \u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0043\u006F\u006C\u006F\u0072 \u004C\u0061\u006E\u0064\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0043\u006F\u006C\u006F\u0072 \u0042\u0061\u0073\u0065\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0043\u006F\u006C\u006F\u0072 \u0052\u0061\u0069\u006C\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u0053\u0074\u006F\u0070\u0044\u0065\u006C\u0061\u0079;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u0043\u0072\u0061\u0073\u0068\u0044\u0065\u006C\u0061\u0079;\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0053\u0063\u0072\u0061\u0070\u0048\u0065\u006C\u0069\u0047\u0069\u0062\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0048\u0065\u006C\u0069\u0046\u0069\u0072\u0065\u0062\u0061\u006C\u006C;\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0048\u0065\u006C\u0069\u006C\u0069\u0067\u0068\u0074\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0042\u006F\u0061\u0074\u006C\u0069\u0067\u0068\u0074\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0044\u0069\u0073\u0061\u0062\u006C\u0065\u004C\u0061\u006E\u0064\u006C\u0069\u0067\u0068\u0074\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0