6C\u0048\u0065\u0061\u006C\u0074\u0068;\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004E\u0050\u0043\u004B\u0069\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0073\u0074\u0072\u0069\u006E\u0067 \u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004C\u006F\u006F\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073(){\u0052\u0061\u0069\u0064\u0061\u0062\u006C\u0065\u0042\u0061\u0073\u0065\u0073\u0041\u0054 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["(\u0052\u0061\u0069\u0064\u0061\u0062\u006C\u0065\u0042\u0061\u0073\u0065\u0073) \u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0041\u0075\u0074\u006F \u0054\u0075\u0072\u0072\u0065\u0074\u0073 \u0041\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067 \u0050\u0069\u0072\u0061\u0074\u0065\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0070\u0061\u0077\u006E\u0045\u0076\u0065\u0072\u0079 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0070\u0061\u0077\u006E \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0045\u0076\u0065\u0072\u0079 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004C\u0065\u0061\u0076\u0065\u0041\u0066\u0074\u0065\u0072 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004C\u0065\u0061\u0076\u0065 \u0041\u0066\u0074\u0065\u0072 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0068\u006F\u0077\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0053\u0068\u006F\u0077"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0053\u0069\u007A\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0053\u0069\u007A\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0041\u006C\u0070\u0068\u0061 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0041\u006C\u0070\u0068\u0061"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0074\u0061\u0072\u0074\u0046\u0069\u0072\u0065\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0074\u0061\u0072\u0074 \u0046\u0069\u0072\u0065 \u0057\u0068\u0065\u006E \u0048\u0065\u0061\u006C\u0074\u0068 \u0042\u0065\u006C\u006F\u0077"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0041\u0069\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0048\u0065\u00782\u0043\u006F\u006C\u006F\u0075\u0072(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0041\u0069\u0072) (\u0048\u0065\u0078)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0048\u0065\u00782\u0043\u006F\u006C\u006F\u0075\u0072(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0057\u0061\u0074\u0065\u0072) (\u0048\u0065\u0078)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004C\u0061\u006E\u0064\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0048\u0065\u00782\u0043\u006F\u006C\u006F\u0075\u0072(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u004C\u0061\u006E\u0064) (\u0048\u0065\u0078)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0042\u0061\u0073\u0065\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0048\u0065\u00782\u0043\u006F\u006C\u006F\u0075\u0072(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0042\u0061\u0073\u0065) (\u0048\u0065\u0078)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0061\u0069\u006C\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0048\u0065\u00782\u0043\u006F\u006C\u006F\u0075\u0072(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0052\u0061\u0069\u006C) (\u0048\u0065\u0078)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0074\u006F\u0070\u0044\u0065\u006C\u0061\u0079 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0074\u006F\u0070 \u0044\u0065\u006C\u0061\u0079 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0043\u0072\u0061\u0073\u0068\u0044\u0065\u006C\u0061\u0079 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0043\u0072\u0061\u0073\u0068 \u0044\u0065\u006C\u0061\u0079 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0053\u0063\u0072\u0061\u0070\u0048\u0065\u006C\u0069\u0047\u0069\u0062\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0053\u0063\u0072\u0061\u0070\u0048\u0065\u006C\u0069 \u0047\u0069\u0062\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0048\u0065\u006C\u0069\u0046\u0069\u0072\u0065\u0062\u0061\u006C\u006C = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0048\u0065\u006C\u0069 \u0046\u0069\u0072\u0065\u0062\u0061\u006C\u006C"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0048\u0065\u006C\u0069\u006C\u0069\u0067\u0068\u0074\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0048\u0065\u006C\u0069 \u004C\u0069\u0067\u0068\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0042\u006F\u0061\u0074\u006C\u0069\u0067\u0068\u0074\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0042\u006F\u0061\u0074 \u004C\u0069\u0067\u0068\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u004C\u0061\u006E\u0064\u006C\u0069\u0067\u0068\u0074\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u004C\u0061\u006E\u0064 \u004C\u0069\u0067\u0068\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0046\u0069\u0072\u0065 \u0041\u0066\u0074\u0065\u0072 \u0043\u0072\u0061\u0073\u0068/\u0053\u0069\u006E\u006B (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0045\u0078\u0070\u006C\u006F\u0064\u0065 \u0041\u0066\u0074\u0065\u0072 \u0046\u0069\u0072\u0065 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0042\u006F\u0061\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u0048\u0049\u0042\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0052\u0048\u0049\u0042\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0052\u0048\u0049\u0042\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0042\u006F\u0061\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0070\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0065\u0070\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0044\u0061\u006D\u0061\u0067\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0054\u0061\u006B\u0065 \u0044\u0061\u006D\u0061\u0067\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004F\u0072\u0062\u0069\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u0048\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u006F\u0076\u0065\u0072 \u0048\u0065\u0069\u0067\u0068\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u0054\u0068\u0072\u0065\u0061\u0074\u004C\u0065\u0076\u0065\u006C = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0061\u0072\u0067\u0065\u0074 \u0054\u0068\u0072\u0065\u0061\u0074 \u004C\u0065\u0076\u0065\u006C"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u0069\u006E\u0069\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004D\u0069\u006E\u0069\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004D\u0069\u006E\u0069\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004F\u0072\u0062\u0069\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u0048\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u006F\u0076\u0065\u0072 \u0048\u0065\u0069\u0067\u0068\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u0054\u0068\u0072\u0065\u0061\u0074\u004C\u0065\u0076\u0065\u006C = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0061\u0072\u0067\u0065\u0074 \u0054\u0068\u0072\u0065\u0061\u0074 \u004C\u0065\u0076\u0065\u006C"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0063\u0072\u0061\u0070\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0053\u0063\u0072\u0061\u0070\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0053\u0063\u0072\u0061\u0070\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0043\u0061\u0072\u0067\u006F\u0050\u0061\u0074\u0068 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0055\u0073\u0065 \u0043\u0061\u0072\u0067\u006F\u0073\u0068\u0069\u0070 \u0050\u0061\u0074\u0068 \u0046\u006F\u0072 \u004F\u0063\u0065\u0061\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0050\u0061\u0074\u0068 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0055\u0073\u0065 \u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074 \u0050\u0061\u0074\u0068 \u0046\u006F\u0072 \u0041\u0069\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0050\u0069\u0072\u0061\u0074\u0065\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073\u0042\u006F\u0061\u0074 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u006F\u0061\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0074\u0061\u0074\u0069\u0063\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0074\u0061\u0074\u0069\u0063(\u0053\u0065\u0072\u0076\u0065\u0072) \u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0050\u0069\u0072\u0061\u0074\u0065\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073\u0044\u0061\u006D\u0061\u0067\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0044\u0061\u006D\u0061\u0067\u0065 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 (\u0050\u0069\u0072\u0061\u0074\u0065\u0073)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0054\u0069\u0063\u006B = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0054\u0069\u0063\u006B \u0052\u0061\u0074\u0065 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0054\u0072\u0069\u0067\u0067\u0065\u0072 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 \u0057\u0068\u0065\u006E \u0048\u0065\u006C\u0069 \u0048\u0065\u0061\u006C\u0074\u0068 \u0042\u0065\u006C\u006F\u0077"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0044\u0065\u0063\u0061\u0079 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 \u0044\u0065\u0063\u0061\u0079 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0044\u0069\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 \u0053\u0075\u0069\u0063\u0069\u0064\u0065 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u0065\u006C\u0069\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["(\u0041\u0069\u0072) \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0042\u006F\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["(\u0053\u0065\u0061) \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004C\u0061\u006E\u0064\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["(\u004C\u0061\u006E\u0064) \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0052\u006F\u0061\u006D \u0052\u0061\u006E\u0067\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0043\u0061\u006E\u0052\u006F\u0061\u006D = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0052\u006F\u0061\u006D"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u004D\u0061\u0078 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0052\u006F\u0061\u006D \u0052\u0061\u006E\u0067\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u0043\u0061\u006E\u0052\u006F\u0061\u006D = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0052\u006F\u0061\u006D"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0053\u0070\u0065\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0048\u006F\u0072\u0073\u0065\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0048\u006F\u0072\u0073\u0065\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0048\u006F\u0072\u0073\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0058\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004E\u0050\u0043\u0043\u0068\u0061\u0074\u0074\u0065\u0072 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0052\u0061\u0064\u0069\u006F \u0044\u0069\u0073\u0061\u0062\u006C\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0043\u0068\u0061\u0074\u0074\u0065\u0072 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0052\u0061\u0064\u0069\u006F \u0043\u0075\u0073\u0074\u006F\u006D"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0043\u0068\u0061\u0074\u0074\u0065\u0072\u0043\u0044 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0052\u0061\u0064\u0069\u006F \u0043\u0075\u0073\u0074\u006F\u006D \u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0044\u0065\u0061\u0074\u0068 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0044\u0065\u0061\u0074\u0068 \u0056\u006F\u0069\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0044\u0065\u0061\u0074\u0068\u0043\u0044 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0044\u0065\u0061\u0074\u0068 \u0056\u006F\u0069\u0063\u0065\u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u004B\u0069\u006C\u006C = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u004B\u0069\u006C\u006C \u0056\u006F\u0069\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u004B\u0069\u006C\u006C\u0043\u0044 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u004B\u0069\u006C\u006C \u0056\u006F\u0069\u0063\u0065 \u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u004E\u0061\u006D\u0065\u0054\u0061\u0067 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u004E\u0061\u006D\u0065 \u0054\u0061\u0067"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0057\u0061\u0072\u006E\u0069\u006E\u0067 \u0056\u006F\u0069\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0057\u0061\u0072\u006E\u0069\u006E\u0067 \u0056\u006F\u0069\u0063\u0065 \u0054\u0072\u0069\u0067\u0067\u0065\u0072 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067\u0043\u0044 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0057\u0061\u0072\u006E\u0069\u006E\u0067 \u0056\u006F\u0069\u0063\u0065 \u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0043\u0041\u0074\u0074\u0061\u0063\u006B\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0053\u0075\u0070\u0070\u006C\u0079 \u0044\u0072\u006F\u0070\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0041\u0074\u0074\u0061\u0063\u006B\u0043\u0072\u0065\u0061\u0074\u0065 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0043\u0072\u0065\u0061\u0074\u0065\u0073 \u0042\u0065\u0069\u006E\u0067 \u0048\u0061\u0063\u006B\u0065\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0073\u0043\u0061\u006E\u0054\u0061\u0072\u0067\u0065\u0074\u004E\u0050\u0043\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0061\u006E \u0054\u0061\u0072\u0067\u0065\u0074 \u004F\u0074\u0068\u0065\u0072 \u004E\u0050\u0043\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0043\u006F\u0075\u006E\u0074\u0052\u0061\u0069\u0064\u0073 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0043\u006F\u0075\u006E\u0074\u0065\u0072 \u0052\u0061\u0069\u0064\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u004D\u0061\u0078\u0056\u006F\u0069\u0063\u0065\u0073\u0041\u0074\u004F\u006E\u0063\u0065 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u004D\u0061\u0078 \u0056\u006F\u0069\u0063\u0065\u0073 \u0054\u006F \u0050\u006C\u0061\u0079 \u0041\u0074 \u004F\u006E\u0063\u0065 \u004F\u006E \u0053\u0065\u0072\u0076\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0044\u0061\u006D\u0061\u0067\u0065\u0053\u0063\u0061\u006C\u0065\u0072 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043 \u0044\u0061\u006D\u0061\u0067\u0065 \u0053\u0063\u0061\u006C\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0041\u0069\u006D\u0053\u0063\u0061\u006C\u0065\u0072 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043 \u0041\u0069\u006D \u0053\u0063\u0061\u006C\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0073\u0041\u0069\u0072\u0050\u004F\u0049\u0052\u0061\u0064\u0069\u0075\u0073 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 \u0046\u0072\u006F\u006D \u0050\u004F\u0049 \u0041\u0069\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0073\u0057\u0061\u0074\u0065\u0072\u0050\u004F\u0049\u0052\u0061\u0064\u0069\u0075\u0073 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 \u0046\u0072\u006F\u006D \u0050\u004F\u0049 \u0057\u0061\u0074\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0073\u004C\u0061\u006E\u0064\u0050\u004F\u0049\u0052\u0061\u0064\u0069\u0075\u0073 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 \u0046\u0072\u006F\u006D \u0050\u004F\u0049 \u004C\u0061\u006E\u0064"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072 = \u0062\u006F\u006F\u006C.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072 \u004D\u006F\u0064\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u004F\u0049\u0045\u0078\u0070\u0069\u0072\u0065\u0073 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0050\u004F\u0049 \u0045\u0078\u0070\u0069\u0072\u0065\u0073 \u0041\u0066\u0074\u0065\u0072 (\u0073\u0065\u0063)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u004E\u0050\u0043\u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072\u0054\u006F\u0067\u0067\u006C\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072 \u0054\u006F\u0067\u0067\u006C\u0065 \u0048\u006F\u0073\u0074\u0069\u006C\u0065 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0054\u006F \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u004F\u0066 \u004E\u0050\u0043\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0057\u0061\u006C\u006C\u0052\u0061\u0064\u0069\u0075\u0073 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u0057\u0061\u006C\u006C \u0052\u0061\u0064\u0069\u0075\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004E\u0050\u0043 \u004B\u0069\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u0041\u006D\u006F\u0075\u006E\u0074 \u0054\u006F \u0053\u0070\u0061\u0077\u006E"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u0048\u0065\u0061\u006C\u0074\u0068 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u0054\u0072\u0061\u0069\u006E \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u0041\u006D\u006F\u0075\u006E\u0074 \u004F\u0066 \u004E\u0050\u0043\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069 = \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004E\u0050\u0043\u004B\u0069\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004E\u0050\u0043 \u004B\u0069\u0074"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004C\u006F\u006F\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());}}\u0070\u0072\u006F\u0074\u0065\u0063\u0074\u0065\u0064 \u006F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 \u0076\u006F\u0069\u0064 \u004C\u006F\u0061\u0064\u0044\u0065\u0066\u0061\u0075\u006C\u0074\u0043\u006F\u006E\u0066\u0069\u0067(){\u0050\u0075\u0074\u0073("\u0043\u0072\u0065\u0061\u0074\u0069\u006E\u0067 \u0061 \u006E\u0065\u0077 \u0063\u006F\u006E\u0066\u0069\u0067\u0075\u0072\u0061\u0074\u0069\u006F\u006E \u0066\u0069\u006C\u0065");\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0070\u0061\u0077\u006E \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0045\u0076\u0065\u0072\u0079 (\u0073\u0065\u0063)"] = 1800;\u0043\u006F\u006E\u0066\u0069\u0067["\u004C\u0065\u0061\u0076\u0065 \u0041\u0066\u0074\u0065\u0072 (\u0073\u0065\u0063)"] = 1500;\u0043\u006F\u006E\u0066\u0069\u0067["(\u0041\u0069\u0072) \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 200f;\u0043\u006F\u006E\u0066\u0069\u0067["(\u0053\u0065\u0061) \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 30f;\u0043\u006F\u006E\u0066\u0069\u0067["(\u004C\u0061\u006E\u0064) \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 40f;\u0043\u006F\u006E\u0066\u0069\u0067["(\u0052\u0061\u0069\u0064\u0061\u0062\u006C\u0065\u0042\u0061\u0073\u0065\u0073) \u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0041\u0075\u0074\u006F \u0054\u0075\u0072\u0072\u0065\u0074\u0073 \u0041\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067 \u0050\u0069\u0072\u0061\u0074\u0065\u0073"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0053\u0068\u006F\u0077"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0041\u0069\u0072) (\u0048\u0065\u0078)"] = "#000000";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0057\u0061\u0074\u0065\u0072) (\u0048\u0065\u0078)"] = "#\u00642\u0065\u0066\u0066\u0066";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u004C\u0061\u006E\u0064) (\u0048\u0065\u0078)"] = "#\u00642f\u0066\u00642";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0042\u0061\u0073\u0065) (\u0048\u0065\u0078)"] = "#872701";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0043\u006F\u006C\u006F\u0075\u0072 (\u0052\u0061\u0069\u006C) (\u0048\u0065\u0078)"] = "#0000\u0046\u0046";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0041\u006C\u0070\u0068\u0061"] = 0.4f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0061\u0070 \u004D\u0061\u0072\u006B\u0065\u0072 \u0053\u0069\u007A\u0065"] = 0.4f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0074\u0061\u0072\u0074 \u0046\u0069\u0072\u0065 \u0057\u0068\u0065\u006E \u0048\u0065\u0061\u006C\u0074\u0068 \u0042\u0065\u006C\u006F\u0077"] = 80f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0074\u006F\u0070 \u0044\u0065\u006C\u0061\u0079 (\u0073\u0065\u0063)"] = 3;\u0043\u006F\u006E\u0066\u0069\u0067["\u0043\u0072\u0061\u0073\u0068 \u0044\u0065\u006C\u0061\u0079 (\u0073\u0065\u0063)"] = 0.5;\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0053\u0063\u0072\u0061\u0070\u0048\u0065\u006C\u0069 \u0047\u0069\u0062\u0073"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0048\u0065\u006C\u0069 \u0046\u0069\u0072\u0065\u0062\u0061\u006C\u006C"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0048\u0065\u006C\u0069 \u004C\u0069\u0067\u0068\u0074\u0073"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u0042\u006F\u0061\u0074 \u004C\u0069\u0067\u0068\u0074\u0073"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0044\u0069\u0073\u0061\u0062\u006C\u0065 \u004C\u0061\u006E\u0064 \u004C\u0069\u0067\u0068\u0074\u0073"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0046\u0069\u0072\u0065 \u0041\u0066\u0074\u0065\u0072 \u0043\u0072\u0061\u0073\u0068/\u0053\u0069\u006E\u006B (\u0073\u0065\u0063)"] = 60;\u0043\u006F\u006E\u0066\u0069\u0067["\u0045\u0078\u0070\u006C\u006F\u0064\u0065 \u0041\u0066\u0074\u0065\u0072 \u0046\u0069\u0072\u0065 (\u0073\u0065\u0063)"] = 10;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u0065\u006C\u0069\u0074\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0042\u006F\u0061\u0074"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0048\u0065\u0061\u006C\u0074\u0068"] = 500;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 120;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"] = 14f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"] = 6.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 2f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u0048\u0049\u0042 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u0062\u0061\u0073\u0069\u0063.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0042\u006F\u0061\u0074"] = 3;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0048\u0065\u0061\u006C\u0074\u0068"] = 400;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 100;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"] = 11f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"] = 6.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 2f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0052\u006F\u0077\u0042\u006F\u0061\u0074 \u0042\u006F\u0061\u0074 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u0065\u006C\u0069\u0074\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0048\u0065\u0061\u006C\u0074\u0068"] = 700;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"] = 6f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"] = 18f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0065\u0070\u0074\u0068"] = 6f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 \u0054\u0061\u006B\u0065 \u0044\u0061\u006D\u0061\u0067\u0065"] = 2500;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u006E\u006F\u0072\u006D\u0061\u006C.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u0065\u0061\u006C\u0074\u0068"] = 400;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 100;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074"] = 3;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"] = 25f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"] = 4.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u006F\u0076\u0065\u0072 \u0048\u0065\u0069\u0067\u0068\u0074"] = 30f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 4.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u004F\u0072\u0062\u0069\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 50f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0061\u0072\u0067\u0065\u0074 \u0054\u0068\u0072\u0065\u0061\u0074 \u004C\u0065\u0076\u0065\u006C"] = 0.8f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006E\u0070\u0063/\u0070\u0061\u0074\u0072\u006F\u006C \u0068\u0065\u006C\u0069\u0063\u006F\u0070\u0074\u0065\u0072/\u0068\u0065\u006C\u0069_\u0063\u0072\u0061\u0074\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 3;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u0065\u0061\u006C\u0074\u0068"] = 850;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 100;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004E\u0050\u0043 \u0041\u006D\u006F\u0075\u006E\u0074"] = 11;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0053\u0070\u0065\u0065\u0064"] = 20f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0075\u0072\u006E \u0053\u0070\u0065\u0065\u0064"] = 2.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0048\u006F\u0076\u0065\u0072 \u0048\u0065\u0069\u0067\u0068\u0074"] = 35f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0041\u0049 \u0054\u0061\u0072\u0067\u0065\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 4.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u004F\u0072\u0062\u0069\u0074 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 55f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0063\u0072\u0061\u0070\u0063\u006F\u0070\u0074\u0065\u0072 \u0054\u0061\u0072\u0067\u0065\u0074 \u0054\u0068\u0072\u0065\u0061\u0074 \u004C\u0065\u0076\u0065\u006C"] = 0.8f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 15f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 0.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0048\u0065\u0061\u006C\u0074\u0068"] = 250f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0052\u006F\u0061\u006D \u0052\u0061\u006E\u0067\u0065"] = 100f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0052\u006F\u0061\u006D"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u0053\u0070\u0065\u0065\u0064"] = 10f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u006E\u006F\u0072\u006D\u0061\u006C.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0050\u0065\u0072 \u0053\u0070\u0061\u0077\u006E"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004D\u0061\u0078 \u0041\u0074 \u004F\u006E\u0063\u0065"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 15f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0048\u0065\u0061\u006C\u0074\u0068"] = 350f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 0.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0052\u006F\u0061\u006D \u0052\u0061\u006E\u0067\u0065"] = 200f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0052\u006F\u0061\u006D"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u0053\u0070\u0065\u0065\u0064"] = 8f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004B\u0069\u0074 \u0042\u006F\u0074\u0073"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u006E\u006F\u0072\u006D\u0061\u006C.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0048\u006F\u0072\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u0055\u0073\u0065 \u0043\u0061\u0072\u0067\u006F\u0073\u0068\u0069\u0070 \u0050\u0061\u0074\u0068 \u0046\u006F\u0072 \u004F\u0063\u0065\u0061\u006E"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0055\u0073\u0065 \u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074 \u0050\u0061\u0074\u0068 \u0046\u006F\u0072 \u0041\u0069\u0072"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0050\u0069\u0072\u0061\u0074\u0065\u0073"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0074\u0061\u0074\u0069\u0063(\u0053\u0065\u0072\u0076\u0065\u0072) \u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0050\u0069\u0072\u0061\u0074\u0065\u0073"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u006F\u0061\u0074\u0073"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0053\u0061\u006D\u0073\u0069\u0074\u0065\u0073 \u0044\u0061\u006D\u0061\u0067\u0065 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 (\u0050\u0069\u0072\u0061\u0074\u0065\u0073)"] = 2f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0054\u0069\u0063\u006B \u0052\u0061\u0074\u0065 (\u0073\u0065\u0063)"] = 1.5f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 \u0057\u0068\u0065\u006E \u0048\u0065\u006C\u0069 \u0048\u0065\u0061\u006C\u0074\u0068 \u0042\u0065\u006C\u006F\u0077"] = 20f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 \u0044\u0065\u0063\u0061\u0079 (\u0073\u0065\u0063)"] = 30f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065 \u0053\u0075\u0069\u0063\u0069\u0064\u0065 (\u0073\u0065\u0063)"] = 300f;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0052\u0061\u0064\u0069\u006F \u0044\u0069\u0073\u0061\u0062\u006C\u0065"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0052\u0061\u0064\u0069\u006F \u0043\u0075\u0073\u0074\u006F\u006D"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u004B\u0069\u006C\u006C \u0056\u006F\u0069\u0063\u0065"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0044\u0065\u0061\u0074\u0068 \u0056\u006F\u0069\u0063\u0065"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0057\u0061\u0072\u006E\u0069\u006E\u0067 \u0056\u006F\u0069\u0063\u0065"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0052\u0061\u0064\u0069\u006F \u0043\u0075\u0073\u0074\u006F\u006D \u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"] = 10;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0044\u0065\u0061\u0074\u0068 \u0056\u006F\u0069\u0063\u0065\u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"] = 8;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u004B\u0069\u006C\u006C \u0056\u006F\u0069\u0063\u0065 \u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"] = 8;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0057\u0061\u0072\u006E\u0069\u006E\u0067 \u0056\u006F\u0069\u0063\u0065 \u0043\u006F\u006F\u006C\u0064\u006F\u0077\u006E"] = 10;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0075\u0073\u0074\u006F\u006D \u0057\u0061\u0072\u006E\u0069\u006E\u0067 \u0056\u006F\u0069\u0063\u0065 \u0054\u0072\u0069\u0067\u0067\u0065\u0072 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 10;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u004D\u0061\u0078 \u0056\u006F\u0069\u0063\u0065\u0073 \u0054\u006F \u0050\u006C\u0061\u0079 \u0041\u0074 \u004F\u006E\u0063\u0065 \u004F\u006E \u0053\u0065\u0072\u0076\u0065\u0072"] = 10;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0053\u0075\u0070\u0070\u006C\u0079 \u0044\u0072\u006F\u0070\u0073"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0041\u0074\u0074\u0061\u0063\u006B \u0043\u0072\u0065\u0061\u0074\u0065\u0073 \u0042\u0065\u0069\u006E\u0067 \u0048\u0061\u0063\u006B\u0065\u0064"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0043\u006F\u0075\u006E\u0074\u0065\u0072 \u0052\u0061\u0069\u0064\u0073"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072 \u004D\u006F\u0064\u0065"] = \u0074\u0072\u0075\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072 \u0054\u006F\u0067\u0067\u006C\u0065 \u0048\u006F\u0073\u0074\u0069\u006C\u0065 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043 \u0044\u0061\u006D\u0061\u0067\u0065 \u0053\u0063\u0061\u006C\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043 \u0041\u0069\u006D \u0053\u0063\u0061\u006C\u0065\u0072"] = 1;\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u004E\u0061\u006D\u0065 \u0054\u0061\u0067"] = "[\u0050\u0069\u0072\u0061\u0074\u0065]";\u0043\u006F\u006E\u0066\u0069\u0067["\u004E\u0050\u0043\u0073 \u0043\u0061\u006E \u0054\u0061\u0072\u0067\u0065\u0074 \u004F\u0074\u0068\u0065\u0072 \u004E\u0050\u0043\u0073"] = \u0066\u0061\u006C\u0073\u0065;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 \u0046\u0072\u006F\u006D \u0050\u004F\u0049 \u0041\u0069\u0072"] = 5000f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 \u0046\u0072\u006F\u006D \u0050\u004F\u0049 \u0057\u0061\u0074\u0065\u0072"] = 400f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 \u0046\u0072\u006F\u006D \u0050\u004F\u0049 \u004C\u0061\u006E\u0064"] = 800f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0050\u004F\u0049 \u0045\u0078\u0070\u0069\u0072\u0065\u0073 \u0041\u0066\u0074\u0065\u0072 (\u0073\u0065\u0063)"] = 60f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u0054\u006F \u0053\u0070\u0061\u0077\u006E"] = 3;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u0041\u006D\u006F\u0075\u006E\u0074 \u004F\u0066 \u004E\u0050\u0043\u0073"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 0.6f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 150f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004E\u0050\u0043 \u004B\u0069\u0074"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u0057\u0061\u006C\u006C \u0052\u0061\u0064\u0069\u0075\u0073"] = 10;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u0065\u006C\u0069\u0074\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0042\u0061\u0073\u0065 \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u0041\u006D\u006F\u0075\u006E\u0074 \u0054\u006F \u0053\u0070\u0061\u0077\u006E"] = 2;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u0054\u0072\u0061\u0069\u006E \u0048\u0065\u0061\u006C\u0074\u0068"] = 1000;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u0041\u006D\u006F\u0075\u006E\u0074 \u004F\u0066 \u004E\u0050\u0043\u0073"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004E\u0050\u0043 \u0041\u0069\u006D \u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065"] = 0.6f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004E\u0050\u0043 \u0048\u0065\u0061\u006C\u0074\u0068"] = 150f;\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004E\u0050\u0043 \u004B\u0069\u0074"] = "";\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 (\u004C\u0065\u0061\u0076\u0065 \u0042\u006C\u0061\u006E\u006B \u0046\u006F\u0072 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u004C\u006F\u006F\u0074)"] = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0072\u0061\u0064\u0074\u006F\u0077\u006E/\u0063\u0072\u0061\u0074\u0065_\u0065\u006C\u0069\u0074\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0043\u006F\u006E\u0066\u0069\u0067["\u0050\u0069\u0072\u0061\u0074\u0065 \u0052\u0061\u0069\u006C \u004C\u006F\u006F\u0074 \u0053\u0070\u0061\u0077\u006E\u0065\u0072 \u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072"] = 4;\u0043\u006F\u006E\u0066\u0069\u0067["\u0058\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073"] = "<\u0050\u0072\u006F\u0066\u0069\u006C\u0065>\u006A\u0075\u006D\u0070\u0073\u0075\u0069\u0074.\u0073\u0075\u0069\u0074.\u0062\u006C\u0075\u0065,1,0|\u006D\u0061\u0078\u0068\u0065\u0061\u006C\u0074\u0068\u0074\u0065\u0061.\u0070\u0075\u0072\u0065,1,0|\u0061\u006D\u006D\u006F.\u0072\u0069\u0066\u006C\u0065,30,0|\u0072\u0069\u0066\u006C\u0065\u0062\u006F\u0064\u0079,2,0|\u0067\u0075\u006E\u0070\u006F\u0077\u0064\u0065\u0072,150,0|\u0063\u0061\u006E.\u0062\u0065\u0061\u006E\u0073,1,0";}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0062\u0061\u0073\u0065")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0042\u0061\u0073\u0065(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 7);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0073\u0068\u006F\u0077\u0072\u006F\u0061\u0064")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0068\u006F\u0077\u0052\u006F\u0061\u0064(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (!\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0072\u0065\u0074\u0075\u0072\u006E;} \u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0076 \u0069\u006E \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073){\u0070\u006C\u0061\u0079\u0065\u0072.\u0053\u0065\u006E\u0064\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0064\u0064\u0072\u0061\u0077.\u0073\u0070\u0068\u0065\u0072\u0065", 8f, \u0043\u006F\u006C\u006F\u0072.\u0062\u006C\u0075\u0065, \u0076, 1f);}}[\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0061\u0064\u0064\u0070\u006F\u0069")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u006D\u0064\u0041\u0064\u0064\u0050\u004F\u0049(\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0053\u0079\u0073\u0074\u0065\u006D.\u0041\u0072\u0067 \u0061\u0072\u0067){\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072 = \u0061\u0072\u0067?.\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0069\u006F\u006E?.\u0070\u006C\u0061\u0079\u0065\u0072 \u0061\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;\u0069\u0066 ((\u0070\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C && \u0070\u006C\u0061\u0079\u0065\u0072?.\u006E\u0065\u0074?.\u0063\u006F\u006E\u006E\u0065\u0063\u0074\u0069\u006F\u006E.\u0061\u0075\u0074\u0068\u004C\u0065\u0076\u0065\u006C < 2) || \u0061\u0072\u0067?.\u0041\u0072\u0067\u0073?.\u004C\u0065\u006E\u0067\u0074\u0068 != 2){\u0072\u0065\u0074\u0075\u0072\u006E;} \u004D\u0061\u006E\u0075\u0061\u006C\u006C\u0079\u0061\u0064\u0064\u0070\u006F\u0069(\u0061\u0072\u0067.\u0041\u0072\u0067\u0073, \u006E\u0075\u006C\u006C);}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0070\u006F\u0069")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0041\u0064\u0064\u0050\u004F\u0049(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u0063\u006F\u006D\u006D\u0061\u006E\u0064, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0041\u0072\u0067\u0073){\u0069\u0066 (!\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0072\u0065\u0074\u0075\u0072\u006E;} \u004D\u0061\u006E\u0075\u0061\u006C\u006C\u0079\u0061\u0064\u0064\u0070\u006F\u0069(\u0041\u0072\u0067\u0073, \u0070\u006C\u0061\u0079\u0065\u0072);}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0063\u006C\u0065\u0061\u0072\u0070\u006F\u0069")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0043\u006C\u0065\u0061\u0072\u0050\u006F\u0069(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u0063\u006F\u006D\u006D\u0061\u006E\u0064, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0041\u0072\u0067\u0073){\u0069\u0066 (!\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0072\u0065\u0074\u0075\u0072\u006E;} \u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006C\u0065\u0061\u0072();}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0072\u0068\u0069\u0062")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0052\u0068\u0069\u0062(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0048\u0049\u0042++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0072\u006F\u0077\u0062\u006F\u0061\u0074")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0052\u006F\u0077\u0042\u006F\u0061\u0074(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u006F\u0077\u0042\u006F\u0061\u0074++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 1);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0073\u0075\u0062")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0073\u0075\u0062(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0075\u0062++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 6);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u006D\u0069\u006E\u0069")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u004D\u0069\u006E\u0069(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0073\u004D\u0069\u006E\u0069++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 2);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0073\u0063\u0072\u0061\u0070")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0053\u0063\u0072\u0061\u0070(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0063\u0072\u0061\u0070++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 3);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0068\u006F\u0072\u0073\u0065")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0048\u006F\u0072\u0073\u0065(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0048\u006F\u0072\u0073\u0065++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 4);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0073\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 5);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0074\u0072\u0061\u0069\u006E")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u0053\u0070\u0061\u0077\u006E\u0054\u0072\u0061\u0069\u006E(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 8);}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0072\u0065\u006C\u006F\u0061\u0064")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0065\u0077 \u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();\u0042\u0075\u0069\u006C\u0064\u004C\u006F\u006F\u0074\u0054\u0061\u0062\u006C\u0065();}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0073\u0068\u006F\u0077\u0070\u0061\u0074\u0068")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0072\u0061\u0077\u0050\u0061\u0074\u0068(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 \u0069\u006E \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073){\u0070\u006C\u0061\u0079\u0065\u0072.\u0053\u0065\u006E\u0064\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0064\u0064\u0072\u0061\u0077.\u0073\u0070\u0068\u0065\u0072\u0065", 8f, \u0043\u006F\u006C\u006F\u0072.\u0062\u006C\u0075\u0065, \u0076\u0065\u0063\u0074\u006F\u0072, 2f);} \u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 \u0069\u006E \u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073){\u0070\u006C\u0061\u0079\u0065\u0072.\u0053\u0065\u006E\u0064\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0064\u0064\u0072\u0061\u0077.\u0073\u0070\u0068\u0065\u0072\u0065", 8f, \u0043\u006F\u006C\u006F\u0072.\u0072\u0065\u0064, \u0076\u0065\u0063\u0074\u006F\u0072, 2f);} \u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 \u0069\u006E \u0067\u0072\u006F\u0075\u006E\u0064\u006E\u006F\u0064\u0065\u0073){\u0070\u006C\u0061\u0079\u0065\u0072.\u0053\u0065\u006E\u0064\u0043\u006F\u006E\u0073\u006F\u006C\u0065\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0064\u0064\u0072\u0061\u0077.\u0073\u0070\u0068\u0065\u0072\u0065", 8f, \u0043\u006F\u006C\u006F\u0072.\u0072\u0065\u0064, \u0076\u0065\u0063\u0074\u006F\u0072, 2f);}} }[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0063\u0061\u0072\u0067\u006F\u0070\u0061\u0074\u0068")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0077\u0069\u0074\u0063\u0068\u0050\u0061\u0074\u0068\u0043\u0061\u0072\u0067\u006F(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0077\u0069\u0074\u0063\u0068\u0069\u006E\u0067 \u0074\u006F \u0043\u0061\u0072\u0067\u006F \u0050\u0061\u0074\u0068\u0069\u006E\u0067");\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u004F\u0063\u0065\u0061\u006E\u0050\u0061\u0074\u0072\u006F\u006C\u0046\u0061\u0072;}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0063\u0075\u0073\u0074\u006F\u006D\u0073\u0065\u0061\u0070\u0061\u0074\u0068")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0077\u0069\u0074\u0063\u0068\u0050\u0061\u0074\u0068\u0043\u0075\u0073\u0074\u006F\u006D(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0077\u0069\u0074\u0063\u0068\u0069\u006E\u0067 \u0074\u006F \u0043\u0075\u0073\u0074\u006F\u006D \u0050\u0061\u0074\u0068\u0069\u006E\u0067");\u0053\u0065\u0074\u0075\u0070\u004F\u0063\u0065\u0061\u006E\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068();}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u006D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0070\u0061\u0074\u0068")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0077\u0069\u0074\u0063\u0068\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0050\u0061\u0074\u0068(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0077\u0069\u0074\u0063\u0068\u0069\u006E\u0067 \u0074\u006F \u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074 \u0050\u0061\u0074\u0068\u0069\u006E\u0067");\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073 = \u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0050\u0061\u0074\u0068();}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0063\u0075\u0073\u0074\u006F\u006D\u0061\u0069\u0072\u0070\u0061\u0074\u0068")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0077\u0069\u0074\u0063\u0068\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0043\u0075\u0073\u0074\u006F\u006D(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0077\u0069\u0074\u0063\u0068\u0069\u006E\u0067 \u0074\u006F \u0043\u0075\u0073\u0074\u006F\u006D \u0041\u0069\u0072 \u0050\u0061\u0074\u0068\u0069\u006E\u0067");\u0053\u0065\u0074\u0075\u0070\u0041\u0069\u0072\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068();}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u0074\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u0074\u0065\u0073\u0074")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0074\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u0074\u0065\u0073\u0074(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065(\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u004D\u0061\u0070.\u0047\u0065\u0074\u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u0042\u0061\u0073\u0065\u0042\u006C\u006F\u0063\u006B).\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());}}[\u0043\u0068\u0061\u0074\u0043\u006F\u006D\u006D\u0061\u006E\u0064("\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u006C\u006F\u006F\u0074")]\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0075\u0070\u004C\u006F\u006F\u0074(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0073\u0074\u0072\u0069\u006E\u0067 \u0063\u006F\u006D\u006D\u0061\u006E\u0064, \u0073\u0074\u0072\u0069\u006E\u0067[] \u0061\u0072\u0067\u0073){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0041\u0064\u006D\u0069\u006E){\u0074\u0072\u0079{\u0069\u0066 (\u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 < 1){\u0053\u0068\u006F\u0077\u0048\u0065\u006C\u0070(\u0070\u006C\u0061\u0079\u0065\u0072);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==1 && \u0061\u0072\u0067\u0073[0].\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0061\u0064\u0064")){\u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0070\u0072\u006F\u0066\u0069\u006C\u0065 = \u006E\u0065\u0077 \u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072();\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0069\u0073\u0053\u0065\u0072\u0076\u0065\u0072 = \u0074\u0072\u0075\u0065;\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0065\u006E\u0074\u0069\u0074\u0079\u004F\u0077\u006E\u0065\u0072 = \u0070\u006C\u0061\u0079\u0065\u0072;\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0061\u006C\u006C\u006F\u0077\u0065\u0064\u0043\u006F\u006E\u0074\u0065\u006E\u0074\u0073 = \u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0043\u006F\u006E\u0074\u0065\u006E\u0074\u0073\u0054\u0079\u0070\u0065.\u0047\u0065\u006E\u0065\u0072\u0069\u0063;\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0047\u0069\u0076\u0065\u0055\u0049\u0044();\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0063\u0061\u0070\u0061\u0063\u0069\u0074\u0079 = 30;\u0069\u0066 (!_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070\u006C\u0061\u0079\u0065\u0072)){_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0041\u0064\u0064(\u0070\u006C\u0061\u0079\u0065\u0072);}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(0.5f, () =>{\u004C\u006F\u006F\u0074\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0070\u006C\u0061\u0079\u0065\u0072, \u0070\u0072\u006F\u0066\u0069\u006C\u0065);});\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0043\u0072\u0065\u0061\u0074\u0065\u0064 \u004E\u0065\u0077 \u004C\u006F\u006F\u0074 \u0050\u0072\u006F\u0066\u0069\u006C\u0065.");\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0061\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==2 && \u0061\u0072\u0067\u0073[0].\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0065\u0064\u0069\u0074")){\u0069\u0066 (\u0061\u0072\u0067\u0073[1].\u0049\u0073\u004E\u0075\u006D\u0065\u0072\u0069\u0063()){\u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0070\u0072\u006F\u0066\u0069\u006C\u0065 = \u006E\u0065\u0077 \u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072();\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0069\u0073\u0053\u0065\u0072\u0076\u0065\u0072 = \u0074\u0072\u0075\u0065;\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0065\u006E\u0074\u0069\u0074\u0079\u004F\u0077\u006E\u0065\u0072 = \u0070\u006C\u0061\u0079\u0065\u0072;\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0061\u006C\u006C\u006F\u0077\u0065\u0064\u0043\u006F\u006E\u0074\u0065\u006E\u0074\u0073 = \u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0043\u006F\u006E\u0074\u0065\u006E\u0074\u0073\u0054\u0079\u0070\u0065.\u0047\u0065\u006E\u0065\u0072\u0069\u0063;\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0047\u0069\u0076\u0065\u0055\u0049\u0044();\u0070\u0072\u006F\u0066\u0069\u006C\u0065.\u0063\u0061\u0070\u0061\u0063\u0069\u0074\u0079 = 30;\u0069\u0066 (!_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070\u006C\u0061\u0079\u0065\u0072)){_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0041\u0064\u0064(\u0070\u006C\u0061\u0079\u0065\u0072);}\u0066\u0069\u006C\u006C\u006C\u006F\u006F\u0074(\u0070\u0072\u006F\u0066\u0069\u006C\u0065, \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0061\u0072\u0067\u0073[1]), 0);\u0070\u006C\u0075\u0067\u0069\u006E.\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0052\u0065\u006D\u006F\u0076\u0065\u0041\u0074(\u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0061\u0072\u0067\u0073[1]));\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(0.5f, () =>{\u004C\u006F\u006F\u0074\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0070\u006C\u0061\u0079\u0065\u0072, \u0070\u0072\u006F\u0066\u0069\u006C\u0065);});\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0045\u0064\u0069\u0074\u0069\u006E\u0067 \u004C\u006F\u006F\u0074 \u0050\u0072\u006F\u0066\u0069\u006C\u0065.");}\u0065\u006C\u0073\u0065 {\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u004D\u0075\u0073\u0074 \u0070\u0072\u006F\u0066\u0069\u006C\u0065 \u0070\u0072\u006F\u0066\u0069\u006C\u0065 \u0069\u006E\u0064\u0065\u0078 \u006E\u0075\u006D\u0062\u0065\u0072.");}\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0063\u0061\u0074\u0063\u0068 {\u0053\u0068\u006F\u0077\u0048\u0065\u006C\u0070(\u0070\u006C\u0061\u0079\u0065\u0072);}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0049\u006E\u0069\u0074(){\u0070\u006C\u0075\u0067\u0069\u006E = \u0074\u0068\u0069\u0073;\u0074\u0072\u0079{_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0065\u0077 \u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();}\u0063\u0061\u0074\u0063\u0068{\u0050\u0075\u0074\u0073("\u0046\u0061\u0069\u006C\u0065\u0064 \u0074\u006F \u006C\u006F\u0061\u0064 \u0073\u0065\u0074\u0074\u0069\u006E\u0067\u0073, \u0052\u0065\u0073\u0065\u0074\u0074\u0069\u006E\u0067 \u0074\u006F \u0064\u0065\u0066\u0061\u0075\u006C\u0074");\u004C\u006F\u0061\u0064\u0044\u0065\u0066\u0061\u0075\u006C\u0074\u0043\u006F\u006E\u0066\u0069\u0067();\u0053\u0061\u0076\u0065\u0043\u006F\u006E\u0066\u0069\u0067();_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0065\u0077 \u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u0061\u0064\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073();}\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0041\u0074\u0074\u0061\u0063\u006B\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070\u0073){\u0055\u006E\u0073\u0075\u0062\u0073\u0063\u0072\u0069\u0062\u0065("\u004F\u006E\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070\u004C\u0061\u006E\u0064\u0065\u0064");}\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0041\u0074\u0074\u0061\u0063\u006B\u0043\u0072\u0065\u0061\u0074\u0065){\u0055\u006E\u0073\u0075\u0062\u0073\u0063\u0072\u0069\u0062\u0065("\u004F\u006E\u0043\u0072\u0061\u0074\u0065\u0048\u0061\u0063\u006B");}\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073){\u0055\u006E\u0073\u0075\u0062\u0073\u0063\u0072\u0069\u0062\u0065("\u004F\u006E\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0054\u0061\u0072\u0067\u0065\u0074\u0053\u0063\u0061\u006E");}\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0061\u0069\u0064\u0061\u0062\u006C\u0065\u0042\u0061\u0073\u0065\u0073\u0041\u0054){\u0055\u006E\u0073\u0075\u0062\u0073\u0063\u0072\u0069\u0062\u0065("\u0043\u0061\u006E\u0042\u0065\u0054\u0061\u0072\u0067\u0065\u0074\u0065\u0064");}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0053\u0065\u0072\u0076\u0065\u0072\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0064(\u0062\u006F\u006F\u006C \u0069\u006E\u0069\u0074\u0069\u0061\u006C){\u0042\u0075\u0069\u006C\u0064\u004C\u006F\u006F\u0074\u0054\u0061\u0062\u006C\u0065();\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0043\u0061\u0072\u0067\u006F\u0050\u0061\u0074\u0068){\u0053\u0065\u0074\u0075\u0070\u004F\u0063\u0065\u0061\u006E\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068();} \u0065\u006C\u0073\u0065 {\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u004F\u0063\u0065\u0061\u006E\u0050\u0061\u0074\u0072\u006F\u006C\u0046\u0061\u0072;\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0050\u0075\u0074\u0073("\u004C\u006F\u0061\u0064\u0065\u0064 " + \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0053\u0065\u0061 \u004E\u006F\u0064\u0065\u0073.");}\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0050\u0061\u0074\u0068){\u0053\u0065\u0074\u0075\u0070\u0041\u0069\u0072\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068();} \u0065\u006C\u0073\u0065 {\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073 = \u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0050\u0061\u0074\u0068();\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;}\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0052\u006F\u0061\u0064\u0047\u0072\u0069\u0064()));\u0053\u0065\u0074\u0075\u0070\u004C\u0061\u006E\u0064\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068();\u0053\u0065\u0074\u0075\u0070\u0052\u0061\u0069\u006C\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068();;\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0068\u006F\u0077\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0073){\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u004D\u0061\u0070\u0052\u006F\u0075\u0074\u0069\u006E\u0065()));};\u0050\u0069\u0072\u0061\u0074\u0065\u0053\u0070\u0061\u0077\u006E\u0065\u0072();\u0073\u0070\u0061\u0077\u006E\u0065\u0072 = \u0074\u0069\u006D\u0065\u0072.\u0045\u0076\u0065\u0072\u0079(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0070\u0061\u0077\u006E\u0045\u0076\u0065\u0072\u0079, () =>{\u0050\u0069\u0072\u0061\u0074\u0065\u0053\u0070\u0061\u0077\u006E\u0065\u0072();});\u0069\u0066 (!\u0069\u006E\u0069\u0074\u0069\u0061\u006C){\u0043\u006C\u0065\u0061\u0072\u0055\u0070\u0056\u0065\u0063\u0074\u006F\u0072\u005A\u0065\u0072\u006F(\u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0055\u006E\u006C\u006F\u0061\u0064(){\u0069\u0066 (\u0073\u0070\u0061\u0077\u006E\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0073\u0070\u0061\u0077\u006E\u0065\u0072.\u0044\u0065\u0073\u0074\u0072\u006F\u0079();\u0073\u0070\u0061\u0077\u006E\u0065\u0072 = \u006E\u0075\u006C\u006C;}\u004B\u0069\u006C\u006C\u004C\u0069\u0073\u0074(\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073);\u004B\u0069\u006C\u006C\u004C\u0069\u0073\u0074(\u004E\u0050\u0043\u0073);\u0043\u006C\u0065\u0061\u0072\u004C\u006F\u006F\u0074(\u0050\u0069\u0072\u0061\u0074\u0065);\u004B\u0069\u006C\u006C\u004C\u0069\u0073\u0074(\u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073);\u004B\u0069\u006C\u006C\u004C\u0069\u0073\u0074(\u0050\u0069\u0072\u0061\u0074\u0065);\u0069\u0066 (\u0054\u0068\u0072\u0065\u0061\u0064\u0073 != \u006E\u0075\u006C\u006C && \u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0043\u006F\u0075\u006E\u0074 != 0){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065 \u0063\u006F \u0069\u006E \u0054\u0068\u0072\u0065\u0061\u0064\u0073){\u0069\u0066 (\u0063\u006F != \u006E\u0075\u006C\u006C) \u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u006F\u0070\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0063\u006F);}\u0054\u0068\u0072\u0065\u0061\u0064\u0073 = \u006E\u0075\u006C\u006C;\u004D\u0061\u0072\u006B\u0065\u0072\u0044\u0069\u0073\u0070\u006C\u0061\u0079\u0069\u006E\u0067\u0044\u0065\u006C\u0065\u0074\u0065();}_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073 = \u006E\u0075\u006C\u006C;\u0070\u006C\u0075\u0067\u0069\u006E = \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0043\u0061\u006E\u004C\u006F\u006F\u0074\u0050\u006C\u0061\u0079\u0065\u0072(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u006C\u006F\u006F\u0074\u0065\u0064, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u006C\u006F\u006F\u0074\u0065\u0072){\u0069\u0066 (_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u006C\u006F\u006F\u0074\u0065\u0072)){\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;} \u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074\u0045\u006E\u0064(\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074 \u0070\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074){\u0076\u0061\u0072 \u0070\u006C\u0061\u0079\u0065\u0072 = (\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072)\u0070\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0054\u006F\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070\u006C\u0061\u0079\u0065\u0072)){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0073[0].\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074==\u006E\u0075\u006C\u006C){_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006C\u0065\u0061\u0072();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0073[0].\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074.\u0043\u006F\u0075\u006E\u0074==0){\u0073\u0061\u0076\u0065\u006C\u006F\u006F\u0074();_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006C\u0065\u0061\u0072();\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u0044\u0065\u006C\u0065\u0074\u0065\u0064.");\u0072\u0065\u0074\u0075\u0072\u006E;}\u0076\u0061\u0072 \u006E\u0065\u0077\u0069\u0074\u0065\u006D\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>>();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0049\u0074\u0065\u006D \u0070\u006C \u0069\u006E \u0070\u006C\u0061\u0079\u0065\u0072\u004C\u006F\u006F\u0074.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0073[0].\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074){\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069\u0074\u0065\u006D\u0073 = \u006E\u0065\u0077 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>();\u0069\u0074\u0065\u006D\u0073.\u0041\u0064\u0064(\u0070\u006C.\u0069\u006E\u0066\u006F.\u0073\u0068\u006F\u0072\u0074\u006E\u0061\u006D\u0065, \u0070\u006C.\u0061\u006D\u006F\u0075\u006E\u0074 + "," + \u0070\u006C.\u0073\u006B\u0069\u006E);\u006E\u0065\u0077\u0069\u0074\u0065\u006D\u0073.\u0041\u0064\u0064(\u0069\u0074\u0065\u006D\u0073);}\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0041\u0064\u0064(\u006E\u0065\u0077\u0069\u0074\u0065\u006D\u0073);\u0073\u0061\u0076\u0065\u006C\u006F\u006F\u0074();_\u006F\u0070\u0065\u006E\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006C\u0065\u0061\u0072();\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0061\u0076\u0065\u0064 \u004C\u006F\u006F\u0074 \u0050\u0072\u006F\u0066\u0069\u006C\u0065 \u0043\u0068\u0061\u006E\u0067\u0065\u0073.");}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0043\u0061\u006E\u0042\u0065\u0054\u0061\u0072\u0067\u0065\u0074\u0065\u0064(\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079 \u0074\u0061\u0072\u0067\u0065\u0074, \u0041\u0075\u0074\u006F\u0054\u0075\u0072\u0072\u0065\u0074 \u0061\u0074){\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074==\u006E\u0075\u006C\u006C || \u0061\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0061\u0074.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 != 0){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074.\u006E\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0074\u0061\u0072\u0067\u0065\u0074.\u006E\u0065\u0074.\u0049\u0044) || \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0074\u0061\u0072\u0067\u0065\u0074.\u006E\u0065\u0074.\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0043\u0061\u006E\u004D\u006F\u0075\u006E\u0074\u0045\u006E\u0074\u0069\u0074\u0079(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0042\u0061\u0073\u0065\u004D\u006F\u0075\u006E\u0074\u0061\u0062\u006C\u0065 \u006D\u006F\u0075\u006E\u0074){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C | \u006D\u006F\u0075\u006E\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064==\u0066\u0061\u006C\u0073\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065 \u0062\u0076 = \u006D\u006F\u0075\u006E\u0074.\u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0050\u0061\u0072\u0065\u006E\u0074();\u0069\u0066 (\u0062\u0076 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0050\u0069\u0072\u0061\u0074\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0062\u0076.\u006E\u0065\u0074.\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0053\u0070\u0061\u0077\u006E\u0065\u0064(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0073\u0070\u0061\u0077\u006E\u0065\u0064){\u0048\u0065\u006C\u0069\u0063\u006F\u0070\u0074\u0065\u0072\u0044\u0065\u0062\u0072\u0069\u0073 \u0064\u0065\u0062\u0072\u0069\u0073 = \u0073\u0070\u0061\u0077\u006E\u0065\u0064 \u0061\u0073 \u0048\u0065\u006C\u0069\u0063\u006F\u0070\u0074\u0065\u0072\u0044\u0065\u0062\u0072\u0069\u0073;\u0069\u0066 (\u0064\u0065\u0062\u0072\u0069\u0073 != \u006E\u0075\u006C\u006C){\u004E\u0065\u0078\u0074\u0054\u0069\u0063\u006B(() =>{\u0069\u0066 (\u0064\u0065\u0062\u0072\u0069\u0073 != \u006E\u0075\u006C\u006C && _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0053\u0063\u0072\u0061\u0070\u0048\u0065\u006C\u0069\u0047\u0069\u0062\u0073 && \u0064\u0065\u0062\u0072\u0069\u0073.\u0053\u0068\u006F\u0072\u0074\u0050\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065=="\u0073\u0065\u0072\u0076\u0065\u0072\u0067\u0069\u0062\u0073_\u0073\u0063\u0072\u0061\u0070\u0074\u0072\u0061\u006E\u0073\u0070\u006F\u0072\u0074"){\u0064\u0065\u0062\u0072\u0069\u0073.\u004B\u0069\u006C\u006C();}});}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0043\u0061\u006E\u0044\u0069\u0073\u006D\u006F\u0075\u006E\u0074\u0045\u006E\u0074\u0069\u0074\u0079(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0042\u0061\u0073\u0065\u004D\u006F\u0075\u006E\u0074\u0061\u0062\u006C\u0065 \u006D\u006F\u0075\u006E\u0074){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C && \u006D\u006F\u0075\u006E\u0074==\u006E\u0075\u006C\u006C || \u0070\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;} \u0069\u0066 (\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;} \u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u004F\u006E\u004E\u0070\u0063\u0052\u0061\u0064\u0069\u006F\u0043\u0068\u0061\u0074\u0074\u0065\u0072(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u0062\u006F\u0074){\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0043\u0068\u0061\u0074\u0074\u0065\u0072 != ""){\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0062\u006F\u0074.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (\u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u0075\u006E\u0074 > _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u004D\u0061\u0078\u0056\u006F\u0069\u0063\u0065\u0073\u0041\u0074\u004F\u006E\u0063\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u0070 \u0069\u006E \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0061\u0063\u0074\u0069\u0076\u0065\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u0069\u0073\u0074){\u0069\u0066 (\u0062\u006F\u0074.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0070.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) < 90){\u0066\u006C\u0061\u0067 = \u0074\u0072\u0075\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (!\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) && \u0066\u006C\u0061\u0067){\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0041\u0064\u0064(\u0049\u0044);\u0057\u0065\u0062\u0050\u006C\u0061\u0079\u0062\u0061\u0063\u006B(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0043\u0068\u0061\u0074\u0074\u0065\u0072, \u0062\u006F\u0074);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0043\u0068\u0061\u0074\u0074\u0065\u0072\u0043\u0044, () =>{\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0052\u0065\u006D\u006F\u0076\u0065(\u0049\u0044);});\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}}\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0068\u0061\u0074\u0074\u0065\u0072){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070\u004C\u0061\u006E\u0064\u0065\u0064(\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070 \u0073\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070){\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0041\u0074\u0074\u0061\u0063\u006B\u0053\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070\u0073){\u0061\u0073\u0073\u0069\u0067\u006E\u0050\u004F\u0049(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0073\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0073\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u0073\u0075\u0070\u0070\u006C\u0079\u0044\u0072\u006F\u0070.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A));}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0043\u0072\u0061\u0074\u0065\u0048\u0061\u0063\u006B(\u0048\u0061\u0063\u006B\u0061\u0062\u006C\u0065\u004C\u006F\u0063\u006B\u0065\u0064\u0043\u0072\u0061\u0074\u0065 \u0068\u0061\u0063\u006B\u0061\u0062\u006C\u0065\u004C\u006F\u0063\u006B\u0065\u0064\u0043\u0072\u0061\u0074\u0065){\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0041\u00