2\u0061\u0064\u0069\u0075\u0073){\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0074\u0061\u0074\u0069\u0063\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073 && \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0073\u0074\u0061\u0074\u0069\u0063\u0052\u0065\u0073\u0070\u0061\u0077\u006E){\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0043\u006C\u0065\u0061\u0072\u0054\u0061\u0072\u0067\u0065\u0074();\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0041\u0050 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>();\u0069\u0066 (\u0041\u0050 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < 3;\u0069++){\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0069 * 0.5f, () =>{\u0069\u0066 (\u0041\u0050==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;} \u0053\u0061\u006D\u004C\u006F\u0067\u0069\u0063(\u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0062\u0065, \u0041\u0050.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079, \u0041\u0050.\u006D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064);});}\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073\u0042\u006F\u0061\u0074){\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 \u0057\u0050 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u0057\u0050 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < 3;\u0069++){\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0069 * 0.5f, () =>{\u0069\u0066 (\u0057\u0050==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;} \u0053\u0061\u006D\u004C\u006F\u0067\u0069\u0063(\u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0062\u0065, \u0057\u0050.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079, 0);});}\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}}}}}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0050\u006C\u0061\u0079\u0065\u0072\u0044\u0065\u0061\u0074\u0068(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0048\u0069\u0074\u0049\u006E\u0066\u006F \u0069\u006E\u0066\u006F){\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C || \u0070\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044) || \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044)){\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0052\u0065\u006D\u006F\u0076\u0065(\u0070\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044);\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 \u0069\u006E \u0070\u006C\u0061\u0079\u0065\u0072.\u0063\u0068\u0069\u006C\u0064\u0072\u0065\u006E.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (\u0062\u0065==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;} \u0062\u0065.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u006E\u0075\u006C\u006C, \u0066\u0061\u006C\u0073\u0065, \u0074\u0072\u0075\u0065);\u0069\u0066 (\u0062\u0065 \u0069\u0073 \u0053\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074){\u0062\u0065.\u004B\u0069\u006C\u006C();}}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0044\u0065\u0061\u0074\u0068(\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074\u0069\u0074\u0079, \u0048\u0069\u0074\u0049\u006E\u0066\u006F \u0069\u006E\u0066\u006F){\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079 != \u006E\u0075\u006C\u006C && \u0069\u006E\u0066\u006F != \u006E\u0075\u006C\u006C){\u0062\u006F\u006F\u006C \u006D\u0065\u0073\u0073\u0061\u0067\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u004B\u0069\u006C\u006C != ""){\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C && \u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) || \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044)){\u006D\u0065\u0073\u0073\u0061\u0067\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0069\u0066 (!\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) && \u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u0075\u006E\u0074 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u004D\u0061\u0078\u0056\u006F\u0069\u0063\u0065\u0073\u0041\u0074\u004F\u006E\u0063\u0065){\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0041\u0064\u0064(\u0049\u0044);\u0057\u0065\u0062\u0050\u006C\u0061\u0079\u0062\u0061\u0063\u006B(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u004B\u0069\u006C\u006C, \u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u004B\u0069\u006C\u006C\u0043\u0044, () =>{\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0052\u0065\u006D\u006F\u0076\u0065(\u0049\u0044);});}}}}\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0044\u0065\u0061\u0074\u0068 != "" && !\u006D\u0065\u0073\u0073\u0061\u0067\u0065\u0064 && \u0065\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0065\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) || \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044)){\u0069\u0066 (!\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) && \u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u0075\u006E\u0074 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u004D\u0061\u0078\u0056\u006F\u0069\u0063\u0065\u0073\u0041\u0074\u004F\u006E\u0063\u0065){\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0041\u0064\u0064(\u0049\u0044);\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070 = \u0065\u006E\u0074\u0069\u0074\u0079.\u0054\u006F\u0050\u006C\u0061\u0079\u0065\u0072();\u0069\u0066 (\u0070 != \u006E\u0075\u006C\u006C){\u0057\u0065\u0062\u0050\u006C\u0061\u0079\u0062\u0061\u0063\u006B(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0044\u0065\u0061\u0074\u0068, \u0070);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0044\u0065\u0061\u0074\u0068\u0043\u0044, () =>{\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0052\u0065\u006D\u006F\u0076\u0065(\u0049\u0044);});}}}}}\u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074\u0073(\u0065\u006E\u0074\u0069\u0074\u0079);\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u006F\u0075\u006E\u0074\u0052\u0061\u0069\u0064\u0073){\u0069\u0066 (\u0069\u006E\u0066\u006F==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0042\u0061\u0073\u0065\u0044\u0061\u006D\u0061\u0067\u0065(\u0065\u006E\u0074\u0069\u0074\u0079)){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 >= 10000000 && \u0065\u006E\u0074\u0069\u0074\u0079.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 <= 20000000){\u0061\u0073\u0073\u0069\u0067\u006E\u0050\u004F\u0049(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A));\u0072\u0065\u0074\u0075\u0072\u006E;}\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0050\u0072\u0069\u0076\u006C\u0069\u0064\u0067\u0065 \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0050\u0072\u0069\u0076\u0069\u006C\u0065\u0067\u0065 = \u0065\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0050\u0072\u0069\u0076\u0069\u006C\u0065\u0067\u0065();\u0069\u0066 (\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0050\u0072\u0069\u0076\u0069\u006C\u0065\u0067\u0065==\u006E\u0075\u006C\u006C || \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0050\u0072\u0069\u0076\u0069\u006C\u0065\u0067\u0065.\u0061\u0075\u0074\u0068\u006F\u0072\u0069\u007A\u0065\u0064\u0050\u006C\u0061\u0079\u0065\u0072\u0073.\u0049\u0073\u0045\u006D\u0070\u0074\u0079()){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0050\u006C\u0061\u0079\u0065\u0072\u004E\u0061\u006D\u0065\u0049\u0044 \u0061\u0074\u0074\u0061\u0063\u006B\u0065\u0064 \u0069\u006E \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0050\u0072\u0069\u0076\u0069\u006C\u0065\u0067\u0065.\u0061\u0075\u0074\u0068\u006F\u0072\u0069\u007A\u0065\u0064\u0050\u006C\u0061\u0079\u0065\u0072\u0073){\u0069\u0066 (\u0061\u0074\u0074\u0061\u0063\u006B\u0065\u0064==\u006E\u0075\u006C\u006C) \u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;\u0069\u0066 (\u0061\u0074\u0074\u0061\u0063\u006B\u0065\u0064.\u0075\u0073\u0065\u0072\u0069\u0064==\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072.\u0075\u0073\u0065\u0072\u0049\u0044) \u0072\u0065\u0074\u0075\u0072\u006E;\u0061\u0073\u0073\u0069\u0067\u006E\u0050\u004F\u0049(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A));}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0043\u0061\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0054\u0061\u006B\u0065\u0044\u0061\u006D\u0061\u0067\u0065(\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074\u0069\u0074\u0079, \u0048\u0069\u0074\u0049\u006E\u0066\u006F \u0068\u0069\u0074\u0049\u006E\u0066\u006F){\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C || \u0050\u0069\u0072\u0061\u0074\u0065==\u006E\u0075\u006C\u006C || \u0068\u0069\u0074\u0049\u006E\u0066\u006F==\u006E\u0075\u006C\u006C || \u0065\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0065\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (\u0050\u0069\u0072\u0061\u0074\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) || \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) || \u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) || \u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u004F\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0054\u0061\u006B\u0065\u0044\u0061\u006D\u0061\u0067\u0065(\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0063\u0065, \u0048\u0069\u0074\u0049\u006E\u0066\u006F \u0069\u006E\u0066\u006F){\u0069\u0066 (\u0062\u0063\u0065==\u006E\u0075\u006C\u006C || \u0050\u0069\u0072\u0061\u0074\u0065==\u006E\u0075\u006C\u006C || \u0069\u006E\u0066\u006F==\u006E\u0075\u006C\u006C || \u0062\u0063\u0065.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0062\u0063\u0065.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (\u0054\u0072\u0061\u0069\u006E\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0062\u0063\u0065)){\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0064\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065\u0073==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0064\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065\u0073.\u0047\u0065\u0074\u004D\u0061\u006A\u006F\u0072\u0069\u0074\u0079\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065()==\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0044\u0065\u0063\u0061\u0079){\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0064\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065\u0073.\u0047\u0065\u0074\u004D\u0061\u006A\u006F\u0072\u0069\u0074\u0079\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065()==\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0043\u006F\u006C\u006C\u0069\u0073\u0069\u006F\u006E){\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}}\u0069\u0066 (\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) || \u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044)){\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072 != \u006E\u0075\u006C\u006C){\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072 = \u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072;\u0069\u0066 (\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0061\u0063\u0074\u0069\u0076\u0065\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u0069\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072)){\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 = \u0062\u0063\u0065 \u0061\u0073 \u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043;\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0054\u0061\u0072\u0067\u0065\u0074\u0073.\u0043\u006C\u0065\u0061\u0072();\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006C\u0061\u0079\u0065\u0072\u0073.\u0043\u006C\u0065\u0061\u0072();\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0054\u0068\u0072\u0065\u0061\u0074\u0073.\u0043\u006C\u0065\u0061\u0072();\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0054\u0061\u0072\u0067\u0065\u0074\u0073.\u0041\u0064\u0064(\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072);\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006C\u0061\u0079\u0065\u0072\u0073.\u0041\u0064\u0064(\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072);\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0054\u0068\u0072\u0065\u0061\u0074\u0073.\u0041\u0064\u0064(\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072);\u0069\u0066 (\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0041\u0074\u0074\u0061\u0063\u006B\u0052\u0061\u006E\u0067\u0065\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072 != 10){\u0066\u006C\u006F\u0061\u0074 \u006F\u006C\u0064\u0054\u004C\u0052 = \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0054\u0061\u0072\u0067\u0065\u0074\u004C\u006F\u0073\u0074\u0052\u0061\u006E\u0067\u0065;\u0066\u006C\u006F\u0061\u0074 \u006F\u006C\u0064\u0041\u0052\u004D = \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0041\u0074\u0074\u0061\u0063\u006B\u0052\u0061\u006E\u0067\u0065\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072;\u0066\u006C\u006F\u0061\u0074 \u006F\u006C\u0064\u0041\u0049\u004D = \u006E\u0070\u0063.\u0061\u0069\u006D\u0043\u006F\u006E\u0065\u0053\u0063\u0061\u006C\u0065;\u006E\u0070\u0063.\u0061\u0069\u006D\u0043\u006F\u006E\u0065\u0053\u0063\u0061\u006C\u0065 = 0.2f;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0054\u0061\u0072\u0067\u0065\u0074\u004C\u006F\u0073\u0074\u0052\u0061\u006E\u0067\u0065 = 800;\u006E\u0070\u0063.\u0042\u0072\