\u0053\u0061\u006D\u0053\u0069\u0074\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072 \u0069\u0073 \u0041\u0075\u0074\u006F\u0054\u0075\u0072\u0072\u0065\u0074){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072 \u0069\u0073 \u0042\u0061\u0073\u0065\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072 = \u0069\u006E\u0066\u006F.\u0049\u006E\u0069\u0074\u0069\u0061\u0074\u006F\u0072\u0050\u006C\u0061\u0079\u0065\u0072;\u0069\u0066 (\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0061\u0063\u0074\u0069\u0076\u0065\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u0069\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072)){\u0050\u0069\u0072\u0061\u0074\u0065\u0041\u0074\u0074\u0061\u0063\u006B\u0065\u0064(\u0062\u0063\u0065, \u0061\u0074\u0074\u0061\u0063\u006B\u0069\u006E\u0067\u0070\u006C\u0061\u0079\u0065\u0072);\u0069\u0066 (\u0062\u0063\u0065 \u0069\u0073 \u0042\u0061\u0073\u0065\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065){\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0064\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065\u0073 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0064\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065\u0073.\u0047\u0065\u0074\u004D\u0061\u006A\u006F\u0072\u0069\u0074\u0079\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065()==\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0041\u006E\u0074\u0069\u0056\u0065\u0068\u0069\u0063\u006C\u0065){\u0062\u0063\u0065.\u0048\u0075\u0072\u0074(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0044\u0061\u006D\u0061\u0067\u0065);\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0064\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065\u0073.\u0047\u0065\u0074\u004D\u0061\u006A\u006F\u0072\u0069\u0074\u0079\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065()==\u0044\u0061\u006D\u0061\u0067\u0065\u0054\u0079\u0070\u0065.\u0042\u0075\u006C\u006C\u0065\u0074){\u0062\u0063\u0065.\u0048\u0075\u0072\u0074(50);\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}}\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0057\u0065\u0061\u0070\u006F\u006E\u0050\u0072\u0065\u0066\u0061\u0062 != \u006E\u0075\u006C\u006C && \u0069\u006E\u0066\u006F.\u0057\u0065\u0061\u0070\u006F\u006E\u0050\u0072\u0065\u0066\u0061\u0062._\u006E\u0061\u006D\u0065 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0069\u006E\u0066\u006F.\u0057\u0065\u0061\u0070\u006F\u006E\u0050\u0072\u0065\u0066\u0061\u0062._\u006E\u0061\u006D\u0065.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067().\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0065\u0078\u0070\u006C\u006F\u0073\u0069\u0076\u0065.\u0074\u0069\u006D\u0065\u0064.\u0064\u0065\u0070\u006C\u006F\u0079\u0065\u0064")){\u0062\u0063\u0065.\u0048\u0075\u0072\u0074(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0044\u0061\u006D\u0061\u0067\u0065);}}}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}}\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u004F\u006E\u004E\u0070\u0063\u0054\u0061\u0072\u0067\u0065\u0074(\u0048\u0075\u006D\u0061\u006E\u004E\u0050\u0043 \u0062\u006F\u0074, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079){\u0069\u0066 (\u0062\u006F\u0074==\u006E\u0075\u006C\u006C || \u0062\u006F\u0074.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C || \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C || \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0062\u006F\u0074.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (\u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0069\u0066 (!\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) && !\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0074\u0061\u0072\u0067\u0065\u0074 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0054\u006F\u0050\u006C\u0061\u0079\u0065\u0072();\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0073\u0043\u0061\u006E\u0054\u0061\u0072\u0067\u0065\u0074\u004E\u0050\u0043\u0073){\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074.\u0049\u0073\u004E\u0070\u0063){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}} }\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072){\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067 != ""){\u0066\u006C\u006F\u0061\u0074 \u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0062\u006F\u0074.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0074\u0061\u0072\u0067\u0065\u0074);\u0069\u0066 (\u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072\u0054\u006F\u0067\u0067\u006C\u0065){\u0074\u0061\u0072\u0067\u0065\u0074.\u004D\u0061\u0072\u006B\u0048\u006F\u0073\u0074\u0069\u006C\u0065\u0046\u006F\u0072(10);}\u0069\u0066 (!\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) && \u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u0075\u006E\u0074 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u004D\u0061\u0078\u0056\u006F\u0069\u0063\u0065\u0073\u0041\u0074\u004F\u006E\u0063\u0065){\u0069\u0066 (\u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 > _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0050\u0065\u0061\u0063\u0065\u004B\u0065\u0065\u0070\u0065\u0072\u0054\u006F\u0067\u0067\u006C\u0065 && \u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0041\u0064\u0064(\u0049\u0044);\u0057\u0065\u0062\u0050\u006C\u0061\u0079\u0062\u0061\u0063\u006B(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067, \u0062\u006F\u0074);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0043\u0075\u0073\u0074\u006F\u006D\u0057\u0061\u0072\u006E\u0069\u006E\u0067\u0043\u0044, () =>{\u0043\u006F\u006F\u006C\u0044\u006F\u0077\u006E.\u0052\u0065\u006D\u006F\u0076\u0065(\u0049\u0044);});}}}\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074.\u0049\u0073\u0048\u006F\u0073\u0074\u0069\u006C\u0065()){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}}\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0068\u006F\u0077\u0048\u0065\u006C\u0070(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0048\u006F\u0077 \u0074\u006F \u0073\u0065\u0074\u0075\u0070 \u006C\u006F\u006F\u0074:");\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0054\u0079\u0070\u0065 /\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u006C\u006F\u006F\u0074 \u0061\u0064\u0064 \u0074\u006F \u0063\u0072\u0065\u0061\u0074\u0065 \u0061 \u006E\u0065\u0077 \u006C\u006F\u006F\u0074 \u0070\u0072\u006F\u0066\u0069\u006C\u0065.");\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0054\u0079\u0070\u0065 /\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u006C\u006F\u006F\u0074 \u0065\u0064\u0069\u0074 \u0069\u006E\u0074 \u0074\u006F \u0076\u0069\u0065\u0077 \u006C\u006F\u006F\u0074 \u006F\u0066 \u0074\u0068\u0061\u0074 \u0069\u006E\u0064\u0065\u0078");\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0054\u0079\u0070\u0065 /\u0070\u0069\u0072\u0061\u0074\u0065\u0073.\u006C\u006F\u006F\u0074 \u0072\u0065\u006D\u006F\u0076\u0065 \u0069\u006E\u0074 \u0074\u006F \u0072\u0065\u006D\u006F\u0076\u0065 \u0070\u0072\u006F\u0066\u0069\u006C\u0065 \u006C\u006F\u006F\u0074 \u006F\u0066 \u0074\u0068\u0061\u0074 \u0069\u006E\u0064\u0065\u0078");}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004B\u0069\u006C\u006C\u004C\u0069\u0073\u0074(\u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0045\u006E\u0074\u0049\u0064\u0073){\u0069\u0066 (\u0045\u006E\u0074\u0049\u0064\u0073==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0075\u0069\u006E\u0074 \u0070 \u0069\u006E \u0045\u006E\u0074\u0049\u0064\u0073){\u0069\u0066 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070)){\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 = \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074[\u0070] \u0061\u0073 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079;\u0069\u0066 (\u0062\u0065 != \u006E\u0075\u006C\u006C && !\u0062\u0065.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0062\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0);\u0062\u0065.\u004B\u0069\u006C\u006C();}}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u006C\u0065\u0061\u0072\u004C\u006F\u006F\u0074(\u004C\u0069\u0073\u0074<\u0075\u0069\u006E\u0074> \u0045\u006E\u0074\u0049\u0064\u0073){\u0069\u0066 (\u0045\u006E\u0074\u0049\u0064\u0073==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0075\u0069\u006E\u0074 \u0070 \u0069\u006E \u0045\u006E\u0074\u0049\u0064\u0073){\u0069\u0066 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070)){\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 = \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074[\u0070] \u0061\u0073 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079;\u0069\u0066 (\u0062\u0065 != \u006E\u0075\u006C\u006C && !\u0062\u0065.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0061\u0070 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>();\u0069\u0066 (\u0061\u0070 != \u006E\u0075\u006C\u006C && \u0061\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0061\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0043\u006C\u0065\u0061\u0072();}\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065 \u006C\u0070 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u006C\u0070 != \u006E\u0075\u006C\u006C && \u006C\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u006C\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0043\u006C\u0065\u0061\u0072();}\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 \u0077\u0070 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u0077\u0070 != \u006E\u0075\u006C\u006C && \u0077\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0077\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0043\u006C\u0065\u0061\u0072();}\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065 \u0070\u0062 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065>();\u0069\u0066 (\u0070\u0062 != \u006E\u0075\u006C\u006C && \u0070\u0062.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0070\u0062.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0043\u006C\u0065\u0061\u0072();\u0070\u0062.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u004B\u0069\u006C\u006C();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062 \u0069\u006E \u0070\u0062.\u0065\u006E\u0074\u0069\u0074\u0079\u0073){\u0069\u0066 (\u0062 != \u006E\u0075\u006C\u006C && !\u0062.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0062.\u004B\u0069\u006C\u006C();}}}}}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u006C\u0065\u0061\u0072\u0041\u0072\u0065\u0061(\u0056\u0065\u0063\u0074\u006F\u00723 \u004C\u006F\u0063\u0061\u0074\u0069\u006F\u006E, \u0066\u006C\u006F\u0061\u0074 \u0050\u0072\u006F\u0074\u0065\u0063\u0074\u0069\u006F\u006E\u0052\u0061\u0064\u0069\u0075\u0073){\u0069\u006E\u0074 \u0068\u0069\u0074\u0073 = \u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u004F\u0076\u0065\u0072\u006C\u0061\u0070\u0053\u0070\u0068\u0065\u0072\u0065\u004E\u006F\u006E\u0041\u006C\u006C\u006F\u0063(\u004C\u006F\u0063\u0061\u0074\u0069\u006F\u006E, \u0050\u0072\u006F\u0074\u0065\u0063\u0074\u0069\u006F\u006E\u0052\u0061\u0064\u0069\u0075\u0073 * 1.25f, \u0056\u0069\u0073.\u0063\u006F\u006C\u0042\u0075\u0066\u0066\u0065\u0072, -1, \u0051\u0075\u0065\u0072\u0079\u0054\u0072\u0069\u0067\u0067\u0065\u0072\u0049\u006E\u0074\u0065\u0072\u0061\u0063\u0074\u0069\u006F\u006E.\u0049\u0067\u006E\u006F\u0072\u0065);\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < \u0068\u0069\u0074\u0073;\u0069++){\u0076\u0061\u0072 \u0065 = \u0056\u0069\u0073.\u0063\u006F\u006C\u0042\u0075\u0066\u0066\u0065\u0072[\u0069].\u0054\u006F\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (\u0065 \u0069\u0073 \u0054\u0072\u0065\u0065\u0045\u006E\u0074\u0069\u0074\u0079 || \u0065 \u0069\u0073 \u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065){\u0065.\u004B\u0069\u006C\u006C();}\u0056\u0069\u0073.\u0063\u006F\u006C\u0042\u0075\u0066\u0066\u0065\u0072[\u0069] = \u006E\u0075\u006C\u006C;}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0053\u0070\u0061\u0077\u006E\u0043\u0068\u0065\u0063\u006B(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0064\u0069\u0075\u0073, \u0069\u006E\u0074 \u006C\u0061\u0079\u0065\u0072\u0073){\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u0067 = \u0074\u0072\u0075\u0065;\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u004D\u0061\u0070.\u0047\u0065\u0074\u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0054\u006F\u0070\u006F\u006C\u006F\u0067\u0079\u0042\u0061\u0073\u0065\u0042\u006C\u006F\u0063\u006B)){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u0076\u0061\u0072 \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072\u0073 = \u0050\u006F\u006F\u006C.\u0047\u0065\u0074\u004C\u0069\u0073\u0074<\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072>();\u0056\u0069\u0073.\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072\u0073(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0072\u0061\u0064\u0069\u0075\u0073, \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072\u0073, \u006C\u0061\u0079\u0065\u0072\u0073, \u0051\u0075\u0065\u0072\u0079\u0054\u0072\u0069\u0067\u0067\u0065\u0072\u0049\u006E\u0074\u0065\u0072\u0061\u0063\u0074\u0069\u006F\u006E.\u0043\u006F\u006C\u006C\u0069\u0064\u0065);\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072 \u0069\u006E \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072\u0073){\u0069\u0066 (\u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0053\u0061\u0066\u0065\u005A\u006F\u006E\u0065", \u0043\u006F\u006D\u0070\u0061\u0072\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u004F\u0072\u0064\u0069\u006E\u0061\u006C\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065) || \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0072\u006F\u0063\u006B_", \u0043\u006F\u006D\u0070\u0061\u0072\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u004F\u0072\u0064\u0069\u006E\u0061\u006C\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065) || \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u006D\u006F\u0064\u0064\u0069\u006E\u0067", \u0043\u006F\u006D\u0070\u0061\u0072\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u004F\u0072\u0064\u0069\u006E\u0061\u006C\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065) || \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0073\u0074\u0072\u0075\u0063\u0074\u0075\u0072\u0065\u0073", \u0043\u006F\u006D\u0070\u0061\u0072\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u004F\u0072\u0064\u0069\u006E\u0061\u006C\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065) || \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0066\u006F\u0072\u006D\u0061\u0074\u0069\u006F\u006E_", \u0043\u006F\u006D\u0070\u0061\u0072\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u004F\u0072\u0064\u0069\u006E\u0061\u006C\u0049\u0067\u006E\u006F\u0072\u0065\u0043\u0061\u0073\u0065)){\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}\u0076\u0061\u0072 \u0065 = \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u0054\u006F\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (\u0065.\u0049\u0073\u0056\u0061\u006C\u0069\u0064()){\u0069\u0066 (\u0065 \u0069\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072){\u0076\u0061\u0072 \u0070\u006C\u0061\u0079\u0065\u0072 = \u0065 \u0061\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;\u0069\u0066 (!\u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0065\u0064 || \u0070\u006C\u0061\u0079\u0065\u0072.\u0049\u0073\u0046\u006C\u0079\u0069\u006E\u0067){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0065\u006C\u0073\u0065 {\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (\u0065 \u0069\u0073 \u004A\u0075\u006E\u006B\u0050\u0069\u006C\u0065){\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0065 \u0069\u0073 \u0050\u006C\u0061\u0079\u0065\u0072\u0043\u006F\u0072\u0070\u0073\u0065){\u0076\u0061\u0072 \u0063\u006F\u0072\u0070\u0073\u0065 = \u0065 \u0061\u0073 \u0050\u006C\u0061\u0079\u0065\u0072\u0043\u006F\u0072\u0070\u0073\u0065;\u0069\u0066 (\u0063\u006F\u0072\u0070\u0073\u0065.\u0070\u006C\u0061\u0079\u0065\u0072\u0053\u0074\u0065\u0061\u006D\u0049\u0044==0 || \u0063\u006F\u0072\u0070\u0073\u0065.\u0070\u006C\u0061\u0079\u0065\u0072\u0053\u0074\u0065\u0061\u006D\u0049\u0044.\u0049\u0073\u0053\u0074\u0065\u0061\u006D\u0049\u0064()){\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0065 \u0069\u0073 \u0044\u0072\u006F\u0070\u0070\u0065\u0064\u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 && \u0065.\u0053\u0068\u006F\u0072\u0074\u0050\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065 != "\u0069\u0074\u0065\u006D_\u0064\u0072\u006F\u0070"){\u0076\u0061\u0072 \u0062\u0061\u0063\u006B\u0070\u0061\u0063\u006B = \u0065 \u0061\u0073 \u0044\u0072\u006F\u0070\u0070\u0065\u0064\u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072;\u0069\u0066 (\u0062\u0061\u0063\u006B\u0070\u0061\u0063\u006B.\u0070\u006C\u0061\u0079\u0065\u0072\u0053\u0074\u0065\u0061\u006D\u0049\u0044==0 || \u0062\u0061\u0063\u006B\u0070\u0061\u0063\u006B.\u0070\u006C\u0061\u0079\u0065\u0072\u0053\u0074\u0065\u0061\u006D\u0049\u0044.\u0049\u0073\u0053\u0074\u0065\u0061\u006D\u0049\u0064()){\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0065.\u004F\u0077\u006E\u0065\u0072\u0049\u0044==0){\u0069\u0066 (\u0065 \u0069\u0073 \u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B){\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0065 \u0069\u0073 \u004D\u0069\u006E\u0069\u006E\u0067\u0051\u0075\u0061\u0072\u0072\u0079){\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}}}\u0050\u006F\u006F\u006C.\u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074(\u0072\u0065\u0066 \u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072\u0073);\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u006C\u0061\u0067;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u006C\u0065\u0061\u0072\u0055\u0070\u0056\u0065\u0063\u0074\u006F\u0072\u005A\u0065\u0072\u006F(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073){\u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065> \u0053\u0063\u0061\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065>();\u0056\u0069\u0073.\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073<\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065>(\u0070\u006F\u0073, 5f, \u0053\u0063\u0061\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0073);\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065 \u0062\u006E \u0069\u006E \u0053\u0063\u0061\u006E\u0045\u006E\u0074\u0069\u0074\u0079\u0073){\u0062\u006E.\u004B\u0069\u006C\u006C();}}\u0076\u006F\u0069\u0064 \u0041\u0064\u0064\u004C\u006F\u0063\u006B(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074){\u0043\u006F\u0064\u0065\u004C\u006F\u0063\u006B \u0061\u006C\u006F\u0063\u006B = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006C\u006F\u0063\u006B\u0073/\u006B\u0065\u0079\u0070\u0061\u0064/\u006C\u006F\u0063\u006B.\u0063\u006F\u0064\u0065.\u0070\u0072\u0065\u0066\u0061\u0062") \u0061\u0073 \u0043\u006F\u0064\u0065\u004C\u006F\u0063\u006B;\u0061\u006C\u006F\u0063\u006B.\u0053\u0070\u0061\u0077\u006E();\u0061\u006C\u006F\u0063\u006B.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 = \u0065\u006E\u0074.\u004F\u0077\u006E\u0065\u0072\u0049\u0044;\u0061\u006C\u006F\u0063\u006B.\u0063\u006F\u0064\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(1111, 9999).\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0061\u006C\u006F\u0063\u006B.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0065\u006E\u0074, \u0065\u006E\u0074.\u0047\u0065\u0074\u0053\u006C\u006F\u0074\u0041\u006E\u0063\u0068\u006F\u0072\u004E\u0061\u006D\u0065(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u006C\u006F\u0074.\u004C\u006F\u0063\u006B));\u0065\u006E\u0074.\u0053\u0065\u0074\u0053\u006C\u006F\u0074(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u006C\u006F\u0074.\u004C\u006F\u0063\u006B, \u0061\u006C\u006F\u0063\u006B);\u0061\u006C\u006F\u0063\u006B.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004C\u006F\u0063\u006B\u0065\u0064, \u0074\u0072\u0075\u0065);\u0061\u006C\u006F\u0063\u006B.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0061\u006C\u006F\u0063\u006B.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065(\u0074\u0072\u0075\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0057\u0069\u006E\u0064\u006F\u0077(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073, \u0056\u0065\u0063\u0074\u006F\u00723 \u0072\u006F\u0074, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0070\u0061\u0072\u0065\u006E\u0074){\u0053\u0074\u0061\u0062\u0069\u006C\u0069\u0074\u0079\u0045\u006E\u0074\u0069\u0074\u0079 \u0077\u0069\u006E\u0064\u006F\u0077 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067/\u0077\u0061\u006C\u006C.\u0077\u0069\u006E\u0064\u006F\u0077.\u0072\u0065\u0069\u006E\u0066\u006F\u0072\u0063\u0065\u0064\u0067\u006C\u0061\u0073\u0073/\u0077\u0061\u006C\u006C.\u0077\u0069\u006E\u0064\u006F\u0077.\u0067\u006C\u0061\u0073\u0073.\u0072\u0065\u0069\u006E\u0066\u006F\u0072\u0063\u0065\u0064.\u0070\u0072\u0065\u0066\u0061\u0062", \u0070\u006F\u0073, \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(\u0072\u006F\u0074)) \u0061\u0073 \u0053\u0074\u0061\u0062\u0069\u006C\u0069\u0074\u0079\u0045\u006E\u0074\u0069\u0074\u0079;\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0077\u0069\u006E\u0064\u006F\u0077);\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0077\u0069\u006E\u0064\u006F\u0077);\u0077\u0069\u006E\u0064\u006F\u0077.\u0053\u0070\u0061\u0077\u006E();\u0077\u0069\u006E\u0064\u006F\u0077.\u0070\u0069\u0063\u006B\u0075\u0070.\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0077\u0069\u006E\u0064\u006F\u0077.\u0067\u0072\u006F\u0075\u006E\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0077\u0069\u006E\u0064\u006F\u0077.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0070\u0061\u0072\u0065\u006E\u0074);\u0077\u0069\u006E\u0064\u006F\u0077.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006F\u0073;}\u0070\u0075\u0062\u006C\u0069\u0063 \u0043\u006F\u006C\u006F\u0072 \u0048\u0065\u00782\u0043\u006F\u006C\u006F\u0075\u0072(\u0073\u0074\u0072\u0069\u006E\u0067 \u0074\u0065\u0078\u0074){\u0043\u006F\u006C\u006F\u0072 \u0043\u006F\u006C\u006F\u0075\u0072;\u0069\u0066 (\u0043\u006F\u006C\u006F\u0072\u0055\u0074\u0069\u006C\u0069\u0074\u0079.\u0054\u0072\u0079\u0050\u0061\u0072\u0073\u0065\u0048\u0074\u006D\u006C\u0053\u0074\u0072\u0069\u006E\u0067(\u0074\u0065\u0078\u0074, \u006F\u0075\u0074 \u0043\u006F\u006C\u006F\u0075\u0072)){\u0072\u0065\u0074\u0075\u0072\u006E \u0043\u006F\u006C\u006F\u0075\u0072;}\u0072\u0065\u0074\u0075\u0072\u006E \u0043\u006F\u006C\u006F\u0072.\u0062\u006C\u0061\u0063\u006B;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u006E\u0075\u0061\u006C\u006C\u0079\u0061\u0064\u0064\u0070\u006F\u0069(\u0073\u0074\u0072\u0069\u006E\u0067[] \u0041\u0072\u0067\u0073, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0041\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 != 2){\u0056\u0065\u0063\u0074\u006F\u00723 \u0050\u004F\u0049 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u0070\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A);\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0041\u0064\u0064(\u0050\u004F\u0049);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u004F\u0049\u0045\u0078\u0070\u0069\u0072\u0065\u0073, () =>{\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0052\u0065\u006D\u006F\u0076\u0065(\u0050\u004F\u0049);});\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0065\u0074 \u0061 \u0070\u006F\u0069\u006E\u0074 \u006F\u0066 \u0069\u006E\u0074\u0072\u0065\u0073\u0074 \u0061\u0074 \u0079\u006F\u0075\u0072 \u006C\u006F\u0063\u0061\u0074\u0069\u006F\u006E.");}}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0041\u0072\u0067\u0073.\u004C\u0065\u006E\u0067\u0074\u0068==2){\u0073\u0074\u0072\u0069\u006E\u0067 \u0073\u0056\u0065\u0063\u0074\u006F\u0072 = \u0041\u0072\u0067\u0073[1];\u0069\u0066 (\u0073\u0056\u0065\u0063\u0074\u006F\u0072.\u0053\u0074\u0061\u0072\u0074\u0073\u0057\u0069\u0074\u0068("(") && \u0073\u0056\u0065\u0063\u0074\u006F\u0072.\u0045\u006E\u0064\u0073\u0057\u0069\u0074\u0068(")")){\u0073\u0056\u0065\u0063\u0074\u006F\u0072 = \u0073\u0056\u0065\u0063\u0074\u006F\u0072.\u0053\u0075\u0062\u0073\u0074\u0072\u0069\u006E\u0067(1, \u0073\u0056\u0065\u0063\u0074\u006F\u0072.\u004C\u0065\u006E\u0067\u0074\u0068 - 2);}\u0073\u0074\u0072\u0069\u006E\u0067[] \u0073\u0041\u0072\u0072\u0061\u0079 = \u0073\u0056\u0065\u0063\u0074\u006F\u0072.\u0053\u0070\u006C\u0069\u0074(',');\u0056\u0065\u0063\u0074\u006F\u00723 \u0072\u0065\u0073\u0075\u006C\u0074 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0073\u0041\u0072\u0072\u0061\u0079[0]), \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0073\u0041\u0072\u0072\u0061\u0079[1]), \u0066\u006C\u006F\u0061\u0074.\u0050\u0061\u0072\u0073\u0065(\u0073\u0041\u0072\u0072\u0061\u0079[2]));\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0041\u0064\u0064(\u0072\u0065\u0073\u0075\u006C\u0074);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u004F\u0049\u0045\u0078\u0070\u0069\u0072\u0065\u0073, () =>{\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0052\u0065\u006D\u006F\u0076\u0065(\u0072\u0065\u0073\u0075\u006C\u0074);});\u0069\u0066 (\u0070\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u0068\u0061\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0065\u0074 \u0061 \u0070\u006F\u0069\u006E\u0074 \u006F\u0066 \u0069\u006E\u0074\u0072\u0065\u0073\u0074 \u0061\u0074 " + \u0072\u0065\u0073\u0075\u006C\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067());}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0050\u0069\u0072\u0061\u0074\u0065\u0041\u0074\u0074\u0061\u0063\u006B\u0065\u0064(\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0063\u0065, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u0062\u0063\u0065==\u006E\u0075\u006C\u006C || \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0061\u0070 = \u0062\u0063\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>();\u0069\u0066 (\u0061\u0070 != \u006E\u0075\u006C\u006C){\u0061\u0070._\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F(\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072, \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072));\u0072\u0065\u0074\u0075\u0072\u006E;}\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065 \u006C\u0070 = \u0062\u0063\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u006C\u0070 != \u006E\u0075\u006C\u006C){\u006C\u0070.\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 = \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;\u0072\u0065\u0074\u0075\u0072\u006E;}\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 \u0077\u0070 = \u0062\u0063\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u0077\u0070 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) < -2f){\u0077\u0070.\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 = \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;} \u0072\u0065\u0074\u0075\u0072\u006E;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0042\u0061\u0073\u0065\u0044\u0061\u006D\u0061\u0067\u0065(\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074\u0069\u0074\u0079){\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079 \u0069\u0073 \u0044\u006F\u006F\u0072) \u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0072\u0075\u0065;\u0069\u0066 (!(\u0065\u006E\u0074\u0069\u0074\u0079 \u0069\u0073 \u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B)) \u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;\u0072\u0065\u0074\u0075\u0072\u006E ((\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B)\u0065\u006E\u0074\u0069\u0074\u0079).\u0067\u0072\u0061\u0064\u0065 != \u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0047\u0072\u0061\u0064\u0065.\u0045\u006E\u0075\u006D.\u0054\u0077\u0069\u0067\u0073;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0061\u006D\u004C\u006F\u0067\u0069\u0063(\u0053\u0061\u006D\u0053\u0069\u0074\u0065 \u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065, \u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079, \u0066\u006C\u006F\u0061\u0074 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0073\u0070\u0065\u0065\u0064){\u0074\u0072\u0079{\u0069\u0066 (!\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0048\u0061\u0073\u0041\u006D\u006D\u006F() || \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079==\u006E\u0075\u006C\u006C || \u0062\u0065==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E) || \u0062\u0065.\u0048\u0061\u0073\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00642)){\u0056\u0065\u0063\u0074\u006F\u00723 \u0065\u0073\u0074\u0069\u006D\u0061\u0074\u0065\u0064\u0050\u006F\u0069\u006E\u0074 = \u0050\u0072\u0065\u0064\u0069\u0063\u0074\u0065\u0064\u0050\u006F\u0073(\u0062\u0065, \u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079);\u0065\u0073\u0074\u0069\u006D\u0061\u0074\u0065\u0064\u0050\u006F\u0069\u006E\u0074 += \u0062\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * (\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0073\u0070\u0065\u0065\u0064 + 3f);\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0041\u0069\u006D\u0044\u0069\u0072 = (\u0065\u0073\u0074\u0069\u006D\u0061\u0074\u0065\u0064\u0050\u006F\u0069\u006E\u0074 - \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0065\u0079\u0065\u0050\u006F\u0069\u006E\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u004C\u006F\u006F\u006B\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0041\u0069\u006D\u0044\u0069\u0072, \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070).\u0065\u0075\u006C\u0065\u0072\u0041\u006E\u0067\u006C\u0065\u0073;\u0076\u0065\u0063\u0074\u006F\u0072 = \u0042\u0061\u0073\u0065\u004D\u006F\u0075\u006E\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u006E\u0076\u0065\u0072\u0074\u0056\u0065\u0063\u0074\u006F\u0072(\u0076\u0065\u0063\u0074\u006F\u0072);\u0066\u006C\u006F\u0061\u0074 \u0074 = \u004D\u0061\u0074\u0068\u0066.\u0049\u006E\u0076\u0065\u0072\u0073\u0065\u004C\u0065\u0072\u0070(0f, 90f, -\u0076\u0065\u0063\u0074\u006F\u0072.\u0078);\u0066\u006C\u006F\u0061\u0074 \u007A = \u004D\u0061\u0074\u0068\u0066.\u004C\u0065\u0072\u0070(15f, -75f, \u0074);\u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0f, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079, 0f);\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0079\u0061\u0077.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E2 = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0070\u0069\u0074\u0063\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E.\u0065\u0075\u006C\u0065\u0072\u0041\u006E\u0067\u006C\u0065\u0073.\u0078, \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0070\u0069\u0074\u0063\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E.\u0065\u0075\u006C\u0065\u0072\u0041\u006E\u0067\u006C\u0065\u0073.\u0079, \u007A);\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0070\u0069\u0074\u0063\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E2;\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0051\u0075\u0065\u0075\u0065.\u0055\u0070\u0064\u0061\u0074\u0065);\u0046\u0069\u0072\u0065\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065(\u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0041\u0069\u006D\u0044\u0069\u0072, 1);\u0045\u0066\u0066\u0065\u0063\u0074.\u0073\u0065\u0072\u0076\u0065\u0072.\u0052\u0075\u006E(\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u006D\u0075\u007A\u007A\u006C\u0065\u0046\u006C\u0061\u0073\u0068\u0054\u0065\u0073\u0074.\u0072\u0065\u0073\u006F\u0075\u0072\u0063\u0065\u0050\u0061\u0074\u0068, \u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0053\u0074\u0072\u0069\u006E\u0067\u0050\u006F\u006F\u006C.\u0047\u0065\u0074("\u0054\u0075\u0062\u0065 " + (\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0062\u0065\u0049\u006E\u0064\u0065\u0078 + 1).\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067()), \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006E\u0075\u006C\u006C, \u0066\u0061\u006C\u0073\u0065);\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0061\u006D\u006D\u006F\u0049\u0074\u0065\u006D.\u0055\u0073\u0065\u0049\u0074\u0065\u006D(1);\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0062\u0065\u0049\u006E\u0064\u0065\u0078++;\u0069\u0066 (\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0062\u0065\u0049\u006E\u0064\u0065\u0078 >= \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0074\u0075\u0062\u0065\u0073.\u004C\u0065\u006E\u0067\u0074\u0068){\u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0062\u0065\u0049\u006E\u0064\u0065\u0078 = 0;}}}\u0063\u0061\u0074\u0063\u0068 {}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0046\u0069\u0072\u0065\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065(\u0053\u0061\u006D\u0053\u0069\u0074\u0065 \u006F\u0072\u0069\u0067\u0069\u006E, \u0056\u0065\u0063\u0074\u006F\u00723 \u0064\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E, \u0066\u006C\u006F\u0061\u0074 \u0073\u0070\u0065\u0065\u0064\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072){\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u006F\u0072\u0069\u0067\u0069\u006E.\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0054\u0065\u0073\u0074.\u0072\u0065\u0073\u006F\u0075\u0072\u0063\u0065\u0050\u0061\u0074\u0068, \u006F\u0072\u0069\u0067\u0069\u006E.\u0074\u0075\u0062\u0065\u0073[\u006F\u0072\u0069\u0067\u0069\u006E.\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0062\u0065\u0049\u006E\u0064\u0065\u0078].\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u004C\u006F\u006F\u006B\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0064\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070));\u0069\u0066 (!(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C)){\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0063\u0072\u0065\u0061\u0074\u006F\u0072\u0045\u006E\u0074\u0069\u0074\u0079 = \u006F\u0072\u0069\u0067\u0069\u006E;\u0053\u0065\u0072\u0076\u0065\u0072\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065 \u0063\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0053\u0065\u0072\u0076\u0065\u0072\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065>();\u0054\u0069\u006D\u0065\u0064\u0045\u0078\u0070\u006C\u006F\u0073\u0069\u0076\u0065 \u0072\u006F\u0063\u006B\u0065\u0074 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0054\u0069\u006D\u0065\u0064\u0045\u0078\u0070\u006C\u006F\u0073\u0069\u0076\u0065>();\u0072\u006F\u0063\u006B\u0065\u0074.\u0053\u0065\u0074\u0044\u0061\u006D\u0061\u0067\u0065\u0053\u0063\u0061\u006C\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0061\u006D\u0053\u0069\u0074\u0065\u0073\u0044\u0061\u006D\u0061\u0067\u0065);\u0069\u0066 ((\u0062\u006F\u006F\u006C)\u0063\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074){\u0063\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074.\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079(\u006F\u0072\u0069\u0067\u0069\u006E.\u0047\u0065\u0074\u0049\u006E\u0068\u0065\u0072\u0069\u0074\u0065\u0064\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079() + \u0064\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E * \u0063\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074.\u0073\u0070\u0065\u0065\u0064 * \u0073\u0070\u0065\u0065\u0064\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072);}\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u0070\u0061\u0077\u006E();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0050\u0072\u0065\u0064\u0069\u0063\u0074\u0065\u0064\u0050\u006F\u0073(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0074\u0061\u0072\u0067\u0065\u0074, \u0053\u0061\u006D\u0053\u0069\u0074\u0065 \u0073\u0061\u006D\u0053\u0069\u0074\u0065, \u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079){\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0061\u0072\u0067\u0065\u0074\u0070\u006F\u0073 = \u0074\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0054\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D\u0050\u006F\u0069\u006E\u0074(\u0074\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0047\u0065\u0074\u0042\u006F\u0075\u006E\u0064\u0073().\u0063\u0065\u006E\u0074\u0065\u0072);\u0056\u0065\u0063\u0074\u006F\u00723 \u0064\u0069\u0073\u0070\u006C\u0061\u0063\u0065\u006D\u0065\u006E\u0074 = \u0074\u0061\u0072\u0067\u0065\u0074\u0070\u006F\u0073 - \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0065\u0079\u0065\u0050\u006F\u0069\u006E\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0066\u006C\u006F\u0061\u0074 \u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = \u0073\u0061\u006D\u0053\u0069\u0074\u0065.\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0054\u0065\u0073\u0074.\u0047\u0065\u0074().\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0053\u0065\u0072\u0076\u0065\u0072\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065>().\u0073\u0070\u0065\u0065\u0064;\u0066\u006C\u006F\u0061\u0074 \u0074\u0061\u0072\u0067\u0065\u0074\u004D\u006F\u0076\u0065\u0041\u006E\u0067\u006C\u0065 = \u0056\u0065\u0063\u0074\u006F\u00723.\u0041\u006E\u0067\u006C\u0065(-\u0064\u0069\u0073\u0070\u006C\u0061\u0063\u0065\u006D\u0065\u006E\u0074, \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079) * \u004D\u0061\u0074\u0068\u0066.\u0044\u0065\u00672\u0052\u0061\u0064;\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065==0 || \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065 > \u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0053\u0070\u0065\u0065\u0064 && \u004D\u0061\u0074\u0068\u0066.\u0053\u0069\u006E(\u0074\u0061\u0072\u0067\u0065\u0074\u004D\u006F\u0076\u0065\u0041\u006E\u0067\u006C\u0065) / \u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0053\u0070\u0065\u0065\u0064 > \u004D\u0061\u0074\u0068\u0066.\u0043\u006F\u0073(\u0074\u0061\u0072\u0067\u0065\u0074\u004D\u006F\u0076\u0065\u0041\u006E\u0067\u006C\u0065) / \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0061\u0072\u0067\u0065\u0074\u0070\u006F\u0073;}\u0066\u006C\u006F\u0061\u0074 \u0073\u0068\u006F\u006F\u0074\u0041\u006E\u0067\u006C\u0065 = \u004D\u0061\u0074\u0068\u0066.\u0041\u0073\u0069\u006E(\u004D\u0061\u0074\u0068\u0066.\u0053\u0069\u006E(\u0074\u0061\u0072\u0067\u0065\u0074\u004D\u006F\u0076\u0065\u0041\u006E\u0067\u006C\u0065) * \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065 / \u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0053\u0070\u0065\u0065\u0064);\u0072\u0065\u0074\u0075\u0072\u006E \u0074\u0061\u0072\u0067\u0065\u0074\u0070\u006F\u0073 + \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079 * \u0064\u0069\u0073\u0070\u006C\u0061\u0063\u0065\u006D\u0065\u006E\u0074.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065 / \u004D\u0061\u0074\u0068\u0066.\u0053\u0069\u006E(\u004D\u0061\u0074\u0068\u0066.\u0050\u0049 - \u0074\u0061\u0072\u0067\u0065\u0074\u004D\u006F\u0076\u0065\u0041\u006E\u0067\u006C\u0065 - \u0073\u0068\u006F\u006F\u0074\u0041\u006E\u0067\u006C\u0065) * \u004D\u0061\u0074\u0068\u0066.\u0053\u0069\u006E(\u0073\u0068\u006F\u006F\u0074\u0041\u006E\u0067\u006C\u0065) / \u0074\u0061\u0072\u0067\u0065\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079> \u0043\u0072\u0065\u0061\u0074\u0065\u0057\u0061\u006C\u006C\u0073(\u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0065\u006E\u0074\u0065\u0072, \u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0064\u0069\u0075\u0073){\u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079> \u0057\u0061\u006C\u006C\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079>();\u0073\u0074\u0072\u0069\u006E\u0067 \u0070\u0072\u0065\u0066\u0061\u0062 = \u0053\u0074\u0072\u0069\u006E\u0067\u0050\u006F\u006F\u006C.\u0047\u0065\u0074(1745077396);\u0062\u006F\u006F\u006C \u0067\u0061\u0074\u0065 = \u0074\u0072\u0075\u0065;\u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074 = -499f;\u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074 = 999f;\u0069\u006E\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0073 = \u004D\u0061\u0074\u0068\u0066.\u0043\u0065\u0069\u006C\u0054\u006F\u0049\u006E\u0074(360 / \u0072\u0061\u0064\u0069\u0075\u0073 * 0.1375f);\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E \u0069\u006E \u0047\u0065\u0074\u0043\u0069\u0072\u0063\u0075\u006D\u0066\u0065\u0072\u0065\u006E\u0063\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073(\u0063\u0065\u006E\u0074\u0065\u0072, \u0072\u0061\u0064\u0069\u0075\u0073, \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0073, \u0066\u0061\u006C\u0073\u0065)){\u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074 = \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074, \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E));\u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074 = \u004D\u0061\u0074\u0068\u0066.\u004D\u0069\u006E(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074);\u0063\u0065\u006E\u0074\u0065\u0072.\u0079 = \u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074;}\u0066\u006C\u006F\u0061\u0074 \u0067\u0061\u0070 = 0.10f;\u0066\u006C\u006F\u0061\u0074 \u006E\u0065\u0078\u0074 = 360 / \u0072\u0061\u0064\u0069\u0075\u0073 - \u0067\u0061\u0070;\u0066\u006C\u006F\u0061\u0074 \u006A = 1 * 6f + 6f;\u0066\u006C\u006F\u0061\u0074 \u0067\u0072\u006F\u0075\u006E\u0064\u0048\u0065\u0069\u0067\u0068\u0074 = 0f;\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065;\u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0077\u0061\u006C\u006C\u0070\u006F\u0073 = \u0047\u0065\u0074\u0043\u0069\u0072\u0063\u0075\u006D\u0066\u0065\u0072\u0065\u006E\u0063\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073(\u0063\u0065\u006E\u0074\u0065\u0072, \u0072\u0061\u0064\u0069\u0075\u0073, \u006E\u0065\u0078\u0074, \u0066\u0061\u006C\u0073\u0065, \u0063\u0065\u006E\u0074\u0065\u0072.\u0079);\u0069\u006E\u0074 \u0068\u0061\u006C\u0066\u0077\u0061\u0079 = (\u0069\u006E\u0074)(\u0077\u0061\u006C\u006C\u0070\u006F\u0073.\u0043\u006F\u0075\u006E\u0074 / 2);\u0069\u006E\u0074 \u0063\u006F\u0075\u006E\u0074 = 0;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E \u0069\u006E \u0077\u0061\u006C\u006C\u0070\u006F\u0073){\u0069\u0066 (\u0063\u0065\u006E\u0074\u0065\u0072.\u0079 - \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 > 48f){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 180, 0);\u0067\u0072\u006F\u0075\u006E\u0064\u0048\u0065\u0069\u0067\u0068\u0074 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 + 6f, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A));\u0069\u0066 (\u0067\u0072\u006F\u0075\u006E\u0064\u0048\u0065\u0069\u0067\u0068\u0074 > \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 + 9f){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 - \u0067\u0072\u006F\u0075\u006E\u0064\u0048\u0065\u0069\u0067\u0068\u0074 > \u006A && \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 < \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E)){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (!\u0067\u0061\u0074\u0065 && \u0063\u006F\u0075\u006E\u0074 != \u0068\u0061\u006C\u0066\u0077\u0061\u0079){\u0065 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0070\u0072\u0065\u0066\u0061\u0062, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) - 0.2f, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A), \u0064\u0065\u0066\u0061\u0075\u006C\u0074(\u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E), \u0066\u0061\u006C\u0073\u0065);}\u0065\u006C\u0073\u0065 {\u0065 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0053\u0074\u0072\u0069\u006E\u0067\u0050\u006F\u006F\u006C.\u0047\u0065\u0074(95147612), \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) - 0.25f, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A), \u0064\u0065\u0066\u0061\u0075\u006C\u0074(\u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E), \u0066\u0061\u006C\u0073\u0065);\u0067\u0061\u0074\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 0, 0);}\u0069\u0066 (\u0065==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0065.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 = (\u0075\u006C\u006F\u006E\u0067)\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(10000000, 20000000);\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u004C\u006F\u006F\u006B\u0041\u0074(\u0063\u0065\u006E\u0074\u0065\u0072, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070);\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E *= \u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u0065.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0065.\u0053\u0070\u0061\u0077\u006E();\u0057\u0061\u006C\u006C\u0073.\u0041\u0064\u0064(\u0065);\u0065.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0053\u0065\u0074\u0041\u0063\u0074\u0069\u0076\u0065(\u0074\u0072\u0075\u0065);\u0063\u006F\u0075\u006E\u0074++;}\u0072\u0065\u0074\u0075\u0072\u006E \u0057\u0061\u006C\u006C\u0073;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0062\u0079\u0074\u0065[]> \u0041\u0072\u0072\u0061\u0079\u0054\u006F\u0042\u0079\u0074\u0065\u0041\u0072\u0072\u0061\u0079\u004C\u0069\u0073\u0074(\u0062\u0079\u0074\u0065[] \u0062\u0079\u0074\u0065\u0073, \u0069\u006E\u0074 \u006F\u0066\u0066\u0073\u0065\u0074 = 0){\u004C\u0069\u0073\u0074<\u0062\u0079\u0074\u0065[]> \u0070\u0061\u0063\u006B\u0065\u0074\u0062\u0079\u0074\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0062\u0079\u0074\u0065[]>();\u004C\u0069\u0073\u0074<\u0069\u006E\u0074> \u0070\u0061\u0063\u006B\u0065\u0074\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0069\u006E\u0074>();\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D = 0;\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D < \u0062\u0079\u0074\u0065\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 - \u006F\u0066\u0066\u0073\u0065\u0074;){\u0070\u0061\u0063\u006B\u0065\u0074\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D.\u0041\u0064\u0064(\u0042\u0069\u0074\u0043\u006F\u006E\u0076\u0065\u0072\u0074\u0065\u0072.\u0054\u006F\u0049\u006E\u007432(\u0062\u0079\u0074\u0065\u0073, \u006F\u0066\u0066\u0073\u0065\u0074));\u006F\u0066\u0066\u0073\u0065\u0074 += 4;\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D = \u0070\u0061\u0063\u006B\u0065\u0074\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D.\u0053\u0075\u006D();\u0069\u0066 (\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D > \u0062\u0079\u0074\u0065\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 - \u006F\u0066\u0066\u0073\u0065\u0074){\u0050\u0075\u0074\u0073("\u0055\u006E\u0070\u0061\u0063\u006B\u0069\u006E\u0067 \u0053\u0074\u0072\u0065\u0061\u006D \u0046\u0061\u0069\u006C\u0065\u0064!");\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0069\u006E\u0074 \u0073\u0069\u007A\u0065 \u0069\u006E \u0070\u0061\u0063\u006B\u0065\u0074\u0063\u0068\u0065\u0063\u006B\u0073\u0075\u006D){\u0070\u0061\u0063\u006B\u0065\u0074\u0062\u0079\u0074\u0065\u0073.\u0041\u0064\u0064(\u0062\u0079\u0074\u0065\u0073.\u0053\u006B\u0069\u0070(\u006F\u0066\u0066\u0073\u0065\u0074).\u0054\u0061\u006B\u0065(\u0073\u0069\u007A\u0065).\u0054\u006F\u0041\u0072\u0072\u0061\u0079());\u006F\u0066\u0066\u0073\u0065\u0074 += \u0073\u0069\u007A\u0065;}\u0072\u0065\u0074\u0075\u0072\u006E \u0070\u0061\u0063\u006B\u0065\u0074\u0062\u0079\u0074\u0065\u0073;}\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0049\u0073\u0042\u0061\u0073\u006564\u0053\u0074\u0072\u0069\u006E\u0067(\u0073\u0074\u0072\u0069\u006E\u0067 \u0073){\u0073 = \u0073.\u0054\u0072\u0069\u006D();\u0072\u0065\u0074\u0075\u0072\u006E (\u0073.\u004C\u0065\u006E\u0067\u0074\u0068 % 4==0) && \u0052\u0065\u0067\u0065\u0078.\u0049\u0073\u004D\u0061\u0074\u0063\u0068(\u0073, @"^[\u0061-\u007A\u0041-\u005A0-9\+/]*={0,3}$", \u0052\u0065\u0067\u0065\u0078\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u004E\u006F\u006E\u0065);}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0057\u0065\u0062\u0050\u006C\u0061\u0079\u0062\u0061\u0063\u006B(\u0073\u0074\u0072\u0069\u006E\u0067 \u0055\u0052\u004C, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0054\u0061\u0072\u0067\u0065\u0074){\u0069\u0066 (\u0055\u0052\u004C=="" || \u0054\u0061\u0072\u0067\u0065\u0074==\u006E\u0075\u006C\u006C || \u0054\u0061\u0072\u0067\u0065\u0074.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0075\u0069\u006E\u0074 \u0049\u0044 = \u0054\u0061\u0072\u0067\u0065\u0074.\u006E\u0065\u0074.\u0049\u0044;\u0069\u0066 (!\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044) && !\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0049\u0044)){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 > \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) + 20f){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0069\u006F\u006E \u0063 \u0069\u006E \u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065.\u0047\u0065\u0074\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0069\u006F\u006E\u0073\u0057\u0069\u0074\u0068\u0069\u006E(\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 50)){\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070 = \u0063.\u0070\u006C\u0061\u0079\u0065\u0072 \u0061\u0073 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072;\u0069\u0066 (\u0070 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0047\u0061\u006D\u0065\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u004C\u0069\u006E\u0065\u004F\u0066\u0053\u0069\u0067\u0068\u0074(\u0070.\u0065\u0079\u0065\u0073.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, -4, 0), -1)){\u0072\u0065\u0074\u0075\u0072\u006E;}}}\u0056\u0065\u0063\u0074\u006F\u00723 \u0062\u0061\u0063\u006B\u0075\u0070\u0070\u006F\u0073 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079, \u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A);\u0077\u0065\u0062\u0072\u0065\u0071\u0075\u0065\u0073\u0074.\u0045\u006E\u0071\u0075\u0065\u0075\u0065(\u0055\u0052\u004C, \u006E\u0075\u006C\u006C, (\u0063\u006F\u0064\u0065, \u0072\u0065\u0073\u0070\u006F\u006E\u0073\u0065) =>{\u0069\u0066 (\u0063\u006F\u0064\u0065 != 200 || \u0072\u0065\u0073\u0070\u006F\u006E\u0073\u0065==\u006E\u0075\u006C\u006C){\u0050\u0075\u0074\u0073($"\u0045\u0072\u0072\u006F\u0072: {\u0063\u006F\u0064\u0065}");\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0049\u0073\u0042\u0061\u0073\u006564\u0053\u0074\u0072\u0069\u006E\u0067(\u0072\u0065\u0073\u0070\u006F\u006E\u0073\u0065)){\u004C\u0069\u0073\u0074<\u0062\u0079\u0074\u0065[]> \u0056\u0044 = \u0041\u0072\u0072\u0061\u0079\u0054\u006F\u0042\u0079\u0074\u0065\u0041\u0072\u0072\u0061\u0079\u004C\u0069\u0073\u0074(\u0043\u006F\u006E\u0076\u0065\u0072\u0074.\u0046\u0072\u006F\u006D\u0042\u0061\u0073\u006564\u0053\u0074\u0072\u0069\u006E\u0067(\u0072\u0065\u0073\u0070\u006F\u006E\u0073\u0065));\u0056\u0065\u0063\u0074\u006F\u00723 \u0047\u0072\u006F\u0075\u006E\u0064\u0050\u006F\u0073 = \u0062\u0061\u0063\u006B\u0075\u0070\u0070\u006F\u0073 + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, -4, 0);\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0070\u006C\u0061\u0079\u0065\u0072/\u0070\u006C\u0061\u0079\u0065\u0072.\u0070\u0072\u0065\u0066\u0061\u0062", \u0047\u0072\u006F\u0075\u006E\u0064\u0050\u006F\u0073).\u0054\u006F\u0050\u006C\u0061\u0079\u0065\u0072();\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u0053\u0070\u0061\u0077\u006E();\u0049\u006E\u0074\u0065\u0072\u0066\u0061\u0063\u0065.\u004F\u0078\u0069\u0064\u0065.\u0043\u0061\u006C\u006C\u0048\u006F\u006F\u006B("\u004F\u006E\u004E\u0050\u0043\u0052\u0065\u0073\u0070\u0061\u0077\u006E", \u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072);\u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072, "\u0062\u0075\u0072\u006C\u0061\u0070.\u0067\u006C\u006F\u0076\u0065\u0073", 2488609451);\u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072, "\u0068\u006F\u006F\u0064\u0069\u0065", 2488607577);\u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072, "\u0070\u0061\u006E\u0074\u0073", 2488608085);\u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072, "\u0073\u0068\u006F\u0065\u0073.\u0062\u006F\u006F\u0074\u0073", 2488606012);\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u006D\u006F\u0064\u0065\u006C\u0053\u0074\u0061\u0074\u0065.\u0064\u0075\u0063\u006B\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0069\u0066 (\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C && \u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072 != \u006E\u0075\u006C\u006C){\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0054\u0061\u0072\u0067\u0065\u0074, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);}\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0053\u0063\u0061\u006C\u0065 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0051\u0075\u0065\u0072\u0079.\u0053\u0065\u0072\u0076\u0065\u0072.\u0052\u0065\u006D\u006F\u0076\u0065\u0050\u006C\u0061\u0079\u0065\u0072(\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072);\u0075\u0069\u006E\u0074 \u0049\u0044\u006E\u0075\u006D = \u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044;\u0056\u006F\u0069\u0063\u0065.\u0041\u0064\u0064(\u0049\u0044\u006E\u0075\u006D);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065((\u0056\u0044.\u0043\u006F\u0075\u006E\u0074 / 12) + 4f, () =>{\u0056\u006F\u0069\u0063\u0065.\u0052\u0065\u006D\u006F\u0076\u0065(\u0049\u0044\u006E\u0075\u006D);\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u004B\u0069\u006C\u006C();});\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0049\u006E\u0076\u006F\u006B\u0065\u0048\u0061\u006E\u0064\u006C\u0065\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0050\u006C\u0061\u0079\u0056\u006F\u0069\u0063\u0065(\u0056\u0044, \u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072)));});}\u0065\u006C\u0073\u0065 {\u0050\u0075\u0074\u0073("\u0057\u0065\u0062\u0056\u006F\u0069\u0063\u0065 \u0055\u0052\u004C \u0046\u0061\u0075\u006C\u0074!");}}, \u0074\u0068\u0069\u0073, \u0052\u0065\u0071\u0075\u0065\u0073\u0074\u004D\u0065\u0074\u0068\u006F\u0064.\u0047\u0045\u0054);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0050\u006C\u0061\u0079\u0056\u006F\u0069\u0063\u0065(\u004C\u0069\u0073\u0074<\u0062\u0079\u0074\u0065[]> \u0056\u0044, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u006F\u0074){\u0069\u0066 (\u0056\u0044==\u006E\u0075\u006C\u006C) \u0079\u0069\u0065\u006C\u0064 \u0062\u0072\u0065\u0061\u006B;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0062\u0079\u0074\u0065[] \u0064\u0061\u0074\u0061 \u0069\u006E \u0056\u0044){\u0069\u0066 (\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0053\u0074\u0061\u0072\u0074()){\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0050\u0061\u0063\u006B\u0065\u0074\u0049\u0044(\u004D\u0065\u0073\u0073\u0061\u0067\u0065.\u0054\u0079\u0070\u0065.\u0056\u006F\u0069\u0063\u0065\u0044\u0061\u0074\u0061);\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0055\u0049\u006E\u007432(\u0062\u006F\u0074.\u006E\u0065\u0074.\u0049\u0044);\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0042\u0079\u0074\u0065\u0073\u0057\u0069\u0074\u0068\u0053\u0069\u007A\u0065(\u0064\u0061\u0074\u0061);\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0053\u0065\u006E\u0064(\u006E\u0065\u0077 \u0053\u0065\u006E\u0064\u0049\u006E\u0066\u006F(\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065.\u0047\u0065\u0074\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0069\u006F\u006E\u0073\u0057\u0069\u0074\u0068\u0069\u006E(\u0062\u006F\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 100)){\u0070\u0072\u0069\u006F\u0072\u0069\u0074\u0079 = \u0050\u0072\u0069\u006F\u0072\u0069\u0074\u0079.\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065 });}\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0065\u0077 \u0057\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u004D\u0061\u0070\u0052\u006F\u0075\u0074\u0069\u006E\u0065(){\u0064\u006F{\u0074\u0072\u0079 {\u0044\u0072\u0061\u0077\u004D\u0061\u0070();} \u0063\u0061\u0074\u0063\u0068 {}\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E \u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065\u0045\u0078.\u0077\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(30);} \u0077\u0068\u0069\u006C\u0065 (\u0074\u0072\u0075\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0050\u006C\u0061\u0079\u0070\u0061\u0063\u006B\u0065\u0074(\u0062\u0079\u0074\u0065[] \u0056\u0044, \u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072){\u0069\u0066 (\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0053\u0074\u0061\u0072\u0074()){\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0050\u0061\u0063\u006B\u0065\u0074\u0049\u0044(\u004D\u0065\u0073\u0073\u0061\u0067\u0065.\u0054\u0079\u0070\u0065.\u0056\u006F\u0069\u0063\u0065\u0044\u0061\u0074\u0061);\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0055\u0049\u006E\u007432(\u006E\u0065\u0077\u0050\u006C\u0061\u0079\u0065\u0072.\u006E\u0065\u0074.\u0049\u0044);\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0042\u0079\u0074\u0065\u0073\u0057\u0069\u0074\u0068\u0053\u0069\u007A\u0065(\u0056\u0044);\u004E\u0065\u0074\u0077\u006F\u0072\u006B.\u004E\u0065\u0074.\u0073\u0076.\u0077\u0072\u0069\u0074\u0065.\u0053\u0065\u006E\u0064(\u006E\u0065\u0077 \u0053\u0065\u006E\u0064\u0049\u006E\u0066\u006F(\u0067\u006C\u006F\u0062\u0061\u006C::\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065.\u0047\u0065\u0074\u0043\u006F\u006E\u006E\u0065\u0063\u0074\u0069\u006F\u006E\u0073\u0057\u0069\u0074\u0068\u0069\u006E(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 100f)){\u0070\u0072\u0069\u006F\u0072\u0069\u0074\u0079 = \u0050\u0072\u0069\u006F\u0072\u0069\u0074\u0079.\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065 });}\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0065\u0077 \u0057\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u0072\u006B\u0065\u0072\u0044\u0069\u0073\u0070\u006C\u0061\u0079\u0069\u006E\u0067\u0044\u0065\u006C\u0065\u0074\u0065(){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u006D \u0069\u006E \u006D\u0061\u0070\u006D\u0061\u0072\u006B\u0065\u0072\u0073){\u0069\u0066 (\u006D != \u006E\u0075\u006C\u006C && !\u006D.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u006D.\u004B\u0069\u006C\u006C();\u006D.\u0053\u0065\u006E\u0064\u0055\u0070\u0064\u0061\u0074\u0065();}}\u006D\u0061\u0070\u006D\u0061\u0072\u006B\u0065\u0072\u0073.\u0043\u006C\u0065\u0061\u0072();}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0072\u0061\u0077\u004D\u0061\u0070(){\u004D\u0061\u0072\u006B\u0065\u0072\u0044\u0069\u0073\u0070\u006C\u0061\u0079\u0069\u006E\u0067\u0044\u0065\u006C\u0065\u0074\u0065();\u0069\u0066 (\u0050\u0069\u0072\u0061\u0074\u0065.\u0043\u006F\u0075\u006E\u0074==0){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0075\u0069\u006E\u0074 \u0070 \u0069\u006E \u0050\u0069\u0072\u0061\u0074\u0065.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0074\u0072\u0079{\u0069\u0066 (\u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070)){\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 = \u0042\u0061\u0073\u0065\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0061\u0062\u006C\u0065.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074[\u0070] \u0061\u0073 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079;\u0069\u0066 (\u0062\u0065 != \u006E\u0075\u006C\u006C && !\u0062\u0065.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0047\u0065\u006E\u0065\u0072\u0069\u0063\u0052\u0061\u0064\u0069\u0075\u0073 \u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0074\u006F\u006F\u006C\u0073/\u006D\u0061\u0070/\u0067\u0065\u006E\u0065\u0072\u0069\u0063\u0072\u0061\u0064\u0069\u0075\u0073\u006D\u0061\u0072\u006B\u0065\u0072.\u0070\u0072\u0065\u0066\u0061\u0062") \u0061\u0073 \u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0047\u0065\u006E\u0065\u0072\u0069\u0063\u0052\u0061\u0064\u0069\u0075\u0073;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0061\u006C\u0070\u0068\u0061 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0041\u006C\u0070\u0068\u0061;\u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>()){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00721 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0041\u0069\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00722 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0041\u0069\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>()){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00721 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00722 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065>()){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00721 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u0061\u006E\u0064\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00722 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u0061\u006E\u0064\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065>()){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00721 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u0061\u006E\u0064\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00722 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u0061\u006E\u0064\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065>()){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00721 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0042\u0061\u0073\u0065\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00722 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0042\u0061\u0073\u0065\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0062\u0065.\u0048\u0061\u0073\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0061\u0069\u006C\u0050\u0069\u0072\u0061\u0074\u0065>()){\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00721 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0061\u0069\u006C\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0063\u006F\u006C\u006F\u00722 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0061\u0069\u006C\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u006F\u006C\u006F\u0075\u0072;}\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0072\u0061\u0064\u0069\u0075\u0073 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0053\u0069\u007A\u0065;\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0062\u0065, \u0066\u0061\u006C\u0073\u0065, \u0074\u0072\u0075\u0065);\u0069\u0066 (\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E != \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0)){\u006D\u0061\u0070\u006D\u0061\u0072\u006B\u0065\u0072\u0073.\u0041\u0064\u0064(\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0043\u0075\u0073\u0074\u006F\u006D);}}}}\u0063\u0061\u0074\u0063\u0068 {}}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u006D \u0069\u006E \u006D\u0061\u0070\u006D\u0061\u0072\u006B\u0065\u0072\u0073){\u006D.\u0053\u0070\u0061\u0077\u006E();\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072\u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006D);\u006D.\u0053\u0065\u006E\u0064\u0055\u0070\u0064\u0061\u0074\u0065();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0042\u0075\u0069\u006C\u0064\u004C\u006F\u006F\u0074\u0054\u0061\u0062\u006C\u0065(){_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006F\u006E\u0066\u0069\u0067["\u0058\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073"].\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073==""){\u0050\u0075\u0074\u0073("\u004E\u006F \u004C\u006F\u006F\u0074 \u0054\u0061\u0062\u006C\u0065");\u0072\u0065\u0074\u0075\u0072\u006E;}\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006C\u0065\u0061\u0072();\u0074\u0072\u0079{\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("<\u0050\u0072\u006F\u0066\u0069\u006C\u0065>")){\u0073\u0074\u0072\u0069\u006E\u0067[] \u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0073 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073.\u0053\u0070\u006C\u0069\u0074(\u006E\u0065\u0077 \u0073\u0074\u0072\u0069\u006E\u0067[] {"<\u0050\u0072\u006F\u0066\u0069\u006C\u0065>" }, \u0053\u0079\u0073\u0074\u0065\u006D.\u0053\u0074\u0072\u0069\u006E\u0067\u0053\u0070\u006C\u0069\u0074\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u0052\u0065\u006D\u006F\u0076\u0065\u0045\u006D\u0070\u0074\u0079\u0045\u006E\u0074\u0072\u0069\u0065\u0073);\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0073\u0074\u0072\u0069\u006E\u0067 \u0070 \u0069\u006E \u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0073){\u0073\u0074\u0072\u0069\u006E\u0067[] \u0069\u0074\u0065\u006D\u0073 = \u0070.\u0053\u0070\u006C\u0069\u0074(\u006E\u0065\u0077 \u0073\u0074\u0072\u0069\u006E\u0067[] {"|" }, \u0053\u0079\u0073\u0074\u0065\u006D.\u0053\u0074\u0072\u0069\u006E\u0067\u0053\u0070\u006C\u0069\u0074\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u0052\u0065\u006D\u006F\u0076\u0065\u0045\u006D\u0070\u0074\u0079\u0045\u006E\u0074\u0072\u0069\u0065\u0073);\u0076\u0061\u0072 \u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0064\u0061\u0074\u0061 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>>();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0073\u0074\u0072\u0069\u006E\u0067 \u0065\u006E\u0074 \u0069\u006E \u0069\u0074\u0065\u006D\u0073){\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0064\u0061\u0074\u0061 = \u006E\u0065\u0077 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>();\u0073\u0074\u0072\u0069\u006E\u0067[] \u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F = \u0065\u006E\u0074.\u0053\u0070\u006C\u0069\u0074(\u006E\u0065\u0077 \u0073\u0074\u0072\u0069\u006E\u0067[] {"," }, \u0053\u0079\u0073\u0074\u0065\u006D.\u0053\u0074\u0072\u0069\u006E\u0067\u0053\u0070\u006C\u0069\u0074\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u0052\u0065\u006D\u006F\u0076\u0065\u0045\u006D\u0070\u0074\u0079\u0045\u006E\u0074\u0072\u0069\u0065\u0073);\u0069\u0066 (\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F.\u004C\u0065\u006E\u0067\u0074\u0068 < 2){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0064\u0061\u0074\u0061.\u0041\u0064\u0064(\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F[0], \u0065\u006E\u0074.\u0052\u0065\u0070\u006C\u0061\u0063\u0065(\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F[0] + ",", ""));\u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0064\u0061\u0074\u0061.\u0041\u0064\u0064(\u0064\u0061\u0074\u0061);}\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0041\u0064\u0064(\u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0064\u0061\u0074\u0061);}\u0050\u0075\u0074\u0073("\u0052\u0065\u0062\u0075\u0069\u006C\u0074 \u004C\u006F\u006F\u0074 \u0054\u0061\u0062\u006C\u0065, " + \u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0073 \u006C\u006F\u0061\u0064\u0065\u0064");\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0063\u0061\u0074\u0063\u0068 {}\u0050\u0075\u0074\u0073("\u0049\u006E\u0076\u0061\u006C\u0069\u0064 \u004C\u006F\u006F\u0074 \u0054\u0061\u0062\u006C\u0065");\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004C\u006F\u006F\u0074\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0061\u0079\u0065\u0072, \u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072){\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u0043\u006C\u0065\u0061\u0072();\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0043\u0068\u0065\u0063\u006B\u0073 = \u0066\u0061\u006C\u0073\u0065;\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u0065\u006E\u0074\u0069\u0074\u0079\u0053\u006F\u0075\u0072\u0063\u0065 = \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0065\u006E\u0074\u0069\u0074\u0079\u004F\u0077\u006E\u0065\u0072 ?? \u0070\u006C\u0061\u0079\u0065\u0072;\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u0069\u0074\u0065\u006D\u0053\u006F\u0075\u0072\u0063\u0065 = \u006E\u0075\u006C\u006C;\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u004D\u0061\u0072\u006B\u0044\u0069\u0072\u0074\u0079();\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u0041\u0064\u0064\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072);\u0070\u006C\u0061\u0079\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u006C\u006F\u006F\u0074.\u0053\u0065\u006E\u0064\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u0070\u006C\u0061\u0079\u0065\u0072.\u0043\u006C\u0069\u0065\u006E\u0074\u0052\u0050\u0043\u0050\u006C\u0061\u0079\u0065\u0072(\u006E\u0075\u006C\u006C, \u0070\u006C\u0061\u0079\u0065\u0072, "\u0052\u0050\u0043_\u004F\u0070\u0065\u006E\u004C\u006F\u006F\u0074\u0050\u0061\u006E\u0065\u006C", "\u0067\u0065\u006E\u0065\u0072\u0069\u0063_\u0072\u0065\u0073\u0069\u007A\u0061\u0062\u006C\u0065");}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0066\u0069\u006C\u006C\u006C\u006F\u006F\u0074(\u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u0074\u0065\u006D\u0062, \u0069\u006E\u0074 \u0073\u0065\u006C\u0065\u0063\u0074, \u0069\u006E\u0074 \u006D\u0075\u006C\u0074\u0069, \u0073\u0074\u0072\u0069\u006E\u0067 \u0043\u0072\u0065\u0061\u0074\u0065\u0050\u0072\u0065\u0066\u0061\u0062 = ""){\u0069\u006E\u0074 \u0073\u0065\u006C\u0065\u0063\u0074\u0069\u006F\u006E = \u0073\u0065\u006C\u0065\u0063\u0074;\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u006D\u0075\u006C\u0074\u0069==0){\u0069\u0066 (\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u0075\u006E\u0074==0){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0073\u0065\u006C\u0065\u0063\u0074\u0069\u006F\u006E > \u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u0075\u006E\u0074){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069 \u0069\u006E \u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065[\u0073\u0065\u006C\u0065\u0063\u0074\u0069\u006F\u006E].\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u004B\u0065\u0079\u0056\u0061\u006C\u0075\u0065\u0050\u0061\u0069\u0072<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069\u0074 \u0069\u006E \u0069){\u0073\u0074\u0072\u0069\u006E\u0067[] \u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F = \u0069\u0074.\u0056\u0061\u006C\u0075\u0065.\u0053\u0070\u006C\u0069\u0074(',');\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0069\u0074.\u004B\u0065\u0079, \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F[0]), \u0075\u006C\u006F\u006E\u0067.\u0050\u0061\u0072\u0073\u0065(\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F[1]));\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0069\u0074\u0065\u006D\u0062, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();}}}}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u006D = 0;\u006D < \u006D\u0075\u006C\u0074\u0069;\u006D++){\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0069\u0066 (\u0073\u0065\u006C\u0065\u0063\u0074==-1){\u0073\u0065\u006C\u0065\u0063\u0074\u0069\u006F\u006E = \u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(0, \u0070\u006C\u0075\u0067\u0069\u006E.\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u0075\u006E\u0074);}\u0069\u0066 (\u0043\u0072\u0065\u0061\u0074\u0065\u0050\u0072\u0065\u0066\u0061\u0062==""){\u0069\u0066 (\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u0075\u006E\u0074==0){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069 \u0069\u006E \u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065[\u0073\u0065\u006C\u0065\u0063\u0074\u0069\u006F\u006E].\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u004B\u0065\u0079\u0056\u0061\u006C\u0075\u0065\u0050\u0061\u0069\u0072<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069\u0074 \u0069\u006E \u0069){\u0073\u0074\u0072\u0069\u006E\u0067[] \u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F = \u0069\u0074.\u0056\u0061\u006C\u0075\u0065.\u0053\u0070\u006C\u0069\u0074(',');\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0069\u0074.\u004B\u0065\u0079, \u0069\u006E\u0074.\u0050\u0061\u0072\u0073\u0065(\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F[0]), \u0075\u006C\u006F\u006E\u0067.\u0050\u0061\u0072\u0073\u0065(\u0069\u0074\u0065\u006D\u0069\u006E\u0066\u006F[1]));\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0069\u0074\u0065\u006D\u0062, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();}}}}\u0065\u006C\u0073\u0065{\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0043\u0072\u0065\u0061\u0074\u0065\u0050\u0072\u0065\u0066\u0061\u0062) \u0061\u0073 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072;\u0069\u0066 (\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079){\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065("\u0053\u0065\u0074\u0057\u0061\u0073\u0044\u0072\u006F\u0070\u0070\u0065\u0064", \u0053\u0065\u006E\u0064\u004D\u0065\u0073\u0073\u0061\u0067\u0065\u004F\u0070\u0074\u0069\u006F\u006E\u0073.\u0044\u006F\u006E\u0074\u0052\u0065\u0071\u0075\u0069\u0072\u0065\u0052\u0065\u0063\u0065\u0069\u0076\u0065\u0072);\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u0070\u0061\u0077\u006E();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0049\u0074\u0065\u006D \u0069 \u0069\u006E \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0069\u0074\u0065\u006D\u0062);}\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0069\u0066 (!\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u004B\u0069\u006C\u006C();}});}}});}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0073\u0061\u0076\u0065\u006C\u006F\u006F\u0074(){\u0073\u0074\u0072\u0069\u006E\u0067 \u006E\u0065\u0077\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065 = "";\u0069\u0066 (\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065.\u0043\u006F\u0075\u006E\u0074 != 0){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u004C\u0069\u0073\u0074<\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067>> \u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0073 \u0069\u006E \u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065){\u006E\u0065\u0077\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065 += "<\u0050\u0072\u006F\u0066\u0069\u006C\u0065>";\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069 \u0069\u006E \u0070\u0072\u006F\u0066\u0069\u006C\u0065\u0073){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u004B\u0065\u0079\u0056\u0061\u006C\u0075\u0065\u0050\u0061\u0069\u0072<\u0073\u0074\u0072\u0069\u006E\u0067, \u0073\u0074\u0072\u0069\u006E\u0067> \u0069\u0074 \u0069\u006E \u0069){\u006E\u0065\u0077\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065 += \u0069\u0074.\u004B\u0065\u0079 + "," + \u0069\u0074.\u0056\u0061\u006C\u0075\u0065 + "|";}}}\u0043\u006F\u006E\u0066\u0069\u0067["\u0058\u004C\u006F\u006F\u0074\u0050\u0072\u006F\u0066\u0069\u006C\u0065\u0073"] = \u006E\u0065\u0077\u006C\u006F\u006F\u0074\u0074\u0061\u0062\u006C\u0065;\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0043\u006F\u006E\u0066\u0069\u0067.\u0053\u0061\u0076\u0065();});\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(1f, () =>{\u0042\u0075\u0069\u006C\u0064\u004C\u006F\u006F\u0074\u0054\u0061\u0062\u006C\u0065();});}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0049\u0073\u004B\u0069\u0074(\u0073\u0074\u0072\u0069\u006E\u0067 \u006B\u0069\u0074){\u0076\u0061\u0072 \u0073\u0075\u0063\u0063\u0065\u0073\u0073 = \u004B\u0069\u0074\u0073?.\u0043\u0061\u006C\u006C("\u0069\u0073\u004B\u0069\u0074", \u006B\u0069\u0074);\u0069\u0066 (\u0073\u0075\u0063\u0063\u0065\u0073\u0073==\u006E\u0075\u006C\u006C || !(\u0073\u0075\u0063\u0063\u0065\u0073\u0073 \u0069\u0073 \u0062\u006F\u006F\u006C)){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u0072\u0065\u0074\u0075\u0072\u006E (\u0062\u006F\u006F\u006C)\u0073\u0075\u0063\u0063\u0065\u0073\u0073;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0047\u0069\u0076\u0065\u004B\u0069\u0074(\u004E\u0050\u0043\u0050\u006C\u0061\u0079\u0065\u0072 \u006E\u0070\u0063, \u0073\u0074\u0072\u0069\u006E\u0067 \u004E\u0050\u0043\u004B\u0069\u0074){\u0069\u0066 (\u004B\u0069\u0074\u0073==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;};\u0069\u0066 (\u004E\u0050\u0043\u004B\u0069\u0074=="" || !\u0049\u0073\u004B\u0069\u0074(\u004E\u0050\u0043\u004B\u0069\u0074)){\u0072\u0065\u0074\u0075\u0072\u006E;};\u006F\u0062\u006A\u0065\u0063\u0074 \u0073\u0075\u0063\u0063\u0065\u0073\u0073 = \u004B\u0069\u0074\u0073?.\u0043\u0061\u006C\u006C("\u0047\u0069\u0076\u0065\u004B\u0069\u0074", \u006E\u0070\u0063, \u004E\u0050\u0043\u004B\u0069\u0074);\u0069\u0066 (\u0073\u0075\u0063\u0063\u0065\u0073\u0073==\u006E\u0075\u006C\u006C || !(\u0073\u0075\u0063\u0063\u0065\u0073\u0073 \u0069\u0073 \u0062\u006F\u006F\u006C)){\u0050\u0075\u0074\u0073("\u0046\u0061\u0069\u006C\u0065\u0064 \u0074\u006F \u0067\u0069\u0076\u0065 \u004E\u0050\u0043 \u004B\u0069\u0074");\u0072\u0065\u0074\u0075\u0072\u006E;}\u0049\u0074\u0065\u006D \u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0049\u0074\u0065\u006D = \u006E\u0075\u006C\u006C;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0069\u0074\u0065\u006D \u0069\u006E \u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0042\u0065\u006C\u0074.\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074.\u0054\u006F\u004C\u0069\u0073\u0074()){\u0069\u0066 (\u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079() \u0069\u0073 \u0042\u0061\u0073\u0065\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065){\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0049\u0074\u0065\u006D = \u0069\u0074\u0065\u006D;\u0062\u0072\u0065\u0061\u006B;}\u0069\u0066 (\u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079() \u0069\u0073 \u004D\u0065\u0064\u0069\u0063\u0061\u006C\u0054\u006F\u006F\u006C){\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u004D\u0061\u0069\u006E);\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}}\u0069\u0066 (\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0049\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0069\u0074\u0065\u006D \u0069\u006E \u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0042\u0065\u006C\u0074.\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074.\u0054\u006F\u004C\u0069\u0073\u0074()){\u0069\u0066 (\u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079() \u0069\u0073 \u0042\u0061\u0073\u0065\u004D\u0065\u006C\u0065\u0065){\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0049\u0074\u0065\u006D = \u0069\u0074\u0065\u006D;\u0062\u0072\u0065\u0061\u006B;}}}\u0069\u0066 (\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0049\u0074\u0065\u006D != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0055\u0070\u0064\u0061\u0074\u0065\u0041\u0063\u0074\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0070\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065\u0049\u0074\u0065\u006D.\u0075\u0069\u0064);\u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0055\u0070\u0064\u0061\u0074\u0065\u0064\u0056\u0069\u0073\u0069\u0062\u006C\u0065\u0048\u006F\u006C\u0073\u0074\u0065\u0072\u0065\u0064\u0049\u0074\u0065\u006D\u0073();\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(1f, () =>{\u006E\u0070\u0063.\u0041\u0074\u0074\u0065\u006D\u0070\u0074\u0052\u0065\u006C\u006F\u0061\u0064();});}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0077\u0069\u0074\u0063\u0068\u0047\u0075\u006E(\u004E\u0050\u0043\u0050\u006C\u0061\u0079\u0065\u0072 \u004E\u0050\u0043, \u0049\u0074\u0065\u006D \u0047\u0075\u006E){\u0069\u0066 (\u004E\u0050\u0043 != \u006E\u0075\u006C\u006C && \u004E\u0050\u0043.\u0049\u0073\u0041\u006C\u0069\u0076\u0065() && \u0047\u0075\u006E != \u006E\u0075\u006C\u006C){\u004E\u0050\u0043.\u0055\u0070\u0064\u0061\u0074\u0065\u0041\u0063\u0074\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0047\u0075\u006E.\u0075\u0069\u0064);\u004E\u0050\u0043.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0042\u0061\u0069\u006C\u004F\u0075\u0074(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073, \u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063, \u0069\u006E\u0074 \u0072\u0061\u0064\u0069\u0075\u0073, \u0066\u006C\u006F\u0061\u0074 \u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = 0, \u0062\u006F\u006F\u006C \u0064\u0069\u0065 = \u0074\u0072\u0075\u0065){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C){\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u006E\u0070\u0063.\u0045\u006E\u0073\u0075\u0072\u0065\u0044\u0069\u0073\u006D\u006F\u0075\u006E\u0074\u0065\u0064();\u006E\u0070\u0063.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u006E\u0075\u006C\u006C, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006F\u0073;\u0069\u0066 (!\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044)){\u0066\u006C\u006F\u0061\u0074 \u0064 = \u0072\u0061\u0064\u0069\u0075\u0073;\u0056\u0065\u0063\u0074\u006F\u00722 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u0065\u0077\u0050\u006F\u0073 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073\u0063\u0061\u006E = 0;\u0073\u0063\u0061\u006E < 50;\u0073\u0063\u0061\u006E++){\u0076\u0065\u0063\u0074\u006F\u0072 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0069\u006E\u0073\u0069\u0064\u0065\u0055\u006E\u0069\u0074\u0043\u0069\u0072\u0063\u006C\u0065 * \u0064;\u006E\u0065\u0077\u0050\u006F\u0073 = \u0070\u006F\u0073 + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, 0, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079);\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006E\u0065\u0077\u0050\u006F\u0073, \u0070\u006F\u0073) < \u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077\u0050\u006F\u0073) > -0.4f){\u0062\u0072\u0065\u0061\u006B;}}\u006E\u0070\u0063.\u006D\u006F\u0064\u0065\u006C\u0053\u0074\u0061\u0074\u0065.\u006D\u006F\u0075\u006E\u0074\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0070\u006C\u0075\u0067\u0069\u006E.\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0041\u0064\u0064(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u0069\u0066 (\u0064\u0069\u0065){\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0044\u0069\u0065, () =>{\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && \u006E\u0070\u0063.\u0049\u0073\u0041\u006C\u0069\u0076\u0065() && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}});}\u006E\u0065\u0077\u0050\u006F\u0073.\u0079 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077\u0050\u006F\u0073) + 4f;\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077\u0050\u006F\u0073;\u0076\u0061\u0072 \u0072\u0062 = \u006E\u0070\u0063.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079>();\u0069\u0066 (\u0072\u0062 != \u006E\u0075\u006C\u006C){\u0072\u0062.\u0064\u0072\u0061\u0067 = 0f;\u0072\u0062.\u0075\u0073\u0065\u0047\u0072\u0061\u0076\u0069\u0074\u0079 = \u0066\u0061\u006C\u0073\u0065;\u0072\u0062.\u0069\u0073\u004B\u0069\u006E\u0065\u006D\u0061\u0074\u0069\u0063 = \u0066\u0061\u006C\u0073\u0065;\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064.\u0078 * 0, 0, \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064.\u007A * 0) - \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 2, 0);}\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u0068\u0065\u0063\u006B(\u006E\u0070\u0063);});}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u006E\u0070\u0063.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u006E\u0075\u006C\u006C, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0046\u0072\u006F\u006D\u0054\u006F\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070) * \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u0076\u0061\u0072 \u0072\u0062 = \u006E\u0070\u0063.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079>();\u0069\u0066 (\u0072\u0062 != \u006E\u0075\u006C\u006C){\u0072\u0062.\u0064\u0072\u0061\u0067 = 0f;\u0072\u0062.\u0075\u0073\u0065\u0047\u0072\u0061\u0076\u0069\u0074\u0079 = \u0066\u0061\u006C\u0073\u0065;\u0072\u0062.\u0069\u0073\u004B\u0069\u006E\u0065\u006D\u0061\u0074\u0069\u0063 = \u0066\u0061\u006C\u0073\u0065;\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064.\u0078 * 0, 0, \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064.\u007A * 0) - \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 5, 0);}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(1f, () =>{\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0041\u0064\u0064(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0044\u0069\u0065, () =>{\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;} \u0069\u0066 (\u006E\u0070\u0063.\u0049\u0073\u0041\u006C\u0069\u0076\u0065() && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}});\u0076\u0061\u0072 \u0043\u0068\u0075\u0074\u0065 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006D\u0069\u0073\u0063/\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065/\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065.\u0070\u0072\u0065\u0066\u0061\u0062", \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0046\u0072\u006F\u006D\u0054\u006F\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070) * \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E);\u0069\u0066 (\u0043\u0068\u0075\u0074\u0065 != \u006E\u0075\u006C\u006C){\u0043\u0068\u0075\u0074\u0065.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u006E\u0070\u0063, 0, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);\u0056\u0065\u0063\u0074\u006F\u00723 \u006D\u006F\u0076\u0065\u0070\u006F\u0073 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u006D\u006F\u0076\u0065\u0070\u006F\u0073 += \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * -0.10f;\u006D\u006F\u0076\u0065\u0070\u006F\u0073 += \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070 * 1.5f;\u0043\u0068\u0075\u0074\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006D\u006F\u0076\u0065\u0070\u006F\u0073;\u0043\u0068\u0075\u0074\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0046\u0072\u006F\u006D\u0054\u006F\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0043\u0068\u0075\u0074\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070) * \u0043\u0068\u0075\u0074\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u0043\u0068\u0075\u0074\u0065.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0043\u0068\u0075\u0074\u0065);\u0043\u0068\u0075\u0074\u0065.\u0053\u0070\u0061\u0077\u006E();\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0044\u0065\u0063\u0061\u0079, () =>{\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0053\u0075\u0069\u0073\u0069\u0064\u0065(\u006E\u0070\u0063);});\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(1f, () =>{\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u0068\u0065\u0063\u006B(\u006E\u0070\u0063);});}});}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0053\u0075\u0069\u0073\u0069\u0064\u0065(\u004E\u0050\u0043\u0050\u006C\u0061\u0079\u0065\u0072 \u006E\u0070\u0063){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0062\u006F\u006F\u006C \u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0063\u0068\u0069\u006C\u0064 \u0069\u006E \u006E\u0070\u0063.\u0063\u0068\u0069\u006C\u0064\u0072\u0065\u006E.\u0057\u0068\u0065\u0072\u0065(\u0063\u0068\u0069\u006C\u0064 => \u0063\u0068\u0069\u006C\u0064.\u006E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065"))){\u0069\u0066 (!\u0063\u0068\u0069\u006C\u0064.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0063\u0068\u0069\u006C\u0064.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u006E\u0075\u006C\u006C);\u0063\u0068\u0069\u006C\u0064.\u004B\u0069\u006C\u006C();\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0045\u0066\u0066\u0065\u0063\u0074.\u0073\u0065\u0072\u0076\u0065\u0072.\u0052\u0075\u006E("\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0066\u0078/\u0070\u006C\u0061\u0079\u0065\u0072/\u0067\u0072\u006F\u0075\u006E\u0064\u0066\u0061\u006C\u006C.\u0070\u0072\u0065\u0066\u0061\u0062", \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0047\u0072\u006F\u0075\u006E\u0064\u0043\u0068\u0065\u0063\u006B(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C) \u0072\u0065\u0074\u0075\u0072\u006E;\u006E\u0070\u0063.\u006D\u006F\u0064\u0065\u006C\u0053\u0074\u0061\u0074\u0065.\u006D\u006F\u0075\u006E\u0074\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074;\u0069\u0066 (\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0053\u0070\u0068\u0065\u0072\u0065\u0043\u0061\u0073\u0074(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 3f, \u0056\u0065\u0063\u0074\u006F\u00723.\u0064\u006F\u0077\u006E, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 3f, 1134625043) || \u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0053\u0070\u0068\u0065\u0072\u0065\u0043\u0061\u0073\u0074(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 3f, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 3f, 1134625043)){\u0076\u0061\u0072 \u0072\u0062 = \u006E\u0070\u0063.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079>();\u0069\u0066 (\u0072\u0062 != \u006E\u0075\u006C\u006C){\u0072\u0062.\u0069\u0073\u004B\u0069\u006E\u0065\u006D\u0061\u0074\u0069\u0063 = \u0074\u0072\u0075\u0065;\u0072\u0062.\u0075\u0073\u0065\u0047\u0072\u0061\u0076\u0069\u0074\u0079 = \u0066\u0061\u006C\u0073\u0065;\u006E\u0070\u0063.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u006C\u0061\u0079\u0065\u0072 = 17;\u0050\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065\u0053\u0075\u0069\u0073\u0069\u0064\u0065(\u006E\u0070\u0063);}\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074.\u0070\u006F\u0069\u006E\u0074;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004D\u0061\u0078\u0052\u006F\u0061\u006D\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065\u0046\u0072\u006F\u006D\u0048\u006F\u006D\u0065 = 30f;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0042\u0065\u0073\u0074\u004D\u006F\u0076\u0065\u006D\u0065\u006E\u0074\u0050\u006F\u0069\u006E\u0074\u004D\u0061\u0078\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = 30f;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0045\u0076\u0065\u006E\u0074\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0053\u0065\u0074(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 4);\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0042\u0065\u0073\u0074\u0052\u006F\u0061\u006D\u0050\u006F\u0069\u006E\u0074\u004D\u0061\u0078\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = 40f;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0044\u0065\u0066\u0061\u0075\u006C\u0074\u0041\u0072\u0065\u0061 = "\u0057\u0061\u006C\u006B\u0061\u0062\u006C\u0065";\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0041\u0067\u0065\u006E\u0074.\u0061\u0067\u0065\u006E\u0074\u0054\u0079\u0070\u0065\u0049\u0044 = -1372625422;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004D\u0061\u0078\u0057\u0061\u0074\u0065\u0072\u0044\u0065\u0070\u0074\u0068 = 1f;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0043\u0061\u006E\u0055\u0073\u0065\u004E\u0061\u0076\u004D\u0065\u0073\u0068 = \u0074\u0072\u0075\u0065;\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0049\u006E\u0069\u0074(\u006E\u0070\u0063, \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0041\u0067\u0065\u006E\u0074);\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0053\u0065\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u0069\u006F\u006E\u0054\u0079\u0070\u0065(\u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u0069\u006F\u006E\u0054\u0079\u0070\u0065.\u004E\u006F\u006E\u0065);\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u004E\u0050\u0043\u0054\u0069\u0063\u006B(\u006E\u0070\u0063);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 + 0.5f < \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E)){\u0056\u0065\u0063\u0074\u006F\u00722 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0069\u006E\u0073\u0069\u0064\u0065\u0055\u006E\u0069\u0074\u0043\u0069\u0072\u0063\u006C\u0065 * 4;\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u0065\u0077\u0070\u006F\u0073 = \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, 0, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079);\u006E\u0065\u0077\u0070\u006F\u0073.\u0079 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077\u0070\u006F\u0073);\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077\u0070\u006F\u0073;\u006E\u0070\u0063.\u0054\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D\u0043\u0068\u0061\u006E\u0067\u0065\u0064();\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0043\u0061\u006E\u0055\u0073\u0065\u004E\u0061\u0076\u004D\u0065\u0073\u0068 = \u0066\u0061\u006C\u0073\u0065;\u0076\u0061\u0072 \u0072\u0062 = \u006E\u0070\u0063.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079>();\u0069\u0066 (\u0072\u0062 != \u006E\u0075\u006C\u006C){\u0072\u0062.\u0069\u0073\u004B\u0069\u006E\u0065\u006D\u0061\u0074\u0069\u0063 = \u0074\u0072\u0075\u0065;\u0072\u0062.\u0075\u0073\u0065\u0047\u0072\u0061\u0076\u0069\u0074\u0079 = \u0066\u0061\u006C\u0073\u0065;\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064.\u0078 * 0, 0, \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064.\u007A * 0) - \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0);\u006E\u0070\u0063.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u006C\u0061\u0079\u0065\u0072 = 17;}\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 < -1f){\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(0.1f, () =>{\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u0068\u0065\u0063\u006B(\u006E\u0070\u0063);});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004E\u0050\u0043\u0054\u0069\u0063\u006B(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0074\u0061\u0072\u0067\u0065\u0074 = \u006E\u0075\u006C\u006C){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C) \u0072\u0065\u0074\u0075\u0072\u006E;\u0066\u006C\u006F\u0061\u0074 \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (\u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 < -2f || \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 < \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 - 2f){\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u006E\u0070\u0063.\u0044\u0069\u0065();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006E\u0070\u0063) > 50f){\u0074\u0061\u0072\u0067\u0065\u0074 = \u006E\u0075\u006C\u006C;}}\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074==\u006E\u0075\u006C\u006C){\u0074\u0061\u0072\u0067\u0065\u0074 = \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u0047\u0065\u0074\u004E\u0065\u0061\u0072\u0065\u0073\u0074\u0054\u0068\u0072\u0065\u0061\u0074(30);}\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C && !\u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0074\u0061\u0072\u0067\u0065\u0074.\u006E\u0065\u0074.\u0049\u0044)){\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0053\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0074\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064.\u004E\u006F\u0072\u006D\u0061\u006C);}\u0065\u006C\u0073\u0065{\u0066\u006C\u006F\u0061\u0074 \u0064 = 10f;\u0056\u0065\u0063\u0074\u006F\u00722 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u0065\u0077\u0050\u006F\u0073 = \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073\u0063\u0061\u006E = 0;\u0073\u0063\u0061\u006E < 10;\u0073\u0063\u0061\u006E++){\u0076\u0065\u0063\u0074\u006F\u0072 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0069\u006E\u0073\u0069\u0064\u0065\u0055\u006E\u0069\u0074\u0043\u0069\u0072\u0063\u006C\u0065 * \u0064;\u006E\u0065\u0077\u0050\u006F\u0073 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, 0, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079);\u006E\u0065\u0077\u0050\u006F\u0073.\u0079 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077\u0050\u006F\u0073);\u0069\u0066 (\u006E\u0065\u0077\u0050\u006F\u0073.\u0079 > -0.4f){\u0062\u0072\u0065\u0061\u006B;}\u006E\u0065\u0077\u0050\u006F\u0073 = \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;}\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E, \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) > 20f){\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0053\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0045\u0076\u0065\u006E\u0074\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0047\u0065\u0074(4) + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, 0f, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079), \u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064.\u004E\u006F\u0072\u006D\u0061\u006C);}\u0065\u006C\u0073\u0065 \u0069\u0066 (!\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004D\u006F\u0076\u0069\u006E\u0067){\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0053\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0045\u0076\u0065\u006E\u0074\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0047\u0065\u0074(4) + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, 0f, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079), \u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064.\u0053\u006C\u006F\u0077);}\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0045\u0076\u0065\u006E\u0074\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0047\u0065\u0074(4)) > 20){\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0053\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0045\u0076\u0065\u006E\u0074\u0073.\u004D\u0065\u006D\u006F\u0072\u0079.\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0047\u0065\u0074(4), \u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064.\u0046\u0061\u0073\u0074);}}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(4f, () =>{\u004E\u0050\u0043\u0054\u0069\u0063\u006B(\u006E\u0070\u0063, \u0074\u0061\u0072\u0067\u0065\u0074);});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0078\u0070\u006C\u006F\u0064\u0065(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065){\u0069\u0066 (\u0062\u0065==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0052\u0075\u006E\u0045\u0066\u0066\u0065\u0063\u0074("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0074\u006F\u006F\u006C\u0073/\u00634/\u0065\u0066\u0066\u0065\u0063\u0074\u0073/\u00634_\u0065\u0078\u0070\u006C\u006F\u0073\u0069\u006F\u006E.\u0070\u0072\u0065\u0066\u0061\u0062", \u0062\u0065, \u0062\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0070\u006C\u0075\u0067\u0069\u006E.\u0052\u0075\u006E\u0045\u0066\u0066\u0065\u0063\u0074("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006E\u0070\u0063/\u0070\u0061\u0074\u0072\u006F\u006C \u0068\u0065\u006C\u0069\u0063\u006F\u0070\u0074\u0065\u0072/\u0064\u0061\u006D\u0061\u0067\u0065_\u0065\u0066\u0066\u0065\u0063\u0074_\u0064\u0065\u0062\u0072\u0069\u0073.\u0070\u0072\u0065\u0066\u0061\u0062", \u0062\u0065, \u0062\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0061\u0070 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>();\u0069\u0066 (\u0061\u0070 != \u006E\u0075\u006C\u006C){\u0044\u0072\u006F\u0070\u004C\u006F\u006F\u0074(\u0061\u0070.\u006E\u0070\u0063\u0073, \u0061\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078);}\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 \u0077\u0070 = \u0062\u0065.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u0077\u0070 != \u006E\u0075\u006C\u006C){\u0044\u0072\u006F\u0070\u004C\u006F\u006F\u0074(\u0077\u0070.\u006E\u0070\u0063\u0073, \u0077\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078);}\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0069\u0066 (!\u0062\u0065.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0062\u0065.\u004B\u0069\u006C\u006C();}});\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0075\u0069\u006E\u0074 \u0069\u0064 \u0069\u006E \u004E\u0050\u0043\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (!\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0069\u0064)){\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u0069\u0064);}}\u0070\u006C\u0075\u0067\u0069\u006E.\u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074\u0073(\u0062\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0072\u006F\u0070\u004C\u006F\u006F\u0074(\u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u006E\u0070\u0063\u0073, \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u0074\u0065\u006D\u0062\u006F\u0078){\u0069\u0066 (\u006E\u0070\u0063\u0073 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0061\u0064()) \u006E\u0070\u0063.\u0044\u0069\u0065();}}\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0064\u0072\u006F\u0070\u0046\u006C\u006F\u0061\u0074\u0073 = \u0074\u0072\u0075\u0065;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0044\u0072\u006F\u0070\u0049\u0074\u0065\u006D\u0073();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074 \u0043\u0072\u0065\u0061\u0074\u0065\u004C\u0069\u0067\u0068\u0074(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065, \u0056\u0065\u0063\u0074\u006F\u00723 \u004C\u006F\u0063\u0061\u0074\u0069\u006F\u006E\u0050\u006F\u0073, \u0056\u0065\u0063\u0074\u006F\u00723 \u0052\u006F\u0074){\u0053\u0070\u0068\u0065\u0072\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0073\u0070\u0068 = (\u0053\u0070\u0068\u0065\u0072\u0065\u0045\u006E\u0074\u0069\u0074\u0079)\u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0076\u0069\u0073\u0075\u0061\u006C\u0069\u007A\u0061\u0074\u0069\u006F\u006E/\u0073\u0070\u0068\u0065\u0072\u0065.\u0070\u0072\u0065\u0066\u0061\u0062", \u0062\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006E\u0065\u0077 \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E(0, 0, 0, 0), \u0074\u0072\u0075\u0065);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0073\u0070\u0068);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0073\u0070\u0068);\u0073\u0070\u0068.\u0053\u0070\u0061\u0077\u006E();\u0073\u0070\u0068.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0062\u0065);\u0073\u0070\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, -150, 0);\u0053\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 \u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0064\u0065\u0070\u006C\u006F\u0079\u0061\u0062\u006C\u0065/\u0073\u0065\u0061\u0072\u0063\u0068 \u006C\u0069\u0067\u0068\u0074/\u0073\u0065\u0061\u0072\u0063\u0068\u006C\u0069\u0067\u0068\u0074.\u0064\u0065\u0070\u006C\u006F\u0079\u0065\u0064.\u0070\u0072\u0065\u0066\u0061\u0062", \u0073\u0070\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) \u0061\u0073 \u0053\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074;\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0053\u0070\u0061\u0077\u006E();\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00645, \u0074\u0072\u0075\u0065, \u0066\u0061\u006C\u0073\u0065, \u0074\u0072\u0075\u0065);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u0042\u0075\u0073\u0079, \u0074\u0072\u0075\u0065);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0073\u0070\u0068);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(\u0052\u006F\u0074);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0070\u0069\u0063\u006B\u0075\u0070.\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065();\u0073\u0070\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0053\u0063\u0061\u006C\u0065 += \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.9f, 0, 0);\u0073\u0070\u0068.\u004C\u0065\u0072\u0070\u0052\u0061\u0064\u0069\u0075\u0073\u0054\u006F(0.01f, 10f);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0049\u006E\u0076\u006F\u006B\u0065(() =>{\u0069\u0066 (\u0073\u0070\u0068 != \u006E\u0075\u006C\u006C){\u0073\u0070\u0068.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u004C\u006F\u0063\u0061\u0074\u0069\u006F\u006E\u0050\u006F\u0073;\u0073\u0070\u0068.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}}, 3f);\u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074 \u006E\u006C = \u006E\u0065\u0077 \u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074();\u006E\u006C._\u006C\u0069\u0067\u0068\u0074 = \u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074;\u006E\u006C.\u0072\u0065\u0073\u0069\u007A\u0065\u0072 = \u0073\u0070\u0068;\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u0043\u0072\u0065\u0061\u0074\u0065\u004E\u0050\u0043\u0073(\u0069\u006E\u0074 \u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074, \u0069\u006E\u0074 \u0054\u0079\u0070\u0065, \u0066\u006C\u006F\u0061\u0074 \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068, \u0073\u0074\u0072\u0069\u006E\u0067 \u004B\u0069\u0074, \u0066\u006C\u006F\u0061\u0074 \u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079, \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0053\u0065\u0061\u0074\u0073){\u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u006E\u0070\u0063\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043>();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E \u0069\u006E \u0053\u0065\u0061\u0074\u0073){\u0069\u0066 (\u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074 >= \u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0070\u0063\u0073;}\u0076\u0061\u0072 \u0070\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065 = \u0053\u0074\u0072\u0069\u006E\u0067\u0050\u006F\u006F\u006C.\u0047\u0065\u0074(3763080634);\u0076\u0061\u0072 \u0070\u0072\u0065\u0066\u0061\u0062 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0046\u0069\u006E\u0064\u0050\u0072\u0065\u0066\u0061\u0062(\u0070\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065);\u0076\u0061\u0072 \u0067\u006F = \u0046\u0061\u0063\u0065\u0070\u0075\u006E\u0063\u0068.\u0049\u006E\u0073\u0074\u0061\u006E\u0074\u0069\u0061\u0074\u0065.\u0047\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074(\u0070\u0072\u0065\u0066\u0061\u0062);\u0067\u006F.\u0053\u0065\u0074\u0041\u0063\u0074\u0069\u0076\u0065(\u0066\u0061\u006C\u0073\u0065);\u0067\u006F.\u006E\u0061\u006D\u0065 = \u0070\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065;\u0067\u006F.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 3, 0);\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 = \u0067\u006F.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043>();\u006E\u0070\u0063.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0053\u0063\u0065\u006E\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u004D\u006F\u0076\u0065\u0047\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074\u0054\u006F\u0053\u0063\u0065\u006E\u0065(\u0067\u006F, \u0052\u0075\u0073\u0074.\u0053\u0065\u0072\u0076\u0065\u0072.\u0045\u006E\u0074\u0069\u0074\u0079\u0053\u0063\u0065\u006E\u0065);\u006E\u0070\u0063.\u0075\u0073\u0065\u0072\u0049\u0044 = (\u0075\u006C\u006F\u006E\u0067)\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(0, 10000000);\u006E\u0070\u0063.\u0055\u0073\u0065\u0072\u0049\u0044\u0053\u0074\u0072\u0069\u006E\u0067 = \u006E\u0070\u0063.\u0075\u0073\u0065\u0072\u0049\u0044.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067();\u006E\u0070\u0063.\u0064\u0069\u0073\u0070\u006C\u0061\u0079\u004E\u0061\u006D\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u004E\u0061\u006D\u0065\u0054\u0061\u0067 + \u0052\u0061\u006E\u0064\u006F\u006D\u0055\u0073\u0065\u0072\u006E\u0061\u006D\u0065\u0073.\u0047\u0065\u0074(\u006E\u0070\u0063.\u0075\u0073\u0065\u0072\u0049\u0044);\u006E\u0070\u0063.\u0073\u0074\u0061\u0072\u0074\u0048\u0065\u0061\u006C\u0074\u0068 = \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u0042\u0072\u0061\u0069\u006E \u0062\u0072\u0061\u0069\u006E = \u006E\u0070\u0063.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u0042\u0072\u0061\u0069\u006E>();\u0069\u0066 (\u0062\u0072\u0061\u0069\u006E != \u006E\u0075\u006C\u006C){\u0062\u0072\u0061\u0069\u006E.\u0041\u0074\u0074\u0061\u0063\u006B\u0052\u0061\u006E\u0067\u0065\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0069\u0065\u0072 = \u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072;\u0062\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0052\u0061\u006E\u0067\u0065 = 100;\u0062\u0072\u0061\u0069\u006E.\u0043\u0068\u0065\u0063\u006B\u0056\u0069\u0073\u0069\u006F\u006E\u0043\u006F\u006E\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0061\u0069\u006E.\u0043\u0068\u0065\u0063\u006B\u004C\u004F\u0053 = \u0066\u0061\u006C\u0073\u0065;}\u0067\u006F.\u0053\u0065\u0074\u0041\u0063\u0074\u0069\u0076\u0065(\u0074\u0072\u0075\u0065);\u006E\u0070\u0063.\u0053\u0070\u0061\u0077\u006E();\u006E\u0070\u0063.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10, () =>{\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0074\u0072\u0075\u0065;}});\u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0053\u0074\u0072\u0069\u0070();\u006E\u0070\u0063.\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0048\u0065\u0061\u006C\u0074\u0068(\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068, \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068);\u006E\u0070\u0063.\u0061\u0069\u006D\u0043\u006F\u006E\u0065\u0053\u0063\u0061\u006C\u0065 *= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0041\u0069\u006D\u0053\u0063\u0061\u006C\u0065\u0072;\u006E\u0070\u0063.\u0064\u0061\u006D\u0061\u0067\u0065\u0053\u0063\u0061\u006C\u0065 *= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0044\u0061\u006D\u0061\u0067\u0065\u0053\u0063\u0061\u006C\u0065\u0072;\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072 \u0062\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072 = \u006E\u0070\u0063.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072>();\u0069\u0066 (\u0062\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072 != \u006E\u0075\u006C\u006C){\u0062\u0061\u0073\u0065\u004E\u0061\u0076\u0069\u0067\u0061\u0074\u006F\u0072.\u0043\u0061\u006E\u0055\u0073\u0065\u004E\u0061\u0076\u004D\u0065\u0073\u0068 = \u0066\u0061\u006C\u0073\u0065;}\u0073\u0077\u0069\u0074\u0063\u0068 (\u0054\u0079\u0070\u0065){\u0063\u0061\u0073\u0065 0:\u0069\u0066 (\u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074 >= 4){\u004E\u0050\u0043\u0053\u0069\u0074(\u006E\u0070\u0063, \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u006A\u0075\u006D\u0070\u0073\u0075\u0069\u0074.\u0073\u0075\u0069\u0074.\u0062\u006C\u0075\u0065", \u0074\u0072\u0075\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 1:\u0069\u0066 (\u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074==0 || \u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074==1){\u004E\u0050\u0043\u0053\u0069\u0074(\u006E\u0070\u0063, \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u006A\u0075\u006D\u0070\u0073\u0075\u0069\u0074.\u0073\u0075\u0069\u0074.\u0062\u006C\u0075\u0065", \u0074\u0072\u0075\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 2:\u004E\u0050\u0043\u0053\u0069\u0074(\u006E\u0070\u0063, \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u006A\u0075\u006D\u0070\u0073\u0075\u0069\u0074.\u0073\u0075\u0069\u0074", \u0074\u0072\u0075\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 3:\u0069\u0066 (\u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074==0 || \u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074==1 || \u006E\u0070\u0063\u0073.\u0043\u006F\u0075\u006E\u0074 >= 8){\u004E\u0050\u0043\u0053\u0069\u0074(\u006E\u0070\u0063, \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u006A\u0075\u006D\u0070\u0073\u0075\u0069\u0074.\u0073\u0075\u0069\u0074", \u0074\u0072\u0075\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 4:\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u0061\u0074\u0074\u0069\u0072\u0065.\u006E\u0069\u006E\u006A\u0061.\u0073\u0075\u0069\u0074", \u0066\u0061\u006C\u0073\u0065, \u0074\u0072\u0075\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 5:\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u0068\u0061\u007A\u006D\u0061\u0074\u0073\u0075\u0069\u0074_\u0073\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074_\u0061\u0072\u0063\u0074\u0069\u0063", \u0066\u0061\u006C\u0073\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 7:\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u0068\u0061\u007A\u006D\u0061\u0074\u0073\u0075\u0069\u0074.\u006E\u006F\u006D\u0061\u0064\u0073\u0075\u0069\u0074", \u0066\u0061\u006C\u0073\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 8:\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), () =>{\u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u006E\u0070\u0063, \u004B\u0069\u0074, "\u006A\u0075\u006D\u0070\u0073\u0075\u0069\u0074.\u0073\u0075\u0069\u0074", \u0074\u0072\u0075\u0065, \u0066\u0061\u006C\u0073\u0065);});\u0062\u0072\u0065\u0061\u006B;}\u004E\u0050\u0043\u0073.\u0041\u0064\u0064(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u006E\u0070\u0063\u0073.\u0041\u0064\u0064(\u006E\u0070\u0063);\u006E\u0070\u0063.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0070\u0063\u0073;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0072\u0065\u0073\u0073\u004E\u0050\u0043(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063, \u0073\u0074\u0072\u0069\u006E\u0067 \u004B\u0069\u0074, \u0073\u0074\u0072\u0069\u006E\u0067 \u006F\u0075\u0074\u0066\u0069\u0074, \u0062\u006F\u006F\u006C \u0068\u0065\u0061\u0064\u0073\u0065\u0074 = \u0066\u0061\u006C\u0073\u0065, \u0062\u006F\u006F\u006C \u0061\u0073\u0073\u0061\u0073\u0073\u0069\u006E = \u0066\u0061\u006C\u0073\u0065){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u004B\u0069\u0074 != "" && \u0070\u006C\u0075\u0067\u0069\u006E.\u004B\u0069\u0074\u0073 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0047\u0069\u0076\u0065\u004B\u0069\u0074(\u006E\u0070\u0063, \u004B\u0069\u0074);}\u0065\u006C\u0073\u0065{\u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u006E\u0070\u0063, \u006F\u0075\u0074\u0066\u0069\u0074);\u0069\u0066 (\u0068\u0065\u0061\u0064\u0073\u0065\u0074){\u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u006E\u0070\u0063, "\u0074\u0077\u0069\u0074\u0063\u0068.\u0068\u0065\u0061\u0064\u0073\u0065\u0074");}\u0069\u0066 (\u0061\u0073\u0073\u0061\u0073\u0073\u0069\u006E){\u0043\u0072\u0065\u0061\u0074\u0065\u0047\u0075\u006E(\u006E\u0070\u0063, "\u0072\u0069\u0066\u006C\u0065.\u006C\u0072300", "\u0077\u0065\u0061\u0070\u006F\u006E.\u006D\u006F\u0064.\u0073\u0069\u006C\u0065\u006E\u0063\u0065\u0072");}\u0065\u006C\u0073\u0065 {\u0043\u0072\u0065\u0061\u0074\u0065\u0047\u0075\u006E(\u006E\u0070\u0063, "\u0072\u0069\u0066\u006C\u0065.\u0073\u0065\u006D\u0069\u0061\u0075\u0074\u006F", "\u0077\u0065\u0061\u0070\u006F\u006E.\u006D\u006F\u0064.\u0066\u006C\u0061\u0073\u0068\u006C\u0069\u0067\u0068\u0074");}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0049\u0074\u0065\u006D(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063, \u0073\u0074\u0072\u0069\u006E\u0067 \u0049\u0074\u0065\u006D\u004E\u0061\u006D\u0065, \u0069\u006E\u0074 \u0041\u006D\u006F\u0075\u006E\u0074){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0049\u0074\u0065\u006D\u004E\u0061\u006D\u0065, \u0041\u006D\u006F\u0075\u006E\u0074, 0);\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u004D\u0061\u0069\u006E, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0043\u006C\u006F\u0074\u0068\u0073(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u006E\u0070\u0063, \u0073\u0074\u0072\u0069\u006E\u0067 \u0049\u0074\u0065\u006D\u004E\u0061\u006D\u0065, \u0075\u006C\u006F\u006E\u0067 \u0073\u006B\u0069\u006E = 0){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0049\u0074\u0065\u006D\u004E\u0061\u006D\u0065, 1, \u0073\u006B\u0069\u006E);\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0057\u0065\u0061\u0072, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0047\u0075\u006E(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063, \u0073\u0074\u0072\u0069\u006E\u0067 \u0049\u0074\u0065\u006D\u004E\u0061\u006D\u0065, \u0073\u0074\u0072\u0069\u006E\u0067 \u0041\u0074\u0074\u0061\u0063\u0068\u006D\u0065\u006E\u0074){\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0049\u0074\u0065\u006D\u004E\u0061\u006D\u0065, 1, 0);\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 = \u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (\u0062\u0065 != \u006E\u0075\u006C\u006C){\u0062\u0065.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0069\u0066 (\u0062\u0065 != \u006E\u0075\u006C\u006C){\u0062\u0065.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0074\u0072\u0075\u0065;}});}\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0077\u0065 = \u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0057\u006F\u0072\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (\u0077\u0065 != \u006E\u0075\u006C\u006C){\u0077\u0065.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0069\u0066 (\u0077\u0065 != \u006E\u0075\u006C\u006C){\u0077\u0065.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0074\u0072\u0075\u0065;}});}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u006E\u0070\u0063.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0042\u0065\u006C\u0074, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0062\u0065 != \u006E\u0075\u006C\u006C && \u0062\u0065 \u0069\u0073 \u0042\u0061\u0073\u0065\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065){\u0069\u0066 (\u0041\u0074\u0074\u0061\u0063\u0068\u006D\u0065\u006E\u0074 != ""){\u0049\u0074\u0065\u006D \u006D\u006F\u0064\u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065(\u0041\u0074\u0074\u0061\u0063\u0068\u006D\u0065\u006E\u0074, 1, 0);\u0069\u0066 (\u006D\u006F\u0064\u0069\u0074\u0065\u006D != \u006E\u0075\u006C\u006C && \u0069\u0074\u0065\u006D.\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0073 != \u006E\u0075\u006C\u006C){\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065\u006D\u0069 = \u006D\u006F\u0064\u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (\u0062\u0065\u006D\u0069 != \u006E\u0075\u006C\u006C){\u0062\u0065\u006D\u0069.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0069\u0066 (\u0062\u0065\u006D\u0069 != \u006E\u0075\u006C\u006C){\u0062\u0065\u006D\u0069.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0074\u0072\u0075\u0065;}});}\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0077\u0065\u006D\u0069 = \u006D\u006F\u0064\u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0057\u006F\u0072\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079();\u0069\u0066 (\u0077\u0065\u006D\u0069 != \u006E\u0075\u006C\u006C){\u0077\u0065\u006D\u0069.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0069\u0066 (\u0077\u0065\u006D\u0069 != \u006E\u0075\u006C\u006C){\u0077\u0065\u006D\u0069.\u0069\u0073\u0053\u0070\u0061\u0077\u006E\u0065\u0064 = \u0074\u0072\u0075\u0065;}});}\u0069\u0066 (!\u006D\u006F\u0064\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0069\u0074\u0065\u006D.\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0073)){\u0069\u0074\u0065\u006D.\u0063\u006F\u006E\u0074\u0065\u006E\u0074\u0073.\u0049\u006E\u0073\u0065\u0072\u0074(\u006D\u006F\u0064\u0069\u0074\u0065\u006D);}}}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(11f, () =>{\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && \u0069\u0074\u0065\u006D != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0055\u0070\u0064\u0061\u0074\u0065\u0041\u0063\u0074\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0069\u0074\u0065\u006D.\u0075\u0069\u0064);}});}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004E\u0050\u0043\u0053\u0069\u0074(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u006E\u0070\u0063.\u006D\u006F\u0064\u0065\u006C\u0053\u0074\u0061\u0074\u0065.\u006D\u006F\u0075\u006E\u0074\u0065\u0064 = \u0074\u0072\u0075\u0065;\u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u006E\u0070\u0063.\u0053\u0065\u0072\u0076\u0065\u0072\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u006E\u0070\u0063.\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065\u0056\u0069\u0065\u0077\u0041\u006E\u0067\u006C\u0065\u0073(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E.\u0065\u0075\u006C\u0065\u0072\u0041\u006E\u0067\u006C\u0065\u0073);\u006E\u0070\u0063.\u0065\u0079\u0065\u0073.\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004E\u0050\u0043\u0048\u0065\u0061\u006C(\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u004E\u0050\u0043){\u0069\u0066 (\u004E\u0050\u0043==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u004E\u0050\u0043._\u0068\u0065\u0061\u006C\u0074\u0068 < \u004E\u0050\u0043._\u006D\u0061\u0078\u0048\u0065\u0061\u006C\u0074\u0068 / 4 && !\u0049\u0073\u0048\u0065\u0061\u006C\u0069\u006E\u0067.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u004E\u0050\u0043.\u0075\u0073\u0065\u0072\u0049\u0044) && \u004E\u0050\u0043.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u0047\u0065\u0074\u004E\u0065\u0061\u0072\u0065\u0073\u0074\u0054\u0068\u0072\u0065\u0061\u0074(25f)==\u006E\u0075\u006C\u006C){\u0075\u006C\u006F\u006E\u0067 \u0069\u0064 = \u004E\u0050\u0043.\u0075\u0073\u0065\u0072\u0049\u0044;\u0049\u0074\u0065\u006D \u0047\u0075\u006E;\u0069\u0066 (\u004E\u0050\u0043.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079() \u0069\u0073 \u004D\u0065\u0064\u0069\u0063\u0061\u006C\u0054\u006F\u006F\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0074\u0072\u0079 {\u0047\u0075\u006E = \u004E\u0050\u0043.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079().\u0047\u0065\u0074\u0049\u0074\u0065\u006D();} \u0063\u0061\u0074\u0063\u0068 {\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0069\u0074\u0065\u006D \u0069\u006E \u004E\u0050\u0043.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072\u0042\u0065\u006C\u0074.\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074.\u0054\u006F\u004C\u0069\u0073\u0074()){\u0069\u0066 (\u0069\u0074\u0065\u006D.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079() \u0069\u0073 \u004D\u0065\u0064\u0069\u0063\u0061\u006C\u0054\u006F\u006F\u006C){\u004E\u0050\u0043.\u0055\u0070\u0064\u0061\u0074\u0065\u0041\u0063\u0074\u0069\u0076\u0065\u0049\u0074\u0065\u006D(\u0069\u0074\u0065\u006D.\u0075\u0069\u0064);\u004E\u0050\u0043.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0055\u0070\u0064\u0061\u0074\u0065\u0064\u0056\u0069\u0073\u0069\u0062\u006C\u0065\u0048\u006F\u006C\u0073\u0074\u0065\u0072\u0065\u0064\u0049\u0074\u0065\u006D\u0073();\u004D\u0065\u0064\u0069\u0063\u0061\u006C\u0054\u006F\u006F\u006C \u006D\u0065\u0064\u0073 = \u004E\u0050\u0043.\u0047\u0065\u0074\u0048\u0065\u006C\u0064\u0045\u006E\u0074\u0069\u0074\u0079() \u0061\u0073 \u004D\u0065\u0064\u0069\u0063\u0061\u006C\u0054\u006F\u006F\u006C;\u0069\u0066 (\u006D\u0065\u0064\u0073 != \u006E\u0075\u006C\u006C){\u0049\u0073\u0048\u0065\u0061\u006C\u0069\u006E\u0067.\u0041\u0064\u0064(\u0069\u0064);\u006D\u0065\u0064\u0073.\u0053\u0065\u0072\u0076\u0065\u0072\u0055\u0073\u0065();\u004E\u0050\u0043.\u006D\u006F\u0064\u0065\u006C\u0053\u0074\u0061\u0074\u0065.\u0064\u0075\u0063\u006B\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(3f, () =>{\u004E\u0050\u0043.\u006D\u006F\u0064\u0065\u006C\u0053\u0074\u0061\u0074\u0065.\u0064\u0075\u0063\u006B\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;});}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(4, () =>{\u0049\u0073\u0048\u0065\u0061\u006C\u0069\u006E\u0067.\u0052\u0065\u006D\u006F\u0076\u0065(\u0069\u0064);\u0053\u0077\u0069\u0074\u0063\u0068\u0047\u0075\u006E(\u004E\u0050\u0043, \u0047\u0075\u006E);});\u0062\u0072\u0065\u0061\u006B;}}\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0061\u0073\u0073\u0069\u0067\u006E\u0050\u004F\u0049(\u0056\u0065\u0063\u0074\u006F\u00723 \u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072){\u0069\u0066 (\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 > 5){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u0075\u006E\u0074==0){\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0041\u0064\u0064(\u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u004F\u0049\u0045\u0078\u0070\u0069\u0072\u0065\u0073, () =>{\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0052\u0065\u006D\u006F\u0076\u0065(\u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072);});}\u0065\u006C\u0073\u0065 \u0069\u0066 (!\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072)){\u0062\u006F\u006F\u006C \u0043\u006C\u006F\u0073\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0069 \u0069\u006E \u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0070\u006F\u0069, \u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072) < 800){\u0043\u006C\u006F\u0073\u0065 = \u0074\u0072\u0075\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (!\u0043\u006C\u006F\u0073\u0065){\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0041\u0064\u0064(\u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072);\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u004F\u0049\u0045\u0078\u0070\u0069\u0072\u0065\u0073, () =>{\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0052\u0065\u006D\u006F\u0076\u0065(\u0041\u0074\u0074\u0061\u0063\u006B\u0056\u0065\u0063\u0074\u006F\u0072);});}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0067\u0065\u0074\u0050\u004F\u0049(\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0072\u0069\u0067, \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0069\u0066 (\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 != 0){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0069 \u0069\u006E \u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0070\u006F\u0069, \u006F\u0072\u0069\u0067) < \u006D\u0061\u0078\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0072\u0065\u0074\u0075\u0072\u006E (\u0070\u006F\u0069);}} }\u0072\u0065\u0074\u0075\u0072\u006E \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0047\u0065\u0074\u0053\u0070\u0061\u0077\u006E\u0048\u0065\u0069\u0067\u0068\u0074(\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0061\u0072\u0067\u0065\u0074){\u0066\u006C\u006F\u0061\u0074 \u0079 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0074\u0061\u0072\u0067\u0065\u0074);\u0066\u006C\u006F\u0061\u0074 \u0077 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0074\u0061\u0072\u0067\u0065\u0074);\u0066\u006C\u006F\u0061\u0074 \u0070 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0069\u0067\u0068\u0065\u0073\u0074\u0050\u006F\u0069\u006E\u0074.\u0079 + 250f;\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0068\u0069\u0074;\u0069\u0066 (\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0052\u0061\u0079\u0063\u0061\u0073\u0074(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0074\u0061\u0072\u0067\u0065\u0074.\u0078, \u0077, \u0074\u0061\u0072\u0067\u0065\u0074.\u007A), \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006F\u0075\u0074 \u0068\u0069\u0074, \u0070, \u004C\u0061\u0079\u0065\u0072\u0073.\u004D\u0061\u0073\u006B.\u0057\u006F\u0072\u006C\u0064)){\u0079 = \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u0079, \u0068\u0069\u0074.\u0070\u006F\u0069\u006E\u0074.\u0079);\u0069\u0066 (\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0052\u0061\u0079\u0063\u0061\u0073\u0074(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0074\u0061\u0072\u0067\u0065\u0074.\u0078, \u0068\u0069\u0074.\u0070\u006F\u0069\u006E\u0074.\u0079 + 0.5f, \u0074\u0061\u0072\u0067\u0065\u0074.\u007A), \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006F\u0075\u0074 \u0068\u0069\u0074, \u0070, \u004C\u0061\u0079\u0065\u0072\u0073.\u004D\u0061\u0073\u006B.\u0057\u006F\u0072\u006C\u0064)){\u0079 = \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u0079, \u0068\u0069\u0074.\u0070\u006F\u0069\u006E\u0074.\u0079);}}\u0072\u0065\u0074\u0075\u0072\u006E \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u0079, \u0077);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0047\u0065\u0074\u0043\u0069\u0072\u0063\u0075\u006D\u0066\u0065\u0072\u0065\u006E\u0063\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073(\u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0065\u006E\u0074\u0065\u0072, \u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0064\u0069\u0075\u0073, \u0066\u006C\u006F\u0061\u0074 \u006E\u0065\u0078\u0074, \u0062\u006F\u006F\u006C \u0073\u0070\u0061\u0077\u006E\u0048\u0065\u0069\u0067\u0068\u0074, \u0066\u006C\u006F\u0061\u0074 \u0079 = 0f){\u0076\u0061\u0072 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0069\u0066 (\u006E\u0065\u0078\u0074 < 1f){\u006E\u0065\u0078\u0074 = 1f;}\u0066\u006C\u006F\u0061\u0074 \u0061\u006E\u0067\u006C\u0065 = 0f;\u0066\u006C\u006F\u0061\u0074 \u0061\u006E\u0067\u006C\u0065\u0049\u006E\u0052\u0061\u0064\u0069\u0061\u006E\u0073 = 2 * (\u0066\u006C\u006F\u0061\u0074)\u004D\u0061\u0074\u0068.\u0050\u0049;\u0077\u0068\u0069\u006C\u0065 (\u0061\u006E\u0067\u006C\u0065 < 360){\u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0064\u0069\u0061\u006E = (\u0061\u006E\u0067\u006C\u0065\u0049\u006E\u0052\u0061\u0064\u0069\u0061\u006E\u0073 / 360) * \u0061\u006E\u0067\u006C\u0065;\u0066\u006C\u006F\u0061\u0074 \u0078 = \u0063\u0065\u006E\u0074\u0065\u0072.\u0078 + \u0072\u0061\u0064\u0069\u0075\u0073 * (\u0066\u006C\u006F\u0061\u0074)\u004D\u0061\u0074\u0068.\u0043\u006F\u0073(\u0072\u0061\u0064\u0069\u0061\u006E);\u0066\u006C\u006F\u0061\u0074 \u007A = \u0063\u0065\u006E\u0074\u0065\u0072.\u007A + \u0072\u0061\u0064\u0069\u0075\u0073 * (\u0066\u006C\u006F\u0061\u0074)\u004D\u0061\u0074\u0068.\u0053\u0069\u006E(\u0072\u0061\u0064\u0069\u0061\u006E);\u0076\u0061\u0072 \u0061 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0078, 0f, \u007A);\u0061.\u0079 = \u0079==0f ? \u0073\u0070\u0061\u0077\u006E\u0048\u0065\u0069\u0067\u0068\u0074 ? \u0047\u0065\u0074\u0053\u0070\u0061\u0077\u006E\u0048\u0065\u0069\u0067\u0068\u0074(\u0061) : \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0061) : \u0079;\u0069\u0066 (\u0061.\u0079 < -48f){\u0061.\u0079 = -48f;}\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073.\u0041\u0064\u0064(\u0061);\u0061\u006E\u0067\u006C\u0065 += \u006E\u0065\u0078\u0074;}\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073.\u0052\u0065\u006D\u006F\u0076\u0065\u0041\u0074(0);\u0072\u0065\u0074\u0075\u0072\u006E \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E \u0047\u0065\u0074\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E(\u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0065\u006E\u0074\u0065\u0072){\u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0059 = -1000;\u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0059 = 1000;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E \u0069\u006E \u0047\u0065\u0074\u0043\u0069\u0072\u0063\u0075\u006D\u0066\u0065\u0072\u0065\u006E\u0063\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073(\u0063\u0065\u006E\u0074\u0065\u0072, 20f, 30f, \u0074\u0072\u0075\u0065)){\u0069\u0066 (\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 > \u006D\u0061\u0078\u0059) \u006D\u0061\u0078\u0059 = \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079;\u0069\u0066 (\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 < \u006D\u0069\u006E\u0059) \u006D\u0069\u006E\u0059 = \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079;}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0065\u0077 \u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E {\u004D\u0069\u006E = \u006D\u0069\u006E\u0059, \u004D\u0061\u0078 = \u006D\u0061\u0078\u0059 };}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0041\u0069\u0072\u0047\u0072\u0069\u0064(){\u0069\u006E\u0074 \u006D\u0069\u006E\u0050\u006F\u0073 = (\u0069\u006E\u0074)(\u0057\u006F\u0072\u006C\u0064.\u0053\u0069\u007A\u0065 / -2f);\u0069\u006E\u0074 \u006D\u0061\u0078\u0050\u006F\u0073 = (\u0069\u006E\u0074)(\u0057\u006F\u0072\u006C\u0064.\u0053\u0069\u007A\u0065 / 2f);\u0069\u006E\u0074 \u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0076\u0061\u0072 _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E = \u0043\u006F\u006E\u0056\u0061\u0072.\u0046\u0050\u0053.\u006C\u0069\u006D\u0069\u0074 > 80 ? \u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065\u0045\u0078.\u0077\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f) : \u006E\u0075\u006C\u006C;\u0066\u006F\u0072 (\u0066\u006C\u006F\u0061\u0074 \u0078 = \u006D\u0069\u006E\u0050\u006F\u0073;\u0078 < \u006D\u0061\u0078\u0050\u006F\u0073;\u0078 += 25f){\u0066\u006F\u0072 (\u0066\u006C\u006F\u0061\u0074 \u007A = \u006D\u0069\u006E\u0050\u006F\u0073;\u007A < \u006D\u0061\u0078\u0050\u006F\u0073;\u007A += 25f){\u0076\u0061\u0072 \u0070\u006F\u0073 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0078, 0f, \u007A);\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0073) < 0.5){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0070\u006F\u0073.\u0079 = \u0047\u0065\u0074\u0053\u0070\u0061\u0077\u006E\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0073) + 50f;\u0076\u0061\u0072 \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E = \u0047\u0065\u0074\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E(\u0070\u006F\u0073);\u0069\u0066 (\u0049\u0073\u0046\u006C\u0061\u0074\u0054\u0065\u0072\u0072\u0061\u0069\u006E(\u0070\u006F\u0073, \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E, 3)){\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073.\u0041\u0064\u0064(\u0070\u006F\u0073);}\u0069\u0066 (++\u0063\u0068\u0065\u0063\u006B\u0073 >= 50){\u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E;}}}\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0050\u0075\u0074\u0073("\u0043\u0072\u0065\u0061\u0074\u0065\u0064 " + \u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0041\u0069\u0072 \u004E\u006F\u0064\u0065\u0073.");}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u004C\u0061\u006E\u0064\u0047\u0072\u0069\u0064(){\u0069\u006E\u0074 \u006D\u0069\u006E\u0050\u006F\u0073 = (\u0069\u006E\u0074)(\u0057\u006F\u0072\u006C\u0064.\u0053\u0069\u007A\u0065 / -2f);\u0069\u006E\u0074 \u006D\u0061\u0078\u0050\u006F\u0073 = (\u0069\u006E\u0074)(\u0057\u006F\u0072\u006C\u0064.\u0053\u0069\u007A\u0065 / 2f);\u0076\u0061\u0072 \u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0076\u0061\u0072 _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E = \u0043\u006F\u006E\u0056\u0061\u0072.\u0046\u0050\u0053.\u006C\u0069\u006D\u0069\u0074 > 80 ? \u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065\u0045\u0078.\u0077\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f) : \u006E\u0075\u006C\u006C;\u0066\u006F\u0072 (\u0066\u006C\u006F\u0061\u0074 \u0078 = \u006D\u0069\u006E\u0050\u006F\u0073;\u0078 < \u006D\u0061\u0078\u0050\u006F\u0073;\u0078 += 50f){\u0066\u006F\u0072 (\u0066\u006C\u006F\u0061\u0074 \u007A = \u006D\u0069\u006E\u0050\u006F\u0073;\u007A < \u006D\u0061\u0078\u0050\u006F\u0073;\u007A += 50f){\u0069\u0066 (++\u0063\u0068\u0065\u0063\u006B\u0073 >= 50){\u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E;}\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0072\u0069\u0067\u0069\u006E\u0061\u006C = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0078, 0, \u007A);\u006F\u0072\u0069\u0067\u0069\u006E\u0061\u006C.\u0079 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006F\u0072\u0069\u0067\u0069\u006E\u0061\u006C);\u0076\u0061\u0072 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0046\u0069\u006E\u0064\u0050\u006F\u0069\u006E\u0074\u004F\u006E\u004E\u0061\u0076\u006D\u0065\u0073\u0068(\u006F\u0072\u0069\u0067\u0069\u006E\u0061\u006C);\u0069\u0066 (\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E != \u006E\u0075\u006C\u006C && \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E \u0069\u0073 \u0056\u0065\u0063\u0074\u006F\u00723 && (\u0056\u0065\u0063\u0074\u006F\u00723)\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E != \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F){\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074((\u0056\u0065\u0063\u0074\u006F\u00723)\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) > \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074((\u0056\u0065\u0063\u0074\u006F\u00723)\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E)){\u0067\u0072\u006F\u0075\u006E\u0064\u006E\u006F\u0064\u0065\u0073.\u0041\u0064\u0064((\u0056\u0065\u0063\u0074\u006F\u00723)\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);}}}}\u006C\u0061\u006E\u0064\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0050\u0075\u0074\u0073("\u0043\u0072\u0065\u0061\u0074\u0065\u0064 " + \u0067\u0072\u006F\u0075\u006E\u0064\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u004C\u0061\u006E\u0064 \u004E\u006F\u0064\u0065\u0073.");}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0052\u006F\u0061\u0064\u0047\u0072\u0069\u0064(){\u0076\u0061\u0072 \u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0076\u0061\u0072 _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E = \u0043\u006F\u006E\u0056\u0061\u0072.\u0046\u0050\u0053.\u006C\u0069\u006D\u0069\u0074 > 80 ? \u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065\u0045\u0078.\u0077\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f) : \u006E\u0075\u006C\u006C;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0050\u0061\u0074\u0068\u004C\u0069\u0073\u0074 \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065 \u0069\u006E \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u0052\u006F\u0061\u0064\u0073){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0076 \u0069\u006E \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065.\u0050\u0061\u0074\u0068.\u0050\u006F\u0069\u006E\u0074\u0073){\u0069\u0066 (++\u0063\u0068\u0065\u0063\u006B\u0073 >= 1000){\u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E;}\u0076\u0061\u0072 \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E = \u0047\u0065\u0074\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E(\u0076);\u0069\u0066 (\u0049\u0073\u0046\u006C\u0061\u0074\u0054\u0065\u0072\u0072\u0061\u0069\u006E(\u0076, \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E, 4)){\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u006E \u0069\u006E \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073){\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0076, \u006E) < 20){\u0066\u006C\u0061\u0067 = \u0074\u0072\u0075\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (!\u0066\u006C\u0061\u0067 && \u0053\u0070\u0061\u0077\u006E\u0043\u0068\u0065\u0063\u006B(\u0076, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0057\u0061\u006C\u006C\u0052\u0061\u0064\u0069\u0075\u0073 + 1, -1)){\u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073.\u0041\u0064\u0064(\u0076);}}}}\u0050\u0075\u0074\u0073("\u0043\u0072\u0065\u0061\u0074\u0065\u0064 " + \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0052\u006F\u0061\u0064 \u004E\u006F\u0064\u0065\u0073.");}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0053\u0065\u0061\u0047\u0072\u0069\u0064(){\u0066\u006C\u006F\u0061\u0074 \u0078 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0053\u0069\u007A\u0065.\u0078;\u0069\u006E\u0074 \u0053\u0065\u0063\u0074\u0069\u006F\u006E\u0073 = \u004D\u0061\u0074\u0068\u0066.\u0043\u0065\u0069\u006C\u0054\u006F\u0049\u006E\u0074(\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0053\u0069\u007A\u0065.\u0078 * 2f * 3.14159274f / 50);\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0076\u0061\u0072 \u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0076\u0061\u0072 _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E = \u0043\u006F\u006E\u0056\u0061\u0072.\u0046\u0050\u0053.\u006C\u0069\u006D\u0069\u0074 > 80 ? \u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065\u0045\u0078.\u0077\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f) : \u006E\u0075\u006C\u006C;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < \u0053\u0065\u0063\u0074\u0069\u006F\u006E\u0073;\u0069++){\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D5 = (\u0066\u006C\u006F\u0061\u0074)\u0069 / (\u0066\u006C\u006F\u0061\u0074)\u0053\u0065\u0063\u0074\u0069\u006F\u006E\u0073 * 360f;\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u004D\u0061\u0074\u0068\u0066.\u0053\u0069\u006E(\u006E\u0075\u006D5 * 0.0174532924f) * \u0078, 0, \u004D\u0061\u0074\u0068\u0066.\u0043\u006F\u0073(\u006E\u0075\u006D5 * 0.0174532924f) * \u0078));}\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u0067 = \u0074\u0072\u0075\u0065;\u0069\u006E\u0074 \u006E\u0075\u006D8 = 1;\u0056\u0065\u0063\u0074\u006F\u00723[] \u0061\u0072\u0072\u0061\u0079 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723[]{\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, 0f),\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(30, 0f, 0f),\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-30, 0f, 0f),\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, 30),\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, -30)};\u0077\u0068\u0069\u006C\u0065 (\u0066\u006C\u0061\u0067){\u006E\u0075\u006D8++;\u0066\u006C\u0061\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u006A = 0;\u006A < \u0053\u0065\u0063\u0074\u0069\u006F\u006E\u0073;\u006A++){\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u006A];\u0069\u006E\u0074 \u0069\u006E\u0064\u0065\u0078 = (\u006A==0) ? (\u0053\u0065\u0063\u0074\u0069\u006F\u006E\u0073 - 1) : (\u006A - 1);\u0069\u006E\u0074 \u0069\u006E\u0064\u0065\u00782 = (\u006A==\u0053\u0065\u0063\u0074\u0069\u006F\u006E\u0073 - 1) ? 0 : (\u006A + 1);\u0056\u0065\u0063\u0074\u006F\u00723 \u0062 = \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u0069\u006E\u0064\u0065\u00782];\u0056\u0065\u0063\u0074\u006F\u00723 \u00622 = \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u0069\u006E\u0064\u0065\u0078];\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 = (\u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F - \u0076\u0065\u0063\u0074\u006F\u0072).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u00723 = \u0076\u0065\u0063\u0074\u006F\u0072 + \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 * 2;\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0076\u0065\u0063\u0074\u006F\u00723, \u0062) <= 100 && \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0076\u0065\u0063\u0074\u006F\u00723, \u00622) <= 100){\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u00672 = \u0074\u0072\u0075\u0065;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u006B = 0;\u006B < \u0061\u0072\u0072\u0061\u0079.\u004C\u0065\u006E\u0067\u0074\u0068;\u006B++){\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u00724 = \u0076\u0065\u0063\u0074\u006F\u00723 + \u0061\u0072\u0072\u0061\u0079[\u006B];\u0069\u0066 (\u0047\u0065\u0074\u0057\u0061\u0074\u0065\u0072\u0044\u0065\u0070\u0074\u0068(\u0076\u0065\u0063\u0074\u006F\u00724) < 5){\u0066\u006C\u0061\u00672 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (\u0066\u006C\u0061\u00672){\u0066\u006C\u0061\u0067 = \u0074\u0072\u0075\u0065;\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u006A] = \u0076\u0065\u0063\u0074\u006F\u00723;}}\u0069\u0066 (++\u0063\u0068\u0065\u0063\u006B\u0073 >= 1000){\u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E;}}}\u0076\u0061\u0072 \u006C\u0069\u0073\u0074 = \u0046\u0061\u0063\u0065\u0070\u0075\u006E\u0063\u0068.\u0050\u006F\u006F\u006C.\u0047\u0065\u0074\u004C\u0069\u0073\u0074<\u0069\u006E\u0074>();\u004C\u0069\u006E\u0065\u0055\u0074\u0069\u006C\u0069\u0074\u0079.\u0053\u0069\u006D\u0070\u006C\u0069\u0066\u0079(\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073, 10f, \u006C\u0069\u0073\u0074);\u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u006C\u0069\u0073\u00742 = \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073;\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0069\u006E\u0074 \u0069\u006E\u0064\u0065\u00783 \u0069\u006E \u006C\u0069\u0073\u0074){\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0041\u0064\u0064(\u006C\u0069\u0073\u00742[\u0069\u006E\u0064\u0065\u00783]);}\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0050\u0075\u0074\u0073("\u0043\u0072\u0065\u0061\u0074\u0065\u0064 " + \u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0053\u0065\u0061 \u004E\u006F\u0064\u0065\u0073.");\u0046\u0061\u0063\u0065\u0070\u0075\u006E\u0063\u0068.\u0050\u006F\u006F\u006C.\u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074(\u0072\u0065\u0066 \u006C\u0069\u0073\u0074);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0052\u0061\u0069\u006C\u0047\u0072\u0069\u0064(){\u0076\u0061\u0072 \u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0076\u0061\u0072 _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E = \u0043\u006F\u006E\u0056\u0061\u0072.\u0046\u0050\u0053.\u006C\u0069\u006D\u0069\u0074 > 80 ? \u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065\u0045\u0078.\u0077\u0061\u0069\u0074\u0046\u006F\u0072\u0053\u0065\u0063\u006F\u006E\u0064\u0073(0.01f) : \u006E\u0075\u006C\u006C;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0050\u0061\u0074\u0068\u004C\u0069\u0073\u0074 \u0070\u0061\u0074\u0068\u004C\u0069\u0073\u0074 \u0069\u006E \u0057\u006F\u0072\u006C\u0064.\u0047\u0065\u0074\u0050\u0061\u0074\u0068\u0073("\u0052\u0061\u0069\u006C").\u0041\u0073\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0062\u006C\u0065<\u0050\u0061\u0074\u0068\u004C\u0069\u0073\u0074>().\u0052\u0065\u0076\u0065\u0072\u0073\u0065<\u0050\u0061\u0074\u0068\u004C\u0069\u0073\u0074>()){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0076 \u0069\u006E \u0070\u0061\u0074\u0068\u004C\u0069\u0073\u0074.\u0050\u0061\u0074\u0068.\u0050\u006F\u0069\u006E\u0074\u0073){\u0069\u0066 (++\u0063\u0068\u0065\u0063\u006B\u0073 >= 1000){\u0063\u0068\u0065\u0063\u006B\u0073 = 0;\u0079\u0069\u0065\u006C\u0064 \u0072\u0065\u0074\u0075\u0072\u006E _\u0069\u006E\u0073\u0074\u0072\u0075\u0063\u0074\u0069\u006F\u006E;}\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073.\u0041\u0064\u0064(\u0076);}}\u0050\u0075\u0074\u0073("\u0043\u0072\u0065\u0061\u0074\u0065\u0064 " + \u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0052\u0061\u0069\u006C \u004E\u006F\u0064\u0065\u0073.");}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u006F\u0062\u006A\u0065\u0063\u0074 \u0046\u0069\u006E\u0064\u0050\u006F\u0069\u006E\u0074\u004F\u006E\u004E\u0061\u0076\u006D\u0065\u0073\u0068(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073){\u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0048\u0069\u0074 \u006E\u0061\u0076\u006D\u0065\u0073\u0068\u0048\u0069\u0074;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < 10;\u0069++){\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0069==0 ? \u0070\u006F\u0073 : \u0070\u006F\u0073 + (\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u006F\u006E\u0055\u006E\u0069\u0074\u0053\u0070\u0068\u0065\u0072\u0065 * 30);\u0069\u0066 (\u004E\u0061\u0076\u004D\u0065\u0073\u0068.\u0053\u0061\u006D\u0070\u006C\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006F\u0075\u0074 \u006E\u0061\u0076\u006D\u0065\u0073\u0068\u0048\u0069\u0074, 30, 1)){\u0069\u0066 (\u006E\u0061\u0076\u006D\u0065\u0073\u0068\u0048\u0069\u0074.\u006D\u0061\u0073\u006B != 1)\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;\u0069\u0066 (!(\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u004F\u0076\u0065\u0072\u006C\u0061\u0070\u0053\u0070\u0068\u0065\u0072\u0065(\u006E\u0061\u0076\u006D\u0065\u0073\u0068\u0048\u0069\u0074.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 15f, 65536).\u004C\u0065\u006E\u0067\u0074\u0068==0))\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0061\u0076\u006D\u0065\u0073\u0068\u0048\u0069\u0074.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;}}\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0046\u0069\u006E\u0064\u004E\u0061\u0076\u0050\u006F\u0069\u006E\u0074\u0073(\u0056\u0065\u0063\u0074\u006F\u00723 \u0073\u0063\u0061\u006E\u0070\u006F\u0069\u006E\u0074, \u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0064\u0069\u0075\u0073){\u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u006D\u0065\u0073\u0068 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u006D\u0065\u0073\u0068.\u0041\u0064\u0064(\u0073\u0063\u0061\u006E\u0070\u006F\u0069\u006E\u0074);\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < 25;\u0069++){\u0066\u006C\u006F\u0061\u0074 \u0064 = \u0072\u0061\u0064\u0069\u0075\u0073;\u0056\u0065\u0063\u0074\u006F\u00722 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0069\u006E\u0073\u0069\u0064\u0065\u0055\u006E\u0069\u0074\u0043\u0069\u0072\u0063\u006C\u0065 * \u0064;\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0069\u006E\u0074 = \u0073\u0063\u0061\u006E\u0070\u006F\u0069\u006E\u0074 + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, 0, \u0076\u0065\u0063\u0074\u006F\u0072.\u0079);\u0070\u006F\u0069\u006E\u0074.\u0079 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0070\u006F\u0069\u006E\u0074);\u0069\u0066 (\u0070\u006F\u0069\u006E\u0074.\u0079 < 0){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074;\u0062\u006F\u006F\u006C \u0061\u0064\u0064 = \u0074\u0072\u0075\u0065;\u0069\u0066 (\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0052\u0061\u0079\u0063\u0061\u0073\u0074(\u0070\u006F\u0069\u006E\u0074, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 10, 1218511105)){\u0061\u0064\u0064 = \u0066\u0061\u006C\u0073\u0065;}\u0069\u0066 (\u0061\u0064\u0064){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0068\u0065\u0063\u006B \u0069\u006E \u006D\u0065\u0073\u0068){\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0070\u006F\u0069\u006E\u0074, \u0063\u0068\u0065\u0063\u006B) < 8){\u0061\u0064\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u004F\u0076\u0065\u0072\u006C\u0061\u0070\u0053\u0070\u0068\u0065\u0072\u0065(\u0070\u006F\u0069\u006E\u0074, 5f, 65536).\u004C\u0065\u006E\u0067\u0074\u0068 != 0){\u0061\u0064\u0064 = \u0066\u0061\u006C\u0073\u0065;}}\u0069\u0066 (\u0061\u0064\u0064){\u006D\u0065\u0073\u0068.\u0041\u0064\u0064(\u0070\u006F\u0069\u006E\u0074);}}\u0072\u0065\u0074\u0075\u0072\u006E \u006D\u0065\u0073\u0068;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0050\u0061\u0074\u0068(){\u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0070\u0061\u0074\u0068 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068 != \u006E\u0075\u006C\u006C && \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0073 != \u006E\u0075\u006C\u006C && \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0073.\u0043\u006F\u0075\u006E\u0074 > 0){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0049\u006E\u0066\u006F \u006D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0049\u006E\u0066\u006F \u0069\u006E \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u004D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0073){\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073 = \u006D\u006F\u006E\u0075\u006D\u0065\u006E\u0074\u0049\u006E\u0066\u006F.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0070\u006F\u0073.\u0079 += 50;\u0070\u0061\u0074\u0068.\u0041\u0064\u0064(\u0070\u006F\u0073);}}\u0065\u006C\u0073\u0065 {\u0070\u0061\u0074\u0068.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 50, 0));}\u0069\u0066 (\u0070\u0061\u0074\u0068.\u0043\u006F\u0075\u006E\u0074==0){\u0070\u0061\u0074\u0068.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0));}\u0050\u0075\u0074\u0073("\u004C\u006F\u0061\u0064\u0065\u0064 " + \u0070\u0061\u0074\u0068.\u0043\u006F\u0075\u006E\u0074.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067() + " \u0041\u0069\u0072 \u004E\u006F\u0064\u0065\u0073.");\u0072\u0065\u0074\u0075\u0072\u006E \u0070\u0061\u0074\u0068;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0049\u0073\u0046\u006C\u0061\u0074\u0054\u0065\u0072\u0072\u0061\u0069\u006E(\u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0065\u006E\u0074\u0065\u0072, \u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E, \u0066\u006C\u006F\u0061\u0074 \u0076\u0061\u006C\u0075\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E.\u004D\u0061\u0078 - \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E.\u004D\u0069\u006E <= \u0076\u0061\u006C\u0075\u0065 && \u0065\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E.\u004D\u0061\u0078 - \u0063\u0065\u006E\u0074\u0065\u0072.\u0079 <= \u0076\u0061\u006C\u0075\u0065;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0075\u0070\u004F\u0063\u0065\u0061\u006E\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068(){\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0053\u0065\u0061\u0047\u0072\u0069\u0064()));}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0075\u0070\u0041\u0069\u0072\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068(){\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u0041\u0069\u0072\u0047\u0072\u0069\u0064()));}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0075\u0070\u004C\u0061\u006E\u0064\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068(){\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0065\u004C\u0061\u006E\u0064\u0047\u0072\u0069\u0064()));}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0075\u0070\u0052\u0061\u0069\u006C\u0050\u0061\u0074\u0072\u006F\u006C\u0050\u0061\u0074\u0068(){\u0054\u0068\u0072\u0065\u0061\u0064\u0073.\u0041\u0064\u0064(\u0053\u0065\u0072\u0076\u0065\u0072\u004D\u0067\u0072.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0053\u0074\u0061\u0072\u0074\u0043\u006F\u0072\u006F\u0075\u0074\u0069\u006E\u0065(\u0047\u0065\u006E\u0065\u0072\u0061\u0074\u0052\u0061\u0069\u006C\u0047\u0072\u0069\u0064()));}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0047\u0065\u0074\u0057\u0061\u0074\u0065\u0072\u0044\u0065\u0070\u0074\u0068(\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073){\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074;\u0069\u0066 (!\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0052\u0061\u0079\u0063\u0061\u0073\u0074(\u0070\u006F\u0073, \u0056\u0065\u0063\u0074\u006F\u00723.\u0064\u006F\u0077\u006E, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 100f, 8388608)){\u0072\u0065\u0074\u0075\u0072\u006E 100f;}\u0072\u0065\u0074\u0075\u0072\u006E \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074.\u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0052\u0075\u006E\u0045\u0066\u0066\u0065\u0063\u0074(\u0073\u0074\u0072\u0069\u006E\u0067 \u006E\u0061\u006D\u0065, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074\u0069\u0074\u0079 = \u006E\u0075\u006C\u006C, \u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(), \u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0066\u0066\u0073\u0065\u0074 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723()){\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079 != \u006E\u0075\u006C\u006C){\u0045\u0066\u0066\u0065\u0063\u0074.\u0073\u0065\u0072\u0076\u0065\u0072.\u0052\u0075\u006E(\u006E\u0061\u006D\u0065, \u0065\u006E\u0074\u0069\u0074\u0079, 0, \u006F\u0066\u0066\u0073\u0065\u0074, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006E\u0075\u006C\u006C, \u0074\u0072\u0075\u0065);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0045\u0066\u0066\u0065\u0063\u0074.\u0073\u0065\u0072\u0076\u0065\u0072.\u0052\u0075\u006E(\u006E\u0061\u006D\u0065, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006E\u0075\u006C\u006C, \u0074\u0072\u0075\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0046\u0069\u0072\u0065(\u0066\u006C\u006F\u0061\u0074 \u006C\u0069\u0066\u0065\u0074\u0069\u006D\u0065, \u0056\u0065\u0063\u0074\u006F\u00723 \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074, \u0066\u006C\u006F\u0061\u0074 \u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079, \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0070\u0061\u0072\u0061\u006E\u0074){\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079, () =>{\u0069\u0066 (\u0070\u0061\u0072\u0061\u006E\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0046\u0069\u0072\u0065\u0042\u0061\u006C\u006C \u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0062\u0075\u006E\u0064\u006C\u0065\u0064/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006F\u0069\u006C\u0066\u0069\u0072\u0065\u0062\u0061\u006C\u006C\u0073\u006D\u0061\u006C\u006C.\u0070\u0072\u0065\u0066\u0061\u0062", \u0070\u0061\u0072\u0061\u006E\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) \u0061\u0073 \u0046\u0069\u0072\u0065\u0042\u0061\u006C\u006C;\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0053\u0070\u0061\u0077\u006E();\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0070\u0061\u0072\u0061\u006E\u0074, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074;\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079 \u0072\u0062 = \u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079>();\u0072\u0062.\u0069\u0073\u004B\u0069\u006E\u0065\u006D\u0061\u0074\u0069\u0063 = \u0074\u0072\u0075\u0065;\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065(\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0045\u0078\u0074\u0069\u006E\u0067\u0075\u0069\u0073\u0068);\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0049\u006E\u0076\u006F\u006B\u0065(\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0045\u0078\u0074\u0069\u006E\u0067\u0075\u0069\u0073\u0068, \u006C\u0069\u0066\u0065\u0074\u0069\u006D\u0065);});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074\u0073(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079){\u0069\u0066 (\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C || \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044);\u0069\u0066 (\u0050\u0069\u0072\u0061\u0074\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044)){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 \u0069\u006E \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0063\u0068\u0069\u006C\u0064\u0072\u0065\u006E.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (\u0062\u0065==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;} \u0069\u0066 (\u0062\u0065 \u0069\u0073 \u0053\u0070\u0068\u0065\u0072\u0065\u0045\u006E\u0074\u0069\u0074\u0079 || \u0062\u0065 \u0069\u0073 \u004D\u0061\u0070\u004D\u0061\u0072\u006B\u0065\u0072\u0047\u0065\u006E\u0065\u0072\u0069\u0063\u0052\u0061\u0064\u0069\u0075\u0073 || \u0062\u0065 \u0069\u0073 \u0053\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 || \u0062\u0065 \u0069\u0073 \u0046\u0069\u0072\u0065\u0042\u0061\u006C\u006C || \u0062\u0065 \u0069\u0073 \u0048\u006F\u0072\u0073\u0065\u0043\u006F\u0072\u0070\u0073\u0065 || \u0062\u0065.\u0053\u0068\u006F\u0072\u0074\u0050\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0070\u0061\u0072\u0061\u0063\u0068\u0075\u0074\u0065")){\u0062\u0065.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u006E\u0075\u006C\u006C, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);\u0062\u0065.\u004B\u0069\u006C\u006C();}}\u0073\u0077\u0069\u0074\u0063\u0068 (\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u0068\u006F\u0072\u0074\u0050\u0072\u0065\u0066\u0061\u0062\u004E\u0061\u006D\u0065){\u0063\u0061\u0073\u0065 "\u0073\u0063\u0072\u0061\u0070\u0074\u0072\u0061\u006E\u0073\u0070\u006F\u0072\u0074\u0068\u0065\u006C\u0069\u0063\u006F\u0070\u0074\u0065\u0072":\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0063\u0072\u0061\u0070--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u006D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072.\u0065\u006E\u0074\u0069\u0074\u0079":\u0070\u0069\u0072\u0061\u0074\u0065\u0073\u004D\u0069\u006E\u0069--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u0072\u0068\u0069\u0062":\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0048\u0049\u0042--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u0072\u006F\u0077\u0062\u006F\u0061\u0074":\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u006F\u0077\u0042\u006F\u0061\u0074--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u0074\u0065\u0073\u0074\u0072\u0069\u0064\u0061\u0062\u006C\u0065\u0068\u006F\u0072\u0073\u0065":\u0070\u0069\u0072\u0061\u0074\u0065\u0048\u006F\u0072\u0073\u0065--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u0073\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065":\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u0073\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0064\u0075\u006F.\u0065\u006E\u0074\u0069\u0074\u0079":\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0075\u0062--;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 "\u0074\u0072\u0061\u0069\u006E\u0065\u006E\u0067\u0069\u006E\u0065\u0074\u0065\u006D\u0070.\u0065\u006E\u0074\u0069\u0074\u0079":\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C--;\u0062\u0072\u0065\u0061\u006B;}\u0050\u0069\u0072\u0061\u0074\u0065.\u0052\u0065\u006D\u006F\u0076\u0065(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044);}\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044);\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0050\u0069\u0072\u0061\u0074\u0065\u0053\u0070\u0061\u0077\u006E\u0065\u0072(){\u0069\u0066 (\u0052\u0075\u0073\u0074.\u0041\u0070\u0070\u006C\u0069\u0063\u0061\u0074\u0069\u006F\u006E.\u0069\u0073\u004C\u006F\u0061\u0064\u0069\u006E\u0067 || !\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 || !\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064 || !\u006C\u0061\u006E\u0064\u006E\u006F\u0064\u0065\u0073\u006C\u006F\u0061\u0064\u0065\u0064){\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0050\u0069\u0072\u0061\u0074\u0065\u0053\u0070\u0061\u0077\u006E\u0065\u0072();});\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0048\u0049\u0042 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u0048\u0049\u0042++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D());}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u006F\u0077\u0042\u006F\u0061\u0074 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0052\u006F\u0077\u0042\u006F\u0061\u0074++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D(), 1);}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0073\u004D\u0069\u006E\u0069 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0073\u004D\u0069\u006E\u0069++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D(), 2);}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0063\u0072\u0061\u0070 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0063\u0072\u0061\u0070++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D(), 3);}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0048\u006F\u0072\u0073\u0065 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0048\u006F\u0072\u0073\u0065++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0067\u0072\u006F\u0075\u006E\u0064\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D(), 4);}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0067\u0072\u006F\u0075\u006E\u0064\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D(), 5);}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0075\u0062 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004D\u0061\u0078){\u0062\u0072\u0065\u0061\u006B;}\u0070\u0069\u0072\u0061\u0074\u0065\u0053\u0075\u0062++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D(), 6);}\u0069\u0066 (\u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074 > 5){\u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0042\u0061\u0073\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0073 = 0;\u0073 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0041\u006D\u006F\u0075\u006E\u0074;\u0073++){\u0069\u0066 (\u0070\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065 >= _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0041\u006D\u006F\u0075\u006E\u0074){\u0062\u0072\u0065\u0061\u006B;}\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < 100;\u0069++){\u0056\u0065\u0063\u0074\u006F\u00723 \u0053\u0070\u0061\u0077\u006E\u0050\u006F\u0073 = \u0072\u006F\u0061\u0064\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D();\u0062\u006F\u006F\u006C \u0076\u0061\u006C\u0069\u0064 = \u0074\u0072\u0075\u0065;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0056\u0065\u0063\u0074\u006F\u00723 \u0062 \u0069\u006E \u0042\u0061\u0073\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073){\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0053\u0070\u0061\u0077\u006E\u0050\u006F\u0073, \u0062) < 200){\u0076\u0061\u006C\u0069\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0069\u0066 (\u0076\u0061\u006C\u0069\u0064 && \u0053\u0070\u0061\u0077\u006E\u0043\u0068\u0065\u0063\u006B(\u0053\u0070\u0061\u0077\u006E\u0050\u006F\u0073, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0057\u0061\u006C\u006C\u0052\u0061\u0064\u0069\u0075\u0073 + 2, -1)){\u0070\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065++;\u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0053\u0070\u0061\u0077\u006E\u0050\u006F\u0073, 7);\u0042\u0061\u0073\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0073.\u0041\u0064\u0064(\u0053\u0070\u0061\u0077\u006E\u0050\u006F\u0073);\u0062\u0072\u0065\u0061\u006B;}}}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074){\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u004F\u0062\u006A\u0065\u0063\u0074.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065(\u0065\u006E\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004F\u006E\u0047\u0072\u006F\u0075\u006E\u0064\u004D\u0069\u0073\u0073\u0069\u006E\u0067>());\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u004F\u0062\u006A\u0065\u0063\u0074.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065(\u0065\u006E\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0047\u0072\u006F\u0075\u006E\u0064\u0057\u0061\u0074\u0063\u0068>());}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u006D\u0065\u0073\u0068 \u0069\u006E \u0065\u006E\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074\u0073\u0049\u006E\u0043\u0068\u0069\u006C\u0064\u0072\u0065\u006E<\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072>()){\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u004F\u0062\u006A\u0065\u0063\u0074.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065(\u006D\u0065\u0073\u0068);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0073\u0065\u0074\u0075\u0070(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079, \u0069\u006E\u0074 \u0054\u0079\u0070\u0065 = 0){\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0079\u006E\u0063\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0074\u0072\u0075\u0065;\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0067\u006C\u006F\u0062\u0061\u006C\u0042\u0072\u006F\u0061\u0064\u0063\u0061\u0073\u0074 = \u0074\u0072\u0075\u0065;\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0053\u0070\u0061\u0077\u006E();\u0069\u0066 (\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0069\u0073 \u0052\u0069\u0064\u0061\u0062\u006C\u0065\u0048\u006F\u0072\u0073\u0065){\u0052\u0069\u0064\u0061\u0062\u006C\u0065\u0048\u006F\u0072\u0073\u0065 \u0068\u006F\u0072\u0073\u0065 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0061\u0073 \u0052\u0069\u0064\u0061\u0062\u006C\u0065\u0048\u006F\u0072\u0073\u0065;\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065("\u0068\u006F\u0072\u0073\u0065.\u0061\u0072\u006D\u006F\u0072.\u0077\u006F\u006F\u0064", 1, 0);\u0069\u0066 (\u0069\u0074\u0065\u006D != \u006E\u0075\u006C\u006C){\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(\u0068\u006F\u0072\u0073\u0065.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();}\u0049\u0074\u0065\u006D\u004D\u006F\u0064\u0041\u006E\u0069\u006D\u0061\u006C\u0045\u0071\u0075\u0069\u0070\u006D\u0065\u006E\u0074 \u0073\u0074\u006F\u0072\u0061\u0067\u0065 = \u0068\u006F\u0072\u0073\u0065.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0069\u0074\u0065\u006D\u004C\u0069\u0073\u0074[0].\u0069\u006E\u0066\u006F.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0049\u0074\u0065\u006D\u004D\u006F\u0064\u0041\u006E\u0069\u006D\u0061\u006C\u0045\u0071\u0075\u0069\u0070\u006D\u0065\u006E\u0074>();\u0069\u0066 (\u0073\u0074\u006F\u0072\u0061\u0067\u0065){\u0073\u0074\u006F\u0072\u0061\u0067\u0065.\u0061\u0064\u0064\u0069\u0074\u0069\u006F\u006E\u0061\u006C\u0049\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079\u0053\u006C\u006F\u0074\u0073 = 30;}\u0068\u006F\u0072\u0073\u0065.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}}\u0072\u0065\u0074\u0075\u0072\u006E \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0064\u0067\u0065\u0044\u0065\u006C\u0065\u0074\u0065(\u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u006E\u0070\u0063\u007A){\u0069\u0066 (\u006E\u0070\u0063\u007A==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u007A){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0049\u006E\u0076\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u0068\u0065\u0063\u006B(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079){\u0069\u0066 (\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0056\u0061\u006C\u0069\u0064\u0042\u006F\u0075\u006E\u0064\u0073.\u0054\u0065\u0073\u0074(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * 200f)){\u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074\u0073(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 \u0061\u0070 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>();\u0069\u0066 (\u0061\u0070 != \u006E\u0075\u006C\u006C){\u0045\u0064\u0067\u0065\u0044\u0065\u006C\u0065\u0074\u0065(\u0061\u0070.\u006E\u0070\u0063\u0073);\u0069\u0066 (\u0061\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C && !\u0061\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0061\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u004B\u0069\u006C\u006C();}\u0069\u0066 (\u0061\u0070._\u0068\u0065\u006C\u0069 != \u006E\u0075\u006C\u006C && !\u0061\u0070._\u0068\u0065\u006C\u0069.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0061\u0070._\u0068\u0065\u006C\u0069.\u004B\u0069\u006C\u006C();}}\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 \u0077\u0070 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u0077\u0070 != \u006E\u0075\u006C\u006C){\u0045\u0064\u0067\u0065\u0044\u0065\u006C\u0065\u0074\u0065(\u0077\u0070.\u006E\u0070\u0063\u0073);\u0069\u0066 (\u0077\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C && !\u0077\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0077\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u004B\u0069\u006C\u006C();}\u0069\u0066 (\u0077\u0070._\u0062\u006F\u0061\u0074 != \u006E\u0075\u006C\u006C && !\u0077\u0070._\u0062\u006F\u0061\u0074.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0077\u0070._\u0062\u006F\u0061\u0074.\u004B\u0069\u006C\u006C();}}\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065 \u006C\u0070 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065>();\u0069\u0066 (\u006C\u0070 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u006C\u0070.\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006C\u0070.\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u006C\u0070.\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}\u0069\u0066 (\u006C\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u006C\u0070.\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u004B\u0069\u006C\u006C();}\u0069\u0066 (\u0077\u0070._\u0062\u006F\u0061\u0074 != \u006E\u0075\u006C\u006C && !\u0077\u0070._\u0062\u006F\u0061\u0074.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0077\u0070._\u0062\u006F\u0061\u0074.\u004B\u0069\u006C\u006C();}}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0075\u0069\u006E\u0074 \u0069\u0064 \u0069\u006E \u004E\u0050\u0043\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (!\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073.\u0065\u006E\u0074\u0069\u0074\u0079\u004C\u0069\u0073\u0074.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0069\u0064)){\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u0069\u0064);}}\u0072\u0065\u0074\u0075\u0072\u006E;}\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(1f, () =>{\u0049\u006E\u0076\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u0068\u0065\u0063\u006B(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0053\u0070\u0061\u0077\u006E\u0050\u0069\u0072\u0061\u0074\u0065\u0073(\u0056\u0065\u0063\u0074\u006F\u00723 \u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0069\u006E\u0074 \u0054\u0079\u0070\u0065 = 0){\u0073\u0074\u0072\u0069\u006E\u0067 \u0070\u0072\u0065\u0066\u0061\u0062 = "";\u0066\u006C\u006F\u0061\u0074 \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074;\u0066\u006C\u006F\u0061\u0074 \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0066\u006C\u006F\u0061\u0074 \u0077\u0061\u0074\u0065\u0072\u0068\u0065\u0069\u0067\u0068\u0074 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (\u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 > \u0077\u0061\u0074\u0065\u0072\u0068\u0065\u0069\u0067\u0068\u0074){\u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 = \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074;}\u0065\u006C\u0073\u0065 {\u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 = \u0077\u0061\u0074\u0065\u0072\u0068\u0065\u0069\u0067\u0068\u0074;}\u0073\u0077\u0069\u0074\u0063\u0068 (\u0054\u0079\u0070\u0065){\u0063\u0061\u0073\u0065 0:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0062\u006F\u0061\u0074\u0073/\u0072\u0068\u0069\u0062/\u0072\u0068\u0069\u0062.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 1:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0062\u006F\u0061\u0074\u0073/\u0072\u006F\u0077\u0062\u006F\u0061\u0074/\u0072\u006F\u0077\u0062\u006F\u0061\u0074.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 2:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u006D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072/\u006D\u0069\u006E\u0069\u0063\u006F\u0070\u0074\u0065\u0072.\u0065\u006E\u0074\u0069\u0074\u0079.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 + 30;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 3:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0073\u0063\u0072\u0061\u0070 \u0068\u0065\u006C\u0069 \u0063\u0061\u0072\u0072\u0069\u0065\u0072/\u0073\u0063\u0072\u0061\u0070\u0074\u0072\u0061\u006E\u0073\u0070\u006F\u0072\u0074\u0068\u0065\u006C\u0069\u0063\u006F\u0070\u0074\u0065\u0072.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 + 30;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 4:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0072\u0075\u0073\u0074.\u0061\u0069/\u006E\u0065\u0078\u0074\u0061\u0069/\u0074\u0065\u0073\u0074\u0072\u0069\u0064\u0061\u0062\u006C\u0065\u0068\u006F\u0072\u0073\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 + 1;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 5:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0073\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065\u0073/\u0073\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 + 1;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 6:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0073\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065/\u0073\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0064\u0075\u006F.\u0065\u006E\u0074\u0069\u0074\u0079.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 7:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006D\u0069\u0073\u0063/\u0074\u0077\u0069\u0074\u0063\u0068/\u0068\u006F\u0062\u006F\u0062\u0061\u0072\u0072\u0065\u006C/\u0068\u006F\u0062\u006F\u0062\u0061\u0072\u0072\u0065\u006C.\u0064\u0065\u0070\u006C\u006F\u0079\u0065\u0064.\u0070\u0072\u0065\u0066\u0061\u0062";\u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = \u0062\u0061\u0073\u0065\u0068\u0065\u0069\u0067\u0068\u0074 - 5.5f;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 8:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0074\u0072\u0061\u0069\u006E\u0074\u0065\u006D\u0070/\u0074\u0072\u0061\u0069\u006E\u0065\u006E\u0067\u0069\u006E\u0065\u0074\u0065\u006D\u0070.\u0065\u006E\u0074\u0069\u0074\u0079.\u0070\u0072\u0065\u0066\u0061\u0062";\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 9:\u0070\u0072\u0065\u0066\u0061\u0062 = "\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0077\u006F\u0072\u006B\u0063\u0061\u0072\u0074/\u0077\u006F\u0072\u006B\u0063\u0061\u0072\u0074.\u0065\u006E\u0074\u0069\u0074\u0079.\u0070\u0072\u0065\u0066\u0061\u0062";\u0062\u0072\u0065\u0061\u006B;}\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0070\u0072\u0065\u0066\u0061\u0062, \u0064\u0072\u006F\u0070\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0069\u0064\u0065\u006E\u0074\u0069\u0074\u0079, \u0074\u0072\u0075\u0065);\u0073\u0077\u0069\u0074\u0063\u0068 (\u0054\u0079\u0070\u0065){\u0063\u0061\u0073\u0065 0:\u0063\u0061\u0073\u0065 1:\u0063\u0061\u0073\u0065 6:\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 _\u0050\u0069\u0072\u0061\u0074\u0065 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065>();_\u0050\u0069\u0072\u0061\u0074\u0065.\u0054\u0079\u0070\u0065 = \u0054\u0079\u0070\u0065;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 2:\u0063\u0061\u0073\u0065 3:\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 _\u0050\u0069\u0072\u0061\u0074\u0065\u0041\u0069\u0072 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073>();_\u0050\u0069\u0072\u0061\u0074\u0065\u0041\u0069\u0072.\u0054\u0079\u0070\u0065 = \u0054\u0079\u0070\u0065;\u0069\u0066 (_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0048\u0065\u006C\u0069\u0046\u0069\u0072\u0065\u0062\u0061\u006C\u006C){(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0061\u0073 \u004D\u0069\u006E\u0069\u0043\u006F\u0070\u0074\u0065\u0072).\u0066\u0069\u0072\u0065\u0042\u0061\u006C\u006C.\u0067\u0075\u0069\u0064 = \u006E\u0075\u006C\u006C;}\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 4:\u0063\u0061\u0073\u0065 5:\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065 _\u0050\u0069\u0072\u0061\u0074\u0065\u004C\u0061\u006E\u0064 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065>();_\u0050\u0069\u0072\u0061\u0074\u0065\u004C\u0061\u006E\u0064.\u0054\u0079\u0070\u0065 = \u0054\u0079\u0070\u0065;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 7:\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065 _\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065 = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065>();_\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065.\u0054\u0079\u0070\u0065 = \u0054\u0079\u0070\u0065;\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 8:\u0063\u0061\u0073\u0065 9:\u0052\u0061\u0069\u006C\u0050\u0069\u0072\u0061\u0074\u0065 _\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C = \u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0061\u0069\u006C\u0050\u0069\u0072\u0061\u0074\u0065>();_\u0050\u0069\u0072\u0061\u0074\u0065\u0052\u0061\u0069\u006C.\u0054\u0079\u0070\u0065 = \u0054\u0079\u0070\u0065;\u0062\u0072\u0065\u0061\u006B;}\u0072\u0065\u0074\u0075\u0072\u006E \u0073\u0065\u0074\u0075\u0070(\u0062\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074 {\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 _\u006C\u0069\u0067\u0068\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0070\u0068\u0065\u0072\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0072\u0065\u0073\u0069\u007A\u0065\u0072;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u0045\u006C\u0065\u0076\u0061\u0074\u0069\u006F\u006E {\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u004D\u0069\u006E {\u0067\u0065\u0074;\u0073\u0065\u0074;} \u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u004D\u0061\u0078 {\u0067\u0065\u0074;\u0073\u0065\u0074;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F{\u0070\u0075\u0062\u006C\u0069\u0063 \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0069\u006E\u0069\u0074\u0045\u006E\u0074, \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0069\u006E\u0069\u0074\u0050\u006C\u0079 = \u006E\u0075\u006C\u006C){\u0070\u006C\u0079 = \u0069\u006E\u0069\u0074\u0050\u006C\u0079;\u0065\u006E\u0074 = \u0069\u006E\u0069\u0074\u0045\u006E\u0074;\u006C\u0061\u0073\u0074\u0053\u0065\u0065\u006E\u0054\u0069\u006D\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u006F\u0073\u0069\u0074\u0069\u0076\u0065\u0049\u006E\u0066\u0069\u006E\u0069\u0074\u0079;\u006E\u0065\u0078\u0074\u004C\u004F\u0053\u0043\u0068\u0065\u0063\u006B = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070 + 1.5f;}\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0079;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065\u006E\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u006C\u0061\u0073\u0074\u0053\u0065\u0065\u006E\u0054\u0069\u006D\u0065 = \u0066\u006C\u006F\u0061\u0074.\u0050\u006F\u0073\u0069\u0074\u0069\u0076\u0065\u0049\u006E\u0066\u0069\u006E\u0069\u0074\u0079;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u0076\u0069\u0073\u0069\u0062\u006C\u0065\u0046\u006F\u0072;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u006E\u0065\u0078\u0074\u004C\u004F\u0053\u0043\u0068\u0065\u0063\u006B;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u0057\u0061\u0074\u0065\u0072\u0050\u0069\u0072\u0061\u0074\u0065 : \u004D\u006F\u006E\u006F\u0042\u0065\u0068\u0061\u0076\u0069\u006F\u0075\u0072{\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0054\u0079\u0070\u0065 = 0;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 _\u0062\u006F\u0061\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065 _\u0073\u0075\u0062;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0062\u0075\u0072\u006E\u0069\u006E\u0067;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0069\u0073\u0044\u0065\u0061\u0064;\u0070\u0075\u0062\u006C\u0069\u0063 \u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u006E\u0070\u0063\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u0074\u0065\u006D\u0062\u006F\u0078;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078 = -1;\u0070\u0075\u0062\u006C\u0069\u0063 \u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0074\u0075\u0072\u006E\u0053\u0063\u0061\u006C\u0065 = 10;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0065\u0067\u0072\u0065\u0073\u0073\u0069\u006E\u0067;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0073\u0074\u006F\u0070\u0070\u0069\u006E\u0067;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074 \u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = "";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = 1;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u004B\u0069\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0077\u0061\u006B\u0065(){\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{_\u0062\u006F\u0061\u0074 = \u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079>();\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074 = _\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0073\u0077\u0069\u0074\u0063\u0068 (\u0054\u0079\u0070\u0065){\u0063\u0061\u0073\u0065 0:\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064;\u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;_\u0062\u006F\u0061\u0074.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079>().\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0048\u0065\u0061\u006C\u0074\u0068(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0048\u0065\u0061\u006C\u0074\u0068, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0048\u0065\u0061\u006C\u0074\u0068);\u004B\u0069\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u004B\u0069\u0074;\u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u004C\u006F\u006F\u0074;\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u0048\u0049\u0042\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 1f, 0f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 1f, 3f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 1f, -1f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 1f, -1.9f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 1f, -2.8f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.9f, 1f, -2.7f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-0.9f, 1f, -2.7f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.9f, 1f, -1f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-0.9f, 1f, -1f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.9f, 1f, 0f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-0.9f, 1f, 0f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.9f, 1f, 1f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-0.9f, 1f, 1f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.9f, 1f, 2f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-0.9f, 1f, 2f));\u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 1.3f, 0);\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0042\u006F\u0061\u0074\u006C\u0069\u0067\u0068\u0074\u0073){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u004C\u0069\u0067\u0068\u0074(_\u0062\u006F\u0061\u0074, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 1.8f, 4.9f), \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-5, 180, 0));}\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 1:\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u