2\u006F\u0061\u0074\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0052\u006F\u0077\u0042\u006F\u0061\u0074\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, -1.3f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, 0f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, 1f));\u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.8f, 0);\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0042\u006F\u0061\u0074\u006C\u0069\u0067\u0068\u0074\u0073){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u004C\u0069\u0067\u0068\u0074(_\u0062\u006F\u0061\u0074, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.8f, 2.2f), \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-5, 180, 0));}\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 6:\u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064;\u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = 2;\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = 100;_\u0062\u006F\u0061\u0074.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079>().\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0048\u0065\u0061\u006C\u0074\u0068(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0048\u0065\u0061\u006C\u0074\u0068, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u0048\u0065\u0061\u006C\u0074\u0068);\u004B\u0069\u0074 = "";\u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004C\u006F\u006F\u0074;\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 = 1;\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, 0f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0f, 0f));_\u0073\u0075\u0062 = (_\u0062\u006F\u0061\u0074 \u0061\u0073 \u0042\u0061\u0073\u0065\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065);_\u0073\u0075\u0062.\u0069\u0064\u006C\u0065\u0046\u0075\u0065\u006C\u0050\u0065\u0072\u0053\u0065\u0063 = 0;_\u0073\u0075\u0062.\u006D\u0061\u0078\u0046\u0075\u0065\u006C\u0050\u0065\u0072\u0053\u0065\u0063 = 0;_\u0062\u006F\u0061\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u004C\u006F\u0063\u006B\u0065\u0064, \u0074\u0072\u0075\u0065);\u0062\u0072\u0065\u0061\u006B;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u0065\u0061\u0076\u0065\u0041\u0066\u0074\u0065\u0072, () =>{\u006C\u0065\u0061\u0076\u0065\u0069\u006E\u0067();});\u0074\u0072\u0079 {\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u006E _\u0062\u006F\u0061\u0074.\u0063\u0068\u0069\u006C\u0064\u0072\u0065\u006E){\u0069\u0066 (\u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 != \u006E\u0075\u006C\u006C && \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067().\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0072\u0068\u0069\u0062_\u0073\u0074\u006F\u0072\u0061\u0067\u0065") || \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067().\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0072\u006F\u0077\u0062\u006F\u0061\u0074_\u0073\u0074\u006F\u0072\u0061\u0067\u0065") || \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0054\u006F\u0053\u0074\u0072\u0069\u006E\u0067().\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073("\u0069\u0074\u0065\u006D\u0073\u0074\u006F\u0072\u0061\u0067\u0065")){\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u0063\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u0061\u0070\u0061\u0063\u0069\u0074\u0079 = 30;\u0062\u0072\u0065\u0061\u006B;}}}\u0063\u0061\u0074\u0063\u0068 {}\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0066\u0069\u006C\u006C\u006C\u006F\u006F\u0074(\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079, -1, \u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069, \u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074);}\u0046\u0069\u006E\u0064\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u004E\u006F\u0064\u0065();\u006E\u0070\u0063\u0073 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u004E\u0050\u0043\u0073(\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074, \u0054\u0079\u0070\u0065, \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068, \u004B\u0069\u0074, \u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072, _\u0062\u006F\u0061\u0074, \u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u0069\u0072\u0061\u0074\u0065.\u0041\u0064\u0064(_\u0062\u006F\u0061\u0074.\u006E\u0065\u0074.\u0049\u0044);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065);\u0069\u0066 (_\u0073\u0075\u0062 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E \u0069\u006E \u006E\u0070\u0063\u0073){_\u0073\u0075\u0062.\u0041\u0074\u0074\u0065\u006D\u0070\u0074\u004D\u006F\u0075\u006E\u0074(\u006E, \u0066\u0061\u006C\u0073\u0065);\u006E.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0053\u0074\u0072\u0069\u0070();}_\u0073\u0075\u0062.\u0053\u0065\u0074\u0075\u0070\u004F\u0077\u006E\u0065\u0072(\u006E\u0070\u0063\u0073[0], \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F, 1);_\u0073\u0075\u0062.\u0065\u006E\u0067\u0069\u006E\u0065\u0043\u006F\u006E\u0074\u0072\u006F\u006C\u006C\u0065\u0072.\u0054\u0072\u0079\u0053\u0074\u0061\u0072\u0074\u0045\u006E\u0067\u0069\u006E\u0065(\u006E\u0070\u0063\u0073[0]);}\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 = (_\u0062\u006F\u0061\u0074 \u0061\u0073 \u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065).\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0053\u0079\u0073\u0074\u0065\u006D().\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072();\u0069\u0066 (\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004C\u006F\u0063\u006B\u0065\u0064, \u0074\u0072\u0075\u0065);}});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u006C\u0065\u0061\u0076\u0065\u0069\u006E\u0067(){\u0069\u0066 (_\u0062\u006F\u0061\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, \u006C\u0065\u0061\u0076\u0065\u0069\u006E\u0067);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0065\u0067\u0072\u0065\u0073\u0073\u0069\u006E\u0067 = \u0074\u0072\u0075\u0065;\u0070\u006C\u0075\u0067\u0069\u006E.\u0049\u006E\u0076\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u0068\u0065\u0063\u006B(_\u0062\u006F\u0061\u0074);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(60f, \u0044\u0069\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0044\u0065\u0073\u0074\u0072\u006F\u0079(){\u0074\u0072\u0079{\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065();\u0069\u0066 (\u006E\u0070\u0063\u0073 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0061\u0064()){\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}} }\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072 != \u006E\u0075\u006C\u006C && !\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072.\u004B\u0069\u006C\u006C();} \u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C && !\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u004B\u0069\u006C\u006C();}}\u0069\u0066 (_\u0062\u006F\u0061\u0074 != \u006E\u0075\u006C\u006C && !_\u0062\u006F\u0061\u0074.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){_\u0062\u006F\u0061\u0074.\u004B\u0069\u006C\u006C();}}\u0063\u0061\u0074\u0063\u0068 {}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0044\u0069\u0065(){\u0069\u0066 (\u0074\u0068\u0069\u0073 != \u006E\u0075\u006C\u006C){\u0044\u0065\u0073\u0074\u0072\u006F\u0079(\u0074\u0068\u0069\u0073);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0078\u0070\u006C\u006F\u0064\u0065(){\u0069\u0066 (_\u0062\u006F\u0061\u0074 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0045\u0078\u0070\u006C\u006F\u0064\u0065(_\u0062\u006F\u0061\u0074);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0075\u0062\u0041\u0074\u0074\u0061\u0063\u006B(){\u0069\u0066 (_\u0073\u0075\u0062==\u006E\u0075\u006C\u006C || \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (_\u0073\u0075\u0062.\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0054\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0065\u0064 >= _\u0073\u0075\u0062.\u006D\u0061\u0078\u0046\u0069\u0072\u0065\u0052\u0061\u0074\u0065){\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(_\u0073\u0075\u0062) < 50 && \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(_\u0073\u0075\u0062) > 5){\u0069\u0066 (!\u0047\u0061\u006D\u0065\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u004C\u0069\u006E\u0065\u004F\u0066\u0053\u0069\u0067\u0068\u0074(_\u0073\u0075\u0062.\u0074\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, _\u0073\u0075\u0062.\u0074\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + _\u0073\u0075\u0062.\u0074\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * 30f, (\u0069\u006E\u0074)\u004C\u0061\u0079\u0065\u0072\u0073.\u0053\u0065\u0072\u0076\u0065\u0072.\u0050\u006C\u0061\u0079\u0065\u0072\u0073 | 1 << (\u0069\u006E\u0074)\u004C\u0061\u0079\u0065\u0072\u0073.\u0053\u0065\u0072\u0076\u0065\u0072.\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0073 | 1 << (\u0069\u006E\u0074)\u004C\u0061\u0079\u0065\u0072\u0073.\u0053\u0065\u0072\u0076\u0065\u0072.\u0044\u0065\u0070\u006C\u006F\u0079\u0065\u0064 | 1 << (\u0069\u006E\u0074)\u004C\u0061\u0079\u0065\u0072\u0073.\u0053\u0065\u0072\u0076\u0065\u0072.\u0056\u0065\u0068\u0069\u0063\u006C\u0065\u0073\u0053\u0069\u006D\u0070\u006C\u0065)){\u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0053\u0070\u0065\u0065\u0064 = _\u0073\u0075\u0062.\u0047\u0065\u0074\u0053\u0070\u0065\u0065\u0064() + 10f;\u0053\u0065\u0072\u0076\u0065\u0072\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065 \u0073\u0065\u0072\u0076\u0065\u0072\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065;\u0049\u0074\u0065\u006D \u0069\u0074\u0065\u006D = \u0049\u0074\u0065\u006D\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0079\u004E\u0061\u006D\u0065("\u0073\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065.\u0074\u006F\u0072\u0070\u0065\u0064\u006F.\u0073\u0074\u0072\u0061\u0069\u0067\u0068\u0074", 1, 0);\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u004D\u006F\u0076\u0065\u0054\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(_\u0073\u0075\u0062.\u0047\u0065\u0074\u0054\u006F\u0072\u0070\u0065\u0064\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072().\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079, -1, \u0066\u0061\u006C\u0073\u0065)){\u0069\u0074\u0065\u006D.\u0052\u0065\u006D\u006F\u0076\u0065();}\u0069\u0066 (\u0042\u0061\u0073\u0065\u004D\u006F\u0075\u006E\u0074\u0061\u0062\u006C\u0065.\u0054\u0072\u0079\u0046\u0069\u0072\u0065\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065(_\u0073\u0075\u0062.\u0047\u0065\u0074\u0054\u006F\u0072\u0070\u0065\u0064\u006F\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072(), \u0041\u006D\u006D\u006F\u0054\u0079\u0070\u0065\u0073.\u0054\u004F\u0052\u0050\u0045\u0044\u004F, _\u0073\u0075\u0062.\u0074\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + _\u0073\u0075\u0062.\u0074\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * 2, _\u0073\u0075\u0062.\u0074\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074.\u0066\u006F\u0072\u0077\u0061\u0072\u0064, \u006E\u0070\u0063\u0073[0], 1f, \u006D\u0069\u006E\u0053\u0070\u0065\u0065\u0064, \u006F\u0075\u0074 \u0073\u0065\u0072\u0076\u0065\u0072\u0050\u0072\u006F\u006A\u0065\u0063\u0074\u0069\u006C\u0065)){_\u0073\u0075\u0062.\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0054\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0065\u0064 = 0f;_\u0073\u0075\u0062.\u0043\u006C\u0069\u0065\u006E\u0074\u0052\u0050\u0043(\u006E\u0075\u006C\u006C, "\u0054\u006F\u0072\u0070\u0065\u0064\u006F\u0046\u0069\u0072\u0065\u0064");}}}}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0046\u0069\u0078\u0065\u0064\u0055\u0070\u0064\u0061\u0074\u0065(){\u0069\u0066 (_\u0062\u006F\u0061\u0074==\u006E\u0075\u006C\u006C || \u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078==-1 || \u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0074\u0072\u0079{\u0069\u0066 (_\u0073\u0075\u0062==\u006E\u0075\u006C\u006C){_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E), _\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A);}_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0046\u0072\u006F\u006D\u0054\u006F\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070) * \u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u0069\u0066 (!\u0073\u0074\u006F\u0070\u0070\u0069\u006E\u0067){_\u0062\u006F\u0061\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00641, \u0074\u0072\u0075\u0065);}\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0042\u006F\u0061\u0074\u006C\u0069\u0067\u0068\u0074\u0073){\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E, \u0054\u004F\u0044_\u0053\u006B\u0079.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0049\u0073\u004E\u0069\u0067\u0068\u0074);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0055\u0070\u0064\u0061\u0074\u0065\u0048\u0061\u0073\u0050\u006F\u0077\u0065\u0072(\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0049\u0073\u004F\u006E() ? 10 : 0, 1);}\u0065\u006C\u0073\u0065 \u0069\u0066 (_\u0073\u0075\u0062 != \u006E\u0075\u006C\u006C){_\u0073\u0075\u0062.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0053\u0075\u0062\u006D\u0061\u0072\u0069\u006E\u0065.\u0046\u006C\u0061\u0067_\u0048\u0065\u0061\u0064\u006C\u0069\u0067\u0068\u0074\u0073, \u0054\u004F\u0044_\u0053\u006B\u0079.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0049\u0073\u004E\u0069\u0067\u0068\u0074);}}\u0069\u0066 (!\u0069\u0073\u0044\u0065\u0061\u0064){_\u0062\u006F\u0061\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00642, \u0074\u0072\u0075\u0065);\u0069\u0066 (!\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065){\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065 = \u0074\u0072\u0075\u0065;}\u0065\u006C\u0073\u0065{\u0069\u0066 (_\u0062\u006F\u0061\u0074.\u0048\u0065\u0061\u006C\u0074\u0068() < 10){\u0045\u0078\u0070\u006C\u006F\u0064\u0065();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (_\u0073\u0075\u0062 != \u006E\u0075\u006C\u006C){\u0053\u0075\u0062\u0041\u0074\u0074\u0061\u006