46\u0069\u0072\u0065(60, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.9f, -1.8f), 0.1f, _\u0062\u006F\u0061\u0074);}}\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0069\u0066 (\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) > 0.01){\u0069\u0073\u0044\u0065\u0061\u0064 = \u0074\u0072\u0075\u0065;_\u0062\u006F\u0061\u0074.\u0049\u006E\u0076\u006F\u006B\u0065(() =>{\u0042\u0061\u0069\u006C\u004F\u0075\u0074();\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0046\u0069\u0072\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079 + 2f, \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074, 0, _\u0062\u006F\u0061\u0074);\u0049\u006E\u0076\u006F\u006B\u0065("\u0045\u0078\u0070\u006C\u006F\u0064\u0065", _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079);}, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0043\u0072\u0061\u0073\u0068\u0044\u0065\u006C\u0061\u0079);\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078];\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 != 0){\u0056\u0065\u0063\u0074\u006F\u00723 \u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0067\u0065\u0074\u0050\u004F\u0049(_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0073\u0057\u0061\u0074\u0065\u0072\u0050\u004F\u0049\u0052\u0061\u0064\u0069\u0075\u0073);\u0069\u0066 (\u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074 != \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F && \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074) < -5){\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074 = \u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074;}}\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074 = \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;}\u0069\u0066 (\u0065\u0067\u0072\u0065\u0073\u0073\u0069\u006E\u0067){\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074 = \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + (\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E - \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 * 10000f;}\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 = (\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074 - \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064;\u0066\u006C\u006F\u0061\u0074 \u0076\u0061\u006C\u0075\u0065 = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u006F\u0074(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064, \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064);\u0066\u006C\u006F\u0061\u0074 \u0062 = \u004D\u0061\u0074\u0068\u0066.\u0049\u006E\u0076\u0065\u0072\u0073\u0065\u004C\u0065\u0072\u0070(0f, 1f, \u0076\u0061\u006C\u0075\u0065);\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u006F\u0074(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u0069\u0067\u0068\u0074, \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064);\u0066\u006C\u006F\u0061\u0074 \u00622 = \u004D\u0061\u0074\u0068\u0066.\u0049\u006E\u0076\u0065\u0072\u0073\u0065\u004C\u0065\u0072\u0070(0.05f, 0.5f, \u004D\u0061\u0074\u0068\u0066.\u0041\u0062\u0073(\u006E\u0075\u006D));\u0074\u0075\u0072\u006E\u0053\u0063\u0061\u006C\u0065 = \u004D\u0061\u0074\u0068\u0066.\u004C\u0065\u0072\u0070(\u0074\u0075\u0072\u006E\u0053\u0063\u0061\u006C\u0065, \u00622, \u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 * 0.2f);\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D3 = (\u0066\u006C\u006F\u0061\u0074)((\u006E\u0075\u006D < 0f) ? -1 : 1);\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 = \u0042\u006F\u0061\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064 * \u0074\u0075\u0072\u006E\u0053\u0063\u0061\u006C\u0065 * \u006E\u0075\u006D3;\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0052\u006F\u0074\u0061\u0074\u0065(\u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 * \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064, \u0053\u0070\u0061\u0063\u0065.\u0057\u006F\u0072\u006C\u0064);\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065 = \u004D\u0061\u0074\u0068\u0066.\u004C\u0065\u0072\u0070(\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065, \u0062, \u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 * 0.2f);\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * (\u0042\u006F\u0061\u0074\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 * \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065);\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E += \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079 * \u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065;\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074) < 80f){\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078++;\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078 >= \u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074){\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078 = 0;}}}}\u0063\u0061\u0074\u0063\u0068 {\u0046\u0069\u006E\u0064\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u004E\u006F\u0064\u0065();}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0042\u0061\u0069\u006C\u004F\u0075\u0074(){\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0064\u0072\u006F\u0070\u0046\u006C\u006F\u0061\u0074\u0073 = \u0074\u0072\u0075\u0065;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0044\u0072\u006F\u0070\u0049\u0074\u0065\u006D\u0073();}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (_\u0073\u0075\u0062 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0047\u0075\u006E(\u006E\u0070\u0063, "\u0072\u0069\u0066\u006C\u0065.\u006C\u0072300", "\u0077\u0065\u0061\u0070\u006F\u006E.\u006D\u006F\u0064.\u0073\u0069\u006C\u0065\u006E\u0063\u0065\u0072");}\u006E\u0070\u0063\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063);\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0069\u006C\u004F\u0075\u0074(_\u0062\u006F\u0061\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006E\u0070\u0063, 8);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u0047\u0065\u0074\u0043\u006C\u006F\u0073\u0065\u0073\u0074\u004E\u006F\u0064\u0065\u0054\u006F\u0055\u0073(){\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073==\u006E\u0075\u006C\u006C || \u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074==0){\u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0050\u0061\u0074\u0068.\u004F\u0063\u0065\u0061\u006E\u0050\u0061\u0074\u0072\u006F\u006C\u0046\u0061\u0072;}\u0069\u006E\u0074 \u0072\u0065\u0073\u0075\u006C\u0074 = 0;\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = \u0066\u006C\u006F\u0061\u0074.\u0050\u006F\u0073\u0069\u0074\u0069\u0076\u0065\u0049\u006E\u0066\u0069\u006E\u0069\u0074\u0079;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < \u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074;\u0069++){\u0056\u0065\u0063\u0074\u006F\u00723 \u0062 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u0069];\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D2 = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0062);\u0069\u0066 (\u006E\u0075\u006D2 < \u006E\u0075\u006D){\u0072\u0065\u0073\u0075\u006C\u0074 = \u0069;\u006E\u0075\u006D = \u006E\u0075\u006D2;}}\u0072\u0065\u0074\u0075\u0072\u006E \u0072\u0065\u0073\u0075\u006C\u0074;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0046\u0069\u006E\u0064\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u004E\u006F\u0064\u0065(){\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078 = \u0047\u0065\u0074\u0043\u006C\u006F\u0073\u0065\u0073\u0074\u004E\u006F\u0064\u0065\u0054\u006F\u0055\u0073();}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065(){\u0069\u0066 (\u006E\u0070\u0063\u0073==\u006E\u0075\u006C\u006C || _\u0062\u006F\u0061\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u006E\u0074 \u0061\u006C\u0069\u0076\u0065 = 0;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (\u006E\u0070\u0063.\u0049\u0073\u0041\u006C\u0069\u0076\u0065()){\u0061\u006C\u0069\u0076\u0065++;\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0050\u0043\u0048\u0065\u0061\u006C(\u006E\u0070\u0063);\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074==\u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0053\u0065\u0074\u0041\u0069\u006D\u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E(\u0070\u006C\u0075\u0067\u0069\u006E.\u0073\u0065\u0061\u006E\u006F\u0064\u0065\u0073[\u0074\u0061\u0072\u0067\u0065\u0074\u004E\u006F\u0064\u0065\u0049\u006E\u0064\u0065\u0078] - \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 = \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u0047\u0065\u0074\u004E\u0065\u0061\u0072\u0065\u0073\u0074\u0054\u0068\u0072\u0065\u0061\u0074(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0042\u006F\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065);\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070 = \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0054\u006F\u0050\u006C\u0061\u0079\u0065\u0072();\u0069\u0066 (\u0070 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0070.\u0049\u0073\u0053\u006C\u0065\u0065\u0070\u0069\u006E\u0067() || \u0070.\u0049\u0073\u0044\u0065\u0061\u0064() || \u0070\u006C\u0075\u0067\u0069\u006E.\u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070.\u006E\u0065\u0074.\u0049\u0044)){\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 = \u006E\u0075\u006C\u006C;}}}}}}\u0069\u0066 (\u0061\u006C\u0069\u0076\u0065==0){\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0069\u0066 (_\u0062\u006F\u0061\u0074 != \u006E\u0075\u006C\u006C){_\u0062\u006F\u0061\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00641, \u0066\u0061\u006C\u0073\u0065);\u0073\u0074\u006F\u0070\u0070\u0069\u006E\u0067 = \u0074\u0072\u0075\u0065;}});\u0069\u0073\u0044\u0065\u0061\u0064 = \u0074\u0072\u0075\u0065;\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0074\u006F\u0070\u0044\u0065\u006C\u0061\u0079, \u0053\u0074\u006F\u0070);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0054\u0069\u0063\u006B, \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0074\u006F\u0070(){\u0069\u0066 (_\u0062\u006F\u0061\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079 + _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079, \u0045\u0078\u0070\u006C\u006F\u0064\u0065);\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0046\u0069\u0072\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079, \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079, _\u0062\u006F\u0061\u0074);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0063\u006C\u0061\u0073\u0073 \u0041\u0069\u0072\u0050\u0069\u0072\u0061\u0074\u0065\u0073 : \u004D\u006F\u006E\u006F\u0042\u0065\u0068\u0061\u0076\u0069\u006F\u0075\u0072{\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0065\u006E\u0075\u006D \u0061\u0069\u0053\u0074\u0061\u0074\u0065{\u0049\u0044\u004C\u0045,\u004D\u004F\u0056\u0045,\u004F\u0052\u0042\u0049\u0054,\u0053\u0054\u0052\u0041\u0046\u0045,\u0050\u0041\u0054\u0052\u004F\u004C,}\u0070\u0075\u0062\u006C\u0069\u0063 \u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u006E\u0070\u0063\u0073;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043, \u0056\u0065\u0063\u0074\u006F\u00723> \u004E\u0050\u0043\u004F\u0066\u0066\u0053\u0065\u0074 = \u006E\u0065\u0077 \u0044\u0069\u0063\u0074\u0069\u006F\u006E\u0061\u0072\u0079<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043, \u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u0074\u0065\u006D\u0062\u006F\u0078;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 _\u0068\u0065\u006C\u0069;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0041\u0069\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0046\u006F\u0072\u0063\u0065 = 10000f;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 _\u006D\u006F\u0076\u0065\u0054\u0061\u0072\u0067\u0065\u0074 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0070\u0075\u0062\u006C\u0069\u0063 \u0056\u0065\u0063\u0074\u006F\u00723 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u006C\u0061\u0073\u0074\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0043\u0068\u0065\u0063\u006B\u0046\u0072\u0061\u006D\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0061\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0050\u0072\u006F\u0074\u0065\u0063\u0074\u0069\u006F\u006E = \u0074\u0072\u0075\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0068\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0069\u006E\u0074\u0065\u0072\u0065\u0073\u0074\u005A\u006F\u006E\u0065\u004F\u0072\u0069\u0067\u0069\u006E;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E;\u0070\u0075\u0062\u006C\u0069\u0063 \u0066\u006C\u006F\u0061\u0074 \u006D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0063\u006F\u0075\u0072\u0073\u0065\u0041\u0064\u006A\u0075\u0073\u0074\u004C\u0065\u0072\u0070\u0054\u0069\u006D\u0065 = 4f;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u0074\u0061\u0072\u0067\u0065\u0074\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0074\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065 _\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 _\u006C\u0061\u0073\u0074\u0050\u006F\u0073;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 _\u006C\u0061\u0073\u0074\u004D\u006F\u0076\u0065\u0044\u0069\u0072;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0069\u0073\u0044\u0065\u0061\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0069\u0073\u0052\u0065\u0074\u0069\u0072\u0069\u006E\u0067;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0062\u0075\u0072\u006E\u0069\u006E\u0067;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E_\u006D\u0069\u006E_\u0064\u0069\u0073\u0074 = 2f;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0054\u0069\u006D\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0068\u0061\u0073\u0045\u006E\u0074\u0065\u0072\u0065\u0064\u004F\u0072\u0062\u0069\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006F\u0072\u0062\u0069\u0074\u0053\u0074\u0061\u0072\u0074\u0054\u0069\u006D\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u004F\u0072\u0062\u0069\u0074\u0044\u0075\u0072\u0061\u0074\u0069\u006F\u006E = 10f;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0062\u0072\u0065\u0061\u006B\u0069\u006E\u0067\u004F\u0072\u0062\u0069\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0073\u0074\u0072\u0061\u0066\u0065_\u0074\u0061\u0072\u0067\u0065\u0074_\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0070\u0075\u0074\u0074\u0069\u006E\u0067\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006C\u0061\u0073\u0074\u0053\u0074\u0072\u0061\u0066\u0065\u0054\u0069\u006D\u0065 = \u0066\u006C\u006F\u0061\u0074.\u004E\u0065\u0067\u0061\u0074\u0069\u0076\u0065\u0049\u006E\u0066\u0069\u006E\u0069\u0074\u0079;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 _\u006C\u0061\u0073\u0074\u0054\u0068\u0069\u006E\u006B\u0054\u0069\u006D\u0065;\u0070\u0075\u0062\u006C\u0069\u0063 \u004C\u0069\u0073\u0074<\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F> _\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0073\u0074\u0075\u0063\u006B\u0063\u0068\u0065\u0063\u006B = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0053\u0070\u006F\u0074\u0043\u0068\u0065\u0063\u006B = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0);\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074 \u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0054\u0079\u0070\u0065 = 0;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079 _\u0072\u0062;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u004B\u0069\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0054\u0068\u0072\u0065\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = "";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = 1;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u004E\u0065\u0078\u0074\u0050\u004F\u0049\u0054\u0069\u0063\u006B;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0077\u0061\u006B\u0065(){\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{_\u0068\u0065\u006C\u0069 = \u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079>();_\u0068\u0065\u006C\u0069.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u004E\u0065\u0078\u0074\u0050\u004F\u0049\u0054\u0069\u0063\u006B = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065;\u0073\u0077\u0069\u0074\u0063\u0068 (\u0054\u0079\u0070\u0065){\u0063\u0061\u0073\u0065 2:\u006D\u0061\u0078\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064;\u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u0068\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0048\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074;\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u004B\u0069\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004B\u0069\u0074;\u006F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0054\u0068\u0072\u0065\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0054\u0068\u0072\u0065\u0061\u0074\u004C\u0065\u0076\u0065\u006C;\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u0065\u006C\u0069\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079>().\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0048\u0065\u0061\u006C\u0074\u0068(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0048\u0065\u0061\u006C\u0074\u0068, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u0048\u0065\u0061\u006C\u0074\u0068);\u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.2f, 0);\u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065(0);\u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004C\u006F\u006F\u0074;\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004D\u0069\u006E\u0069\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.0f, 0.0f, 0.5f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(1f, -0.2f, -0.6f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-1f, -0.2f, -0.6f));\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0.0f, 0.0f, 1.3f));\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u0048\u0065\u006C\u0069\u006C\u0069\u0067\u0068\u0074\u0073){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u004C\u0069\u0067\u0068\u0074(_\u0068\u0065\u006C\u0069, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.24f, 1.8f), \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-20, 180, 180));}\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 3:\u006D\u0061\u0078\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0054\u0075\u0072\u006E\u0053\u0070\u0065\u0065\u0064;\u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u004D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u0068\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0048\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074;\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u004B\u0069\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u004B\u0069\u0074;\u006F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0041\u0049\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0054\u0068\u0072\u0065\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0054\u0068\u0072\u0065\u0061\u0074\u004C\u0065\u0076\u0065\u006C;\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u0065\u006C\u0069\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0043\u006F\u006D\u0062\u0061\u0074\u0045\u006E\u0074\u0069\u0074\u0079>().\u0049\u006E\u0069\u0074\u0069\u0061\u006C\u0069\u007A\u0065\u0048\u0065\u0061\u006C\u0074\u0068(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0048\u0065\u0061\u006C\u0074\u0068, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0063\u0072\u0061\u0070\u0048\u0065\u0061\u006C\u0074\u0068);\u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.2f, 0);\u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065(0.8f);\u0052\u00