50\u006F\u0077\u0065\u0072(\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0049\u0073\u004F\u006E() ? 10 : 0, 1);}}\u004D\u0061\u0069\u006E\u0074\u0061\u0069\u006E\u0041\u0049\u0041\u006C\u0074\u0075\u0074\u0069\u0064\u0065();\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0056\u0065\u0063\u0074\u006F\u00723.\u004C\u0065\u0072\u0070(_\u006C\u0061\u0073\u0074\u004D\u006F\u0076\u0065\u0044\u0069\u0072, (\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E - \u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064, \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 / \u0063\u006F\u0075\u0072\u0073\u0065\u0041\u0064\u006A\u0075\u0073\u0074\u004C\u0065\u0072\u0070\u0054\u0069\u006D\u0065);_\u006C\u0061\u0073\u0074\u004D\u006F\u0076\u0065\u0044\u0069\u0072 = \u0076\u0065\u0063\u0074\u006F\u0072;\u0074\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = \u004D\u0061\u0074\u0068\u0066.\u004C\u0065\u0072\u0070(\u0074\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064, \u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064, \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 / 3f);\u0066\u006C\u006F\u0061\u0074 \u0064 = \u0074\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 * \u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E += \u0076\u0065\u0063\u0074\u006F\u0072 * \u0064 * \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065;\u006D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064 = \u004D\u0061\u0074\u0068\u0066.\u004C\u0065\u0072\u0070(\u006D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064, \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(_\u006C\u0061\u0073\u0074\u0050\u006F\u0073, \u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) / \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065, \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 * 2f);_\u006C\u0061\u0073\u0074\u0050\u006F\u0073 = \u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0041\u0049\u0054\u0068\u0069\u006E\u006B();\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 != 0){\u0069\u0066 (\u004E\u0065\u0078\u0074\u0050\u004F\u0049\u0054\u0069\u0063\u006B < \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065){\u004E\u0065\u0078\u0074\u0050\u004F\u0049\u0054\u0069\u0063\u006B = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065 + 10;\u0056\u0065\u0063\u0074\u006F\u00723 \u0050\u004F\u0049 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0067\u0065\u0074\u0050\u004F\u0049(_\u0068\u0065\u006C\u0069.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0073\u0041\u0069\u0072\u0050\u004F\u0049\u0052\u0061\u0064\u0069\u0075\u0073);\u0069\u0066 (\u0050\u004F\u0049 != \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F){\u0066\u006C\u006F\u0061\u0074 \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(_\u0068\u0065\u006C\u0069.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (\u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 < 20){\u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 = 30;}\u0050\u004F\u0049.\u0079 = \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074;\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0050\u004F\u0049, 10f, 30f);\u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0050\u004F\u0049), -1f);\u0069\u006E\u0074\u0065\u0072\u0065\u0073\u0074\u005A\u006F\u006E\u0065\u004F\u0072\u0069\u0067\u0069\u006E = \u0050\u004F\u0049;\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0056\u0065\u006C\u006F\u0063\u0069\u0074\u0079 = _\u006C\u0061\u0073\u0074\u004D\u006F\u0076\u0065\u0044\u0069\u0072 * (\u0074\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 * \u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064);}}}\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064 = \u004D\u0061\u0074\u0068\u0066.\u004C\u0065\u0072\u0070(\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064, \u006D\u0061\u0078\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064, \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 / 2f);\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u004C\u0065\u0072\u0070(\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0074\u0061\u0072\u0067\u0065\u0074\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064 * \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0064\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065);\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0046\u0072\u006F\u006D\u0054\u006F\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070) * \u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0044\u0065\u0073\u0074\u0072\u006F\u0079(){\u0074\u0072\u0079{\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065();\u0069\u0066 (\u006E\u0070\u0063\u0073 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0061\u0064()){\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}} }\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072 != \u006E\u0075\u006C\u006C && !\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072.\u004B\u0069\u006C\u006C();} \u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C && !\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u004B\u0069\u006C\u006C();}}\u0069\u0066 (_\u0068\u0065\u006C\u0069 != \u006E\u0075\u006C\u006C && !_\u0068\u0065\u006C\u0069.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){_\u0068\u0065\u006C\u0069.\u004B\u0069\u006C\u006C();}}\u0063\u0061\u0074\u0063\u0068 {}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0044\u0069\u0065(){\u0069\u0066 (\u0074\u0068\u0069\u0073 != \u006E\u0075\u006C\u006C){\u0044\u0065\u0073\u0074\u0072\u006F\u0079(\u0074\u0068\u0069\u0073);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065(\u0066\u006C\u006F\u0061\u0074 \u006F\u0066\u0066\u0073\u0065\u0074){\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0062\u006F\u0061\u0074\u0073/\u0072\u0068\u0069\u0062/\u0073\u0075\u0062\u0065\u006E\u0074\u0073/\u0072\u0068\u0069\u0062_\u0073\u0074\u006F\u0072\u0061\u0067\u0065.\u0070\u0072\u0065\u0066\u0061\u0062") \u0061\u0073 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072;\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0070\u0061\u0077\u006E();\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(_\u0068\u0065\u006C\u0069);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, \u006F\u0066\u0066\u0073\u0065\u0074, 0);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u0061\u0070\u0061\u0063\u0069\u0074\u0079 = 30;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0078\u0070\u006C\u006F\u0064\u0065(){\u0070\u006C\u0075\u0067\u0069\u006E.\u0045\u0078\u0070\u006C\u006F\u0064\u0065(_\u0068\u0065\u006C\u0069);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065(){\u0069\u0066 (\u006E\u0070\u0063\u0073==\u006E\u0075\u006C\u006C){\u0069\u0066 (_\u0068\u0065\u006C\u0069 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0045\u0078\u0070\u006C\u006F\u0064\u0065(_\u0068\u0065\u006C\u0069);} \u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u006E\u0074 \u0061\u006C\u0069\u0076\u0065 = 0;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u006E\u0070\u0063.\u0049\u0073\u0041\u006C\u0069\u0076\u0065()){\u0061\u006C\u0069\u0076\u0065++;\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0050\u0043\u0048\u0065\u0061\u006C(\u006E\u0070\u0063);\u0069\u0066 (\u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u0047\u0065\u0074\u004E\u0065\u0061\u0072\u0065\u0073\u0074\u0050\u006C\u0061\u0079\u0065\u0072(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u0065\u006C\u0069\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065)==\u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0053\u0065\u0074\u0041\u0069\u006D\u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E(\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E - \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}}}}\u0069\u0066 (\u0061\u006C\u0069\u0076\u0065==0 && !\u0069\u0073\u0044\u0065\u0061\u0064){\u0069\u0073\u0044\u0065\u0061\u0064 = \u0074\u0072\u0075\u0065;\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0064\u0072\u006F\u0070\u0046\u006C\u006F\u0061\u0074\u0073 = \u0074\u0072\u0075\u0065;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0044\u0072\u006F\u0070\u0049\u0074\u0065\u006D\u0073();\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u0069\u0066 (!\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u004B\u0069\u006C\u006C();}});}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079 + _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079, \u0045\u0078\u0070\u006C\u006F\u0064\u0065);\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0046\u0069\u0072\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079, \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079, _\u0068\u0065\u006C\u0069);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0054\u0069\u0063\u006B, \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0047\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0046\u006F\u0072\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0066\u006C\u006F\u0061\u0074 \u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074){\u0066\u006C\u006F\u0061\u0074 \u0072\u0065\u0073\u0075\u006C\u0074;\u0069\u0066 (\u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 >= 75f){\u0072\u0065\u0073\u0075\u006C\u0074 = 1f;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 >= 50f){\u0072\u0065\u0073\u0075\u006C\u0074 = 0.75f;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 >= 25f){\u0072\u0065\u0073\u0075\u006C\u0074 = 0.33f;}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 >= 5f){\u0072\u0065\u0073\u0075\u006C\u0074 = 0.05f;}\u0065\u006C\u0073\u0065 {\u0072\u0065\u0073\u0075\u006C\u0074 = 0.05f * (1f - \u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 / 5f);}\u0072\u0065\u0074\u0075\u0072\u006E \u0072\u0065\u0073\u0075\u006C\u0074;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0061\u006C\u0063\u0075\u006C\u0061\u0074\u0065\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065(){\u0043\u0061\u006C\u0063\u0075\u006C\u0061\u0074\u0065\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065();\u0069\u0066 (\u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 > \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065){\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065 = \u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065;\u0072\u0065\u0074\u0075\u0072\u006E;}\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065 = \u004D\u0061\u0074\u0068\u0066.\u004D\u006F\u0076\u0065\u0054\u006F\u0077\u0061\u0072\u0064\u0073(\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065, \u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065, \u0054\u0069\u006D\u0065.\u0066\u0069\u0078\u0065\u0064\u0044\u0065\u006C\u0074\u0061\u0054\u0069\u006D\u0065 * 5f);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065\u0045\u0078\u0069\u0074(){\u0073\u0077\u0069\u0074\u0063\u0068 (_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065){\u0064\u0065\u0066\u0061\u0075\u006C\u0074:\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004D\u004F\u0056\u0045:\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004F\u0052\u0042\u0049\u0054:\u0062\u0072\u0065\u0061\u006B\u0069\u006E\u0067\u004F\u0072\u0062\u0069\u0074 = \u0066\u0061\u006C\u0073\u0065;\u0068\u0061\u0073\u0045\u006E\u0074\u0065\u0072\u0065\u0064\u004F\u0072\u0062\u0069\u0074 = \u0066\u0061\u006C\u0073\u0065;\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0054\u0069\u006D\u0065 = 0f;\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0053\u0054\u0052\u0041\u0046\u0045:\u006C\u0061\u0073\u0074\u0053\u0074\u0072\u0061\u0066\u0065\u0054\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070;\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0050\u0041\u0054\u0052\u004F\u004C:\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065(){\u004F\u006E\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065\u0045\u0078\u0069\u0074();_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0049\u0044\u004C\u0045;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0052\u0065\u0074\u0069\u0072\u0065(){\u0069\u0066 (_\u0068\u0065\u006C\u0069==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0069\u0073\u0052\u0065\u0074\u0069\u0072\u0069\u006E\u0067){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0049\u006E\u0076\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u0068\u0065\u0063\u006B(_\u0068\u0065\u006C\u0069);\u0069\u0073\u0052\u0065\u0074\u0069\u0072\u0069\u006E\u0067 = \u0074\u0072\u0075\u0065;\u0066\u006C\u006F\u0061\u0074 \u0078 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0053\u0069\u007A\u0065.\u0078;\u0066\u006C\u006F\u0061\u0074 \u0079 = 200f;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0056\u0065\u0063\u0074\u006F\u00723\u0045\u0078.\u0052\u0061\u006E\u0067\u0065(-1f, 1f);\u0076\u0065\u0063\u0074\u006F\u0072.\u0079 = 0f;\u0076\u0065\u0063\u0074\u006F\u0072.\u004E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065();\u0076\u0065\u0063\u0074\u006F\u0072 *= \u0078 * 20f;\u0076\u0065\u0063\u0074\u006F\u0072.\u0079 = \u0079;\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004D\u004F\u0056\u0045;\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E_\u006D\u0069\u006E_\u0064\u0069\u0073\u0074 = 5f;\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0076\u0065\u0063\u0074\u006F\u0072, 5f, 30f);\u0066\u006C\u006F\u0061\u0074 \u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E);\u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = \u0047\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0046\u006F\u0072\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u006E\u0065\u0077\u0054\u0061\u0072\u0067\u0065\u0074\u0052\u006F\u0074, \u0066\u006C\u006F\u0061\u0074 \u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 = -1f){\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = (\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065==-1f) ? \u004D\u0061\u0074\u0068\u0066.\u0043\u006C\u0061\u006D\u007001(\u006D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064 / (\u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064 * 0.5f)) : \u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065;\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064 = \u006E\u0075\u006D * \u006D\u0061\u0078\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0053\u0070\u0065\u0065\u0064;\u0074\u0061\u0072\u0067\u0065\u0074\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u006E\u0065\u0077\u0054\u0061\u0072\u0067\u0065\u0074\u0052\u006F\u0074;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074){\u0056\u0065\u0063\u0074\u006F\u00723 \u0061 = \u0074\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074;\u0061.\u0079 = 0f;\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 = 0f;\u0072\u0065\u0074\u0075\u0072\u006E \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u004C\u006F\u006F\u006B\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E((\u0061 - \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074, \u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0044\u0069\u0073\u0074 = 5f, \u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0044\u0069\u0073\u0074\u0046\u006F\u0072\u0046\u0061\u0063\u0069\u006E\u0067\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = 30f){\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E = \u0074\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074;\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E_\u006D\u0069\u006E_\u0064\u0069\u0073\u0074 = \u006D\u0069\u006E\u0044\u0069\u0073\u0074;\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0074\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074, \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (\u006E\u0075\u006D > \u006D\u0069\u006E\u0044\u0069\u0073\u0074\u0046\u006F\u0072\u0046\u0061\u0063\u0069\u006E\u0067\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E){\u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E), -1f);}\u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = \u0047\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0046\u006F\u0072\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006E\u0075\u006D);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0041\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(){\u0072\u0065\u0074\u0075\u0072\u006E \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E) < \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E_\u006D\u0069\u006E_\u0064\u0069\u0073\u0074;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0043\u0061\u006C\u0063\u0075\u006C\u0061\u0074\u0065\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065(){\u0069\u0066 (\u0054\u0069\u006D\u0065.\u0066\u0072\u0061\u006D\u0065\u0043\u006F\u0075\u006E\u0074==\u006C\u0061\u0073\u0074\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0043\u0068\u0065\u0063\u006B\u0046\u0072\u0061\u006D\u0065){\u0072\u0065\u0074\u0075\u0072\u006E \u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065;}\u006C\u0061\u0073\u0074\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0043\u0068\u0065\u0063\u006B\u0046\u0072\u0061\u006D\u0065 = \u0054\u0069\u006D\u0065.\u0066\u0072\u0061\u006D\u0065\u0043\u006F\u0075\u006E\u0074;\u0066\u006C\u006F\u0061\u0074 \u0079 = _\u006D\u006F\u0076\u0065\u0054\u0061\u0072\u0067\u0065\u0074.\u0079;\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0057\u0061\u0074\u0065\u0072\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(_\u006D\u006F\u0076\u0065\u0054\u0061\u0072\u0067\u0065\u0074.\u0078, 0, _\u006D\u006F\u0076\u0065\u0054\u0061\u0072\u0067\u0065\u0074.\u007A)), \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(_\u006D\u006F\u0076\u0065\u0054\u0061\u0072\u0067\u0065\u0074.\u0078, 0, _\u006D\u006F\u0076\u0065\u0054\u0061\u0072\u0067\u0065\u0074.\u007A)));\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D2 = \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u0079, \u006E\u0075\u006D + \u0068\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074);\u0069\u0066 (\u0061\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0050\u0072\u006F\u0074\u0065\u0063\u0074\u0069\u006F\u006E){\u0056\u0065\u0063\u0074\u006F\u00723 \u0072\u0068\u0073 = (_\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006D\u0061\u0067\u006E\u0069\u0074\u0075\u0064\u0065 < 0.1f) ? \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 : _\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079.\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064;\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 = (\u0056\u0065\u0063\u0074\u006F\u00723.\u0043\u0072\u006F\u0073\u0073(\u0056\u0065\u0063\u0074\u006F\u00723.\u0043\u0072\u006F\u0073\u0073(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0075\u0070, \u0072\u0068\u0073), \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070) + \u0056\u0065\u0063\u0074\u006F\u00723.\u0064\u006F\u0077\u006E * 0.3f).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064;\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074;\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u00742;\u0069\u0066 (\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0053\u0070\u0068\u0065\u0072\u0065\u0043\u0061\u0073\u0074(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E - \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 * 20f, 50f, \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 200f, 1134625043) && \u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0053\u0070\u0068\u0065\u0072\u0065\u0043\u0061\u0073\u0074(\u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074.\u0070\u006F\u0069\u006E\u0074 + \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070 * 200f, 50f, \u0056\u0065\u0063\u0074\u006F\u00723.\u0064\u006F\u0077\u006E, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u00742, 200f, 1134625043)){\u006E\u0075\u006D2 = \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u00742.\u0070\u006F\u0069\u006E\u0074.\u0079 + \u0068\u006F\u0076\u0065\u0072\u0048\u0065\u0069\u0067\u0068\u0074;}}\u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065 = \u006E\u0075\u006D2;\u0072\u0065\u0074\u0075\u0072\u006E \u0061\u006C\u0074\u004F\u0076\u0065\u0072\u0072\u0069\u0064\u0065;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004D\u0061\u0069\u006E\u0074\u0061\u0069\u006E\u0041\u0049\u0041\u006C\u0074\u0075\u0074\u0069\u0064\u0065(){\u0066\u006C\u006F\u0061\u0074 \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(_\u0068\u0065\u006C\u0069.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065 < \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 + 10f){\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065 = \u0067\u0072\u006F\u0075\u006E\u0064\u0068\u0065\u0069\u0067\u0068\u0074 + 15f;}\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u0074\u0072 = \u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + _\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079;\u0066\u006C\u006F\u0061\u0074 \u0076\u0061\u006C\u0075\u0065 = \u004D\u0061\u0074\u0068\u0066.\u0041\u0062\u0073(\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065 - \u0070\u0074\u0072.\u0079);\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u0067 = \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0044\u0065\u0073\u0069\u0072\u0065\u0064\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065 > \u0070\u0074\u0072.\u0079;\u0066\u006C\u006F\u0061\u0074 \u0064 = \u004D\u0061\u0074\u0068\u0066.\u0049\u006E\u0076\u0065\u0072\u0073\u0065\u004C\u0065\u0072\u0070(0f, 12f, \u0076\u0061\u006C\u0075\u0065) * \u0041\u0069\u0041\u006C\u0074\u0069\u0074\u0075\u0064\u0065\u0046\u006F\u0072\u0063\u0065 * (\u0066\u006C\u0061\u0067 ? 1f : -1f);_\u0072\u0062.\u0041\u0064\u0064\u0046\u006F\u0072\u0063\u0065(\u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070 * \u0064, \u0046\u006F\u0072\u0063\u0065\u004D\u006F\u0064\u0065.\u0046\u006F\u0072\u0063\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0050\u006C\u0061\u0079\u0065\u0072\u0056\u0069\u0073\u0069\u0062\u006C\u0065(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070\u006C\u0079){\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006C\u0079.\u0065\u0079\u0065\u0073.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0069\u0066 (\u0054\u004F\u0044_\u0053\u006B\u0079.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0049\u0073\u004E\u0069\u0067\u0068\u0074 && \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0069\u006E\u0074\u0065\u0072\u0065\u0073\u0074\u005A\u006F\u006E\u0065\u004F\u0072\u0069\u0067\u0069\u006E) > 40f){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E - \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070 * 6f;\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0076\u0065\u0063\u0074\u006F\u0072);\u0056\u0065\u0063\u0074\u006F\u00723 \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 = (\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E - \u0076\u0065\u0063\u0074\u006F\u0072).\u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064;\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074;\u0072\u0065\u0074\u0075\u0072\u006E \u0047\u0061\u006D\u0065\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0054\u0072\u0061\u0063\u0065(\u006E\u0065\u0077 \u0052\u0061\u0079(\u0076\u0065\u0063\u0074\u006F\u0072 + \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064 * 5f, \u006E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065\u0064), 0f, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, \u006E\u0075\u006D * 1.1f, 1218652417, \u0051\u0075\u0065\u0072\u0079\u0054\u0072\u0069\u0067\u0067\u0065\u0072\u0049\u006E\u0074\u0065\u0072\u0061\u0063\u0074\u0069\u006F\u006E.\u0055\u0073\u0065\u0047\u006C\u006F\u0062\u0061\u006C) && \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074.\u0063\u006F\u006C\u006C\u0069\u0064\u0065\u0072.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0054\u006F\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079()==\u0070\u006C\u0079;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0055\u0070\u0064\u0061\u0074\u0065\u0054\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074(){\u0056\u0065\u0063\u0074\u006F\u00723 \u0073\u0074\u0072\u0061\u0066\u0065\u0050\u006F\u0073 = \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F;\u0062\u006F\u006F\u006C \u0061\u0074\u0074\u0061\u0063\u006B\u0074\u0061\u0072\u0067\u0065\u0074 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = _\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 - 1;\u0069 >= 0;\u0069--){\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F = _\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074[\u0069];\u0069\u0066 (\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F==\u006E\u0075\u006C\u006C || \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0065\u006E\u0074==\u006E\u0075\u006C\u006C){_\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0052\u0065\u006D\u006F\u0076\u0065(\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F);}\u0065\u006C\u0073\u0065{\u0069\u0066 (\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070 > \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u006E\u0065\u0078\u0074\u004C\u004F\u0053\u0043\u0068\u0065\u0063\u006B){\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u006E\u0065\u0078\u0074\u004C\u004F\u0053\u0043\u0068\u0065\u0063\u006B = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070 + 1f;\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0056\u0069\u0073\u0069\u0062\u006C\u0065(\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0070\u006C\u0079)){\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u006C\u0061\u0073\u0074\u0053\u0065\u0065\u006E\u0054\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070;\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0076\u0069\u0073\u0069\u0062\u006C\u0065\u0046\u006F\u0072 += 1f;}\u0065\u006C\u0073\u0065 {\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0076\u0069\u0073\u0069\u0062\u006C\u0065\u0046\u006F\u0072 = 0f;}}\u0062\u006F\u006F\u006C \u0074\u0061\u0072\u0067\u0065\u0074\u0064\u0065\u0061\u0064 = \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0070\u006C\u0079 ? \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0070\u006C\u0079.\u0049\u0073\u0044\u0065\u0061\u0064() : (\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0065\u006E\u0074.\u0048\u0065\u0061\u006C\u0074\u0068() <= 0f);\u0069\u0066 (\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070 - \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u006C\u0061\u0073\u0074\u0053\u0065\u0065\u006E\u0054\u0069\u006D\u0065 >= 6f || \u0074\u0061\u0072\u0067\u0065\u0074\u0064\u0065\u0061\u0064){\u0069\u0066 (\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070 - \u006C\u0061\u0073\u0074\u0053\u0074\u0072\u0061\u0066\u0065\u0054\u0069\u006D\u0065 >= 5f && _\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 != \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0053\u0054\u0052\u0041\u0046\u0045 && !\u0069\u0073\u0044\u0065\u0061\u0064 && !\u0061\u0074\u0074\u0061\u0063\u006B\u0074\u0061\u0072\u0067\u0065\u0074 && !\u0074\u0061\u0072\u0067\u0065\u0074\u0064\u0065\u0061\u0064 && \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(0f, 1f) >= 0f){\u0061\u0074\u0074\u0061\u0063\u006B\u0074\u0061\u0072\u0067\u0065\u0074 = \u0074\u0072\u0075\u0065;\u0073\u0074\u0072\u0061\u0066\u0065\u0050\u006F\u0073 = \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F.\u0070\u006C\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;}_\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0052\u0065\u006D\u006F\u0076\u0065(\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F);}}}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0069\u006E \u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0061\u0063\u0074\u0069\u0076\u0065\u0050\u006C\u0061\u0079\u0065\u0072\u004C\u0069\u0073\u0074){\u0069\u0066 (!\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0048\u0061\u0073\u0050\u006C\u0061\u0079\u0065\u0072\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0050\u006C\u0061\u0079\u0065\u0072\u0046\u006C\u0061\u0067\u0073.\u0053\u0061\u0066\u0065\u005A\u006F\u006E\u0065) && \u0056\u0065\u0063\u0074\u006F\u00723\u0045\u0078.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u00652\u0044(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) <= \u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0062\u006F\u006F\u006C \u0054\u0061\u0072\u0067\u0065\u0074 = \u0066\u0061\u006C\u0073\u0065;\u0075\u0073\u0069\u006E\u0067 (\u004C\u0069\u0073\u0074<\u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F>.\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072 \u0065\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u00722 = _\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0047\u0065\u0074\u0045\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u0072()){\u0077\u0068\u0069\u006C\u0065 (\u0065\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u00722.\u004D\u006F\u0076\u0065\u004E\u0065\u0078\u0074()){\u0069\u0066 (\u0065\u006E\u0075\u006D\u0065\u0072\u0061\u0074\u006F\u00722.\u0043\u0075\u0072\u0072\u0065\u006E\u0074.\u0070\u006C\u0079==\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072){\u0054\u0061\u0072\u0067\u0065\u0074 = \u0074\u0072\u0075\u0065;\u0062\u0072\u0065\u0061\u006B;}}}\u0069\u0066 (!\u0054\u0061\u0072\u0067\u0065\u0074 && \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072.\u0047\u0065\u0074\u0054\u0068\u0072\u0065\u0061\u0074\u004C\u0065\u0076\u0065\u006C() > \u0054\u0068\u0072\u0065\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074 && \u0050\u006C\u0061\u0079\u0065\u0072\u0056\u0069\u0073\u0069\u0062\u006C\u0065(\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072)){_\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0041\u0064\u0064(\u006E\u0065\u0077 \u0074\u0061\u0072\u0067\u0065\u0074\u0069\u006E\u0066\u006F(\u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072, \u0062\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072));}}}\u0069\u0066 (\u0061\u0074\u0074\u0061\u0063\u006B\u0074\u0061\u0072\u0067\u0065\u0074){\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();\u006C\u0061\u0073\u0074\u0053\u0074\u0072\u0061\u0066\u0065\u0054\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070;_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0053\u0054\u0052\u0041\u0046\u0045;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u00722;\u0069\u0066 (\u0054\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D\u0055\u0074\u0069\u006C.\u0047\u0065\u0074\u0047\u0072\u006F\u0075\u006E\u0064\u0049\u006E\u0066\u006F(\u0073\u0074\u0072\u0061\u0066\u0065\u0050\u006F\u0073, \u006F\u0075\u0074 \u0076\u0065\u0063\u0074\u006F\u0072, \u006F\u0075\u0074 \u0076\u0065\u0063\u0074\u006F\u00722, 100f, 1134625043, \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D)){\u0073\u0074\u0072\u0061\u0066\u0065_\u0074\u0061\u0072\u0067\u0065\u0074_\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0076\u0065\u0063\u0074\u006F\u0072;}\u0065\u006C\u0073\u0065 {\u0073\u0074\u0072\u0061\u0066\u0065_\u0074\u0061\u0072\u0067\u0065\u0074_\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0073\u0074\u0072\u0061\u0066\u0065\u0050\u006F\u0073;}\u0056\u0065\u0063\u0074\u006F\u00723 \u0072\u0061\u006E\u0064\u006F\u006D\u004F\u0066\u0066\u0073\u0065\u0074 = \u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D\u004F\u0066\u0066\u0073\u0065\u0074(\u0073\u0074\u0072\u0061\u0066\u0065\u0050\u006F\u0073, 100f, 192.5f, 20f, 30f);\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0072\u0061\u006E\u0064\u006F\u006D\u004F\u0066\u0066\u0073\u0065\u0074, 10f, 30f);\u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0072\u0061\u006E\u0064\u006F\u006D\u004F\u0066\u0066\u0073\u0065\u0074), -1f);\u0070\u0075\u0074\u0074\u0069\u006E\u0067\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0074\u0072\u0075\u0065;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D\u004F\u0066\u0066\u0073\u0065\u0074(\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0072\u0069\u0067\u0069\u006E, \u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0052\u0061\u006E\u0067\u0065, \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0052\u0061\u006E\u0067\u0065 = 0f, \u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074 = 20f, \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074 = 30f){\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u006E\u0055\u006E\u0069\u0074\u0053\u0070\u0068\u0065\u0072\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u006F\u006E\u0055\u006E\u0069\u0074\u0053\u0070\u0068\u0065\u0072\u0065;\u006F\u006E\u0055\u006E\u0069\u0074\u0053\u0070\u0068\u0065\u0072\u0065.\u0079 = 0f;\u006F\u006E\u0055\u006E\u0069\u0074\u0053\u0070\u0068\u0065\u0072\u0065.\u004E\u006F\u0072\u006D\u0061\u006C\u0069\u007A\u0065();\u006D\u0061\u0078\u0052\u0061\u006E\u0067\u0065 = \u004D\u0061\u0074\u0068\u0066.\u004D\u0061\u0078(\u006D\u0069\u006E\u0052\u0061\u006E\u0067\u0065, \u006D\u0061\u0078\u0052\u0061\u006E\u0067\u0065);\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0072\u0069\u0067\u0069\u006E2 = \u006F\u0072\u0069\u0067\u0069\u006E + \u006F\u006E\u0055\u006E\u0069\u0074\u0053\u0070\u0068\u0065\u0072\u0065 * \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(\u006D\u0069\u006E\u0052\u0061\u006E\u0067\u0065, \u006D\u0061\u0078\u0052\u0061\u006E\u0067\u0065);\u0072\u0065\u0074\u0075\u0072\u006E \u0047\u0065\u0074\u0041\u0070\u0070\u0072\u006F\u0070\u0072\u0069\u0061\u0074\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u006F\u0072\u0069\u0067\u0069\u006E2, \u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074, \u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0047\u0065\u0074\u0041\u0070\u0070\u0072\u006F\u0070\u0072\u0069\u0061\u0074\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0072\u0069\u0067\u0069\u006E, \u0066\u006C\u006F\u0061\u0074 \u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074 = 20f, \u0066\u006C\u006F\u0061\u0074 \u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074 = 30f){\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = 100f;\u0052\u0061\u0079 \u0072\u0061\u0079 = \u006E\u0065\u0077 \u0052\u0061\u0079(\u006F\u0072\u0069\u0067\u0069\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, \u006E\u0075\u006D, 0f), \u0056\u0065\u0063\u0074\u006F\u00723.\u0064\u006F\u0077\u006E);\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D2 = 5f;\u0052\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074;\u0069\u0066 (\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0053\u0070\u0068\u0065\u0072\u0065\u0043\u0061\u0073\u0074(\u0072\u0061\u0079, \u006E\u0075\u006D2, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, \u006E\u0075\u006D * 2f - \u006E\u0075\u006D2, 1134625043)){\u006F\u0072\u0069\u0067\u0069\u006E = \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074.\u0070\u006F\u0069\u006E\u0074;}\u006F\u0072\u0069\u0067\u0069\u006E.\u0079 += \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(\u006D\u0069\u006E\u0048\u0065\u0069\u0067\u0068\u0074, \u006D\u0061\u0078\u0048\u0065\u0069\u0067\u0068\u0074);\u0072\u0065\u0074\u0075\u0072\u006E \u006F\u0072\u0069\u0067\u0069\u006E;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0073\u0074\u0075\u0063\u006B(){\u0056\u0065\u0063\u0074\u006F\u00723 \u0043\u0068\u0065\u0063\u006B\u0070\u006F\u0073 = _\u0068\u0065\u006C\u0069.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0043\u0068\u0065\u0063\u006B\u0070\u006F\u0073.\u0079 = 0;\u0053\u0070\u006F\u0074\u0043\u0068\u0065\u0063\u006B.\u0079 = 0;\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0043\u0068\u0065\u0063\u006B\u0070\u006F\u0073, \u0053\u0070\u006F\u0074\u0043\u0068\u0065\u0063\u006B) < 5f){\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E.\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074 <= 1){\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0070\u006C\u0075\u0067\u0069\u006E.\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D() + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 40f, 0f), 10f, 30f);}\u0065\u006C\u0073\u0065 {\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0070\u006C\u0075\u0067\u0069\u006E.\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073[\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(0, \u0070\u006C\u0075\u0067\u0069\u006E.\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074)], 10f, 30f);}_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004D\u004F\u0056\u0045;}\u0073\u0074\u0075\u0063\u006B\u0063\u0068\u0065\u0063\u006B = \u0066\u0061\u006C\u0073\u0065;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0049\u0054\u0068\u0069\u006E\u006B(){\u0066\u006C\u006F\u0061\u0074 \u0074\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070;\u0066\u006C\u006F\u0061\u0074 \u0074\u0069\u006D\u0065\u0050\u0061\u0073\u0073\u0065\u0064 = \u0074\u0069\u006D\u0065 - _\u006C\u0061\u0073\u0074\u0054\u0068\u0069\u006E\u006B\u0054\u0069\u006D\u0065;_\u006C\u0061\u0073\u0074\u0054\u0068\u0069\u006E\u006B\u0054\u0069\u006D\u0065 = \u0074\u0069\u006D\u0065;\u0069\u0066 (!\u0073\u0074\u0075\u0063\u006B\u0063\u0068\u0065\u0063\u006B){\u0053\u0070\u006F\u0074\u0043\u0068\u0065\u0063\u006B = _\u0068\u0065\u006C\u0069.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0073\u0074\u0075\u0063\u006B\u0063\u0068\u0065\u0063\u006B = \u0074\u0072\u0075\u0065;\u0049\u006E\u0076\u006F\u006B\u0065("\u0073\u0074\u0075\u0063\u006B", 10f);}\u0073\u0077\u0069\u0074\u0063\u0068 (_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065){\u0064\u0065\u0066\u0061\u0075\u006C\u0074:\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0050\u0041\u0054\u0052\u004F\u004C;\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E = \u0070\u006C\u0075\u0067\u0069\u006E.\u0061\u0069\u0072\u006E\u006F\u0064\u0065\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D();\u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E), -1f);\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004D\u004F\u0056\u0045:\u0066\u006C\u006F\u0061\u0074 \u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074 = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E);\u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = \u0047\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0046\u006F\u0072\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0064\u0069\u0073\u0074\u0054\u006F\u0054\u0061\u0072\u0067\u0065\u0074);\u0069\u0066 (\u0041\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E()){\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0049\u0044\u004C\u0045;}\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004F\u0052\u0042\u0049\u0054:\u0053\u0074\u0061\u0074\u0065_\u004F\u0072\u0062\u0069\u0074_\u0054\u0068\u0069\u006E\u006B(\u0074\u0069\u006D\u0065\u0050\u0061\u0073\u0073\u0065\u0064);\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0053\u0054\u0052\u0041\u0046\u0045:\u0069\u0066 (\u0070\u0075\u0074\u0074\u0069\u006E\u0067\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0069\u0066 (\u0041\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E()){\u0070\u0075\u0074\u0074\u0069\u006E\u0067\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0073\u0074\u0072\u0061\u0066\u0065_\u0074\u0061\u0072\u0067\u0065\u0074_\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 40f, 0f), 10f, 30f);\u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0073\u0074\u0072\u0061\u0066\u0065_\u0074\u0061\u0072\u0067\u0065\u0074_\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E), -1f);\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0065\u006C\u0073\u0065 {\u0053\u0065\u0074\u0049\u0064\u0065\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u0059\u0061\u0077\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E\u0054\u006F(\u0073\u0074\u0072\u0061\u0066\u0065_\u0074\u0061\u0072\u0067\u0065\u0074_\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E), -1f);}\u0072\u0065\u0074\u0075\u0072\u006E;\u0063\u0061\u0073\u0065 \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0050\u0041\u0054\u0052\u004F\u004C:\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E);\u0069\u0066 (\u006E\u0075\u006D <= 25f){\u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = \u0047\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0046\u006F\u0072\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006E\u0075\u006D);}\u0065\u006C\u0073\u0065 {\u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = 0.5f;}\u0069\u0066 (\u0041\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E()){\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();\u0053\u0074\u0061\u0074\u0065_\u004F\u0072\u0062\u0069\u0074_\u0045\u006E\u0074\u0065\u0072();}\u0069\u0066 (_\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 > 0){\u0069\u006E\u0074\u0065\u0072\u0065\u0073\u0074\u005A\u006F\u006E\u0065\u004F\u0072\u0069\u0067\u0069\u006E = _\u0074\u0061\u0072\u0067\u0065\u0074\u004C\u0069\u0073\u0074[0].\u0070\u006C\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 20f, 0f);\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();\u0053\u0074\u0061\u0074\u0065_\u004F\u0072\u0062\u0069\u0074_\u0045\u006E\u0074\u0065\u0072();}\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0074\u0061\u0074\u0065_\u004F\u0072\u0062\u0069\u0074_\u0054\u0068\u0069\u006E\u006B(\u0066\u006C\u006F\u0061\u0074 \u0074\u0069\u006D\u0065\u0050\u0061\u0073\u0073\u0065\u0064){\u0069\u0066 (\u0062\u0072\u0065\u0061\u006B\u0069\u006E\u0067\u004F\u0072\u0062\u0069\u0074){\u0069\u0066 (\u0041\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E()){\u0045\u0078\u0069\u0074\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065();_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u0049\u0044\u004C\u0045;}}\u0065\u006C\u0073\u0065{\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723\u0045\u0078.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u00652\u0044(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E) > 15f){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0068\u0061\u0073\u0045\u006E\u0074\u0065\u0072\u0065\u0064\u004F\u0072\u0062\u0069\u0074){\u0068\u0061\u0073\u0045\u006E\u0074\u0065\u0072\u0065\u0064\u004F\u0072\u0062\u0069\u0074 = \u0074\u0072\u0075\u0065;\u006F\u0072\u0062\u0069\u0074\u0053\u0074\u0061\u0072\u0074\u0054\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070;}\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D = 6.28318548f * \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D2 = 0.5f * \u006D\u0061\u0078\u0053\u0070\u0065\u0065\u0064;\u0066\u006C\u006F\u0061\u0074 \u006E\u0075\u006D3 = \u006E\u0075\u006D / \u006E\u0075\u006D2;\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0054\u0069\u006D\u0065 += \u0074\u0069\u006D\u0065\u0050\u0061\u0073\u0073\u0065\u0064 / (\u006E\u0075\u006D3 * 1.01f);\u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0074\u0065 = \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0054\u0069\u006D\u0065;\u0056\u0065\u0063\u0074\u006F\u00723 \u006F\u0072\u0062\u0069\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0047\u0065\u0074\u004F\u0072\u0062\u0069\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u0072\u0061\u0074\u0065);\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u006F\u0072\u0062\u0069\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 0f, 1f);\u0074\u0061\u0072\u0067\u0065\u0074\u0054\u0068\u0072\u006F\u0074\u0074\u006C\u0065\u0053\u0070\u0065\u0065\u0064 = 0.5f;}\u0069\u0066 (\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070 - \u006F\u0072\u0062\u0069\u0074\u0053\u0074\u0061\u0072\u0074\u0054\u0069\u006D\u0065 > \u006D\u0061\u0078\u004F\u0072\u0062\u0069\u0074\u0044\u0075\u0072\u0061\u0074\u0069\u006F\u006E && !\u0062\u0072\u0065\u0061\u006B\u0069\u006E\u0067\u004F\u0072\u0062\u0069\u0074){\u0062\u0072\u0065\u0061\u006B\u0069\u006E\u0067\u004F\u0072\u0062\u0069\u0074 = \u0074\u0072\u0075\u0065;\u0056\u0065\u0063\u0074\u006F\u00723 \u0061\u0070\u0070\u0072\u006F\u0070\u0072\u0069\u0061\u0074\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0047\u0065\u0074\u0041\u0070\u0070\u0072\u006F\u0070\u0072\u0069\u0061\u0074\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064 * 75f, 40f, 50f);\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0061\u0070\u0070\u0072\u006F\u0070\u0072\u0069\u0061\u0074\u0065\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 10f, 0f);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u0047\u0065\u0074\u004F\u0072\u0062\u0069\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u0066\u006C\u006F\u0061\u0074 \u0072\u0061\u0074\u0065){\u0066\u006C\u006F\u0061\u0074 \u0078 = \u004D\u0061\u0074\u0068\u0066.\u0053\u0069\u006E(6.28318548f * \u0072\u0061\u0074\u0065) * \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0066\u006C\u006F\u0061\u0074 \u007A = \u004D\u0061\u0074\u0068\u0066.\u0043\u006F\u0073(6.28318548f * \u0072\u0061\u0074\u0065) * \u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(\u0078, 20f, \u007A);\u0076\u0065\u0063\u0074\u006F\u0072 = \u0069\u006E\u0074\u0065\u0072\u0065\u0073\u0074\u005A\u006F\u006E\u0065\u004F\u0072\u0069\u0067\u0069\u006E + \u0076\u0065\u0063\u0074\u006F\u0072;\u0072\u0065\u0074\u0075\u0072\u006E \u0076\u0065\u0063\u0074\u006F\u0072;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0074\u0061\u0074\u0065_\u004F\u0072\u0062\u0069\u0074_\u0045\u006E\u0074\u0065\u0072(){_\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0074\u0061\u0074\u0065 = \u0061\u0069\u0053\u0074\u0061\u0074\u0065.\u004F\u0052\u0042\u0049\u0054;\u0062\u0072\u0065\u0061\u006B\u0069\u006E\u0067\u004F\u0072\u0062\u0069\u0074 = \u0066\u0061\u006C\u0073\u0065;\u0068\u0061\u0073\u0045\u006E\u0074\u0065\u0072\u0065\u0064\u004F\u0072\u0062\u0069\u0074 = \u0066\u0061\u006C\u0073\u0065;\u006F\u0072\u0062\u0069\u0074\u0053\u0074\u0061\u0072\u0074\u0054\u0069\u006D\u0065 = \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0054\u0069\u006D\u0065.\u0072\u0065\u0061\u006C\u0074\u0069\u006D\u0065\u0053\u0069\u006E\u0063\u0065\u0053\u0074\u0061\u0072\u0074\u0075\u0070;\u0056\u0065\u0063\u0074\u006F\u00723 \u0076\u0065\u0063\u0074\u006F\u0072 = \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E - \u0069\u006E\u0074\u0065\u0072\u0065\u0073\u0074\u005A\u006F\u006E\u0065\u004F\u0072\u0069\u0067\u0069\u006E;\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0054\u0069\u006D\u0065 = \u004D\u0061\u0074\u0068\u0066.\u0041\u0074\u0061\u006E2(\u0076\u0065\u0063\u0074\u006F\u0072.\u0078, \u0076\u0065\u0063\u0074\u006F\u0072.\u007A);\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u006F\u0072\u0062\u0069\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0053\u0065\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0047\u0065\u0074\u004F\u0072\u0062\u0069\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E(\u0063\u0075\u0072\u0072\u0065\u006E\u0074\u004F\u0072\u0062\u0069\u0074\u0054\u0069\u006D\u0065), 20f, 0f);}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0063\u006C\u0061\u0073\u0073 \u004C\u0061\u006E\u0064\u0050\u0069\u0072\u0061\u0074\u0065 : \u004D\u006F\u006E\u006F\u0042\u0065\u0068\u0061\u0076\u0069\u006F\u0075\u0072{\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065 _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0053\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065 \u0073\u006D;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0041\u0067\u0065\u006E\u0074 \u0061\u0067\u0065\u006E\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063;\u0070\u0075\u0062\u006C\u0069\u0063 \u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u0074\u0065\u006D\u0062\u006F\u0078;\u0070\u0075\u0062\u006C\u0069\u0063 \u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079 \u0072\u0062;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0066\u0072\u006F\u007A\u0065\u006E = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0069\u0073\u006C\u0065\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0043\u0061\u006E\u0052\u006F\u0061\u006D;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u004E\u0065\u0078\u0074\u0052\u006F\u0061\u006D\u0054\u0069\u0063\u006B;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u004D\u006F\u0076\u0065\u0044\u0065\u006C\u0061\u0079;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0046\u0069\u006E\u0064\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0050\u0075\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u006E\u0070\u0063\u0068\u0065\u0061\u006C\u0074\u0068;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0072\u0069\u0064\u0061\u0062\u006C\u0065\u0068\u0065\u0061\u006C\u0074\u0068;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = "";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0069\u006E\u0074 \u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = 1;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0073\u0074\u0072\u0069\u006E\u0067 \u004B\u0069\u0074 = "";\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0066\u006C\u006F\u0061\u0074 \u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004E\u0069\u0067\u0068\u0074\u004C\u0069\u0067\u0068\u0074 \u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0050\u006F\u0069\u006E\u0074\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074;\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0054\u0079\u0070\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079 _\u0072\u0062;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u006E\u0070\u0075\u0074\u0053\u0074\u0061\u0074\u0065 \u0069\u006E\u0070\u0075\u0074 = \u006E\u0065\u0077 \u0049\u006E\u0070\u0075\u0074\u0053\u0074\u0061\u0074\u0065();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0049\u006E\u0070\u0075\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065 \u0069\u006D = \u006E\u0065\u0077 \u0049\u006E\u0070\u0075\u0074\u004D\u0065\u0073\u0073\u0061\u0067\u0065();\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0049\u0073\u004D\u006F\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0056\u0065\u0063\u0074\u006F\u00723 \u006C\u0061\u0073\u0074\u0070\u006F\u0073;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0062\u006F\u006F\u006C \u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0077\u0061\u006B\u0065(){\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0054\u0069\u0063\u006B(() =>{\u0074\u0072\u0079 {_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065 = \u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065>();} \u0063\u0061\u0074\u0063\u0068 {\u0044\u0069\u0065();}\u0074\u0072\u0079 {\u0072\u0062 = \u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0052\u0069\u0067\u0069\u0064\u0062\u006F\u0064\u0079>();} \u0063\u0061\u0074\u0063\u0068 {}\u0061\u0067\u0065\u006E\u0074 = _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0067\u0061\u006D\u0065\u004F\u0062\u006A\u0065\u0063\u0074.\u0041\u0064\u0064\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0041\u0067\u0065\u006E\u0074>();_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0065\u006E\u0061\u0062\u006C\u0065\u0053\u0061\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;\u004D\u006F\u0076\u0065\u0044\u0065\u006C\u0061\u0079 = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065;\u004E\u0065\u0078\u0074\u0052\u006F\u0061\u006D\u0054\u0069\u0063\u006B = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065 + 5;\u0073\u0077\u0069\u0074\u0063\u0068 (\u0054\u0079\u0070\u0065){\u0063\u0061\u0073\u0065 4:\u006E\u0070\u0063\u0068\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u0072\u0069\u0064\u0061\u0062\u006C\u0065\u0068\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u0048\u0065\u0061\u006C\u0074\u0068;\u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065;\u0043\u0061\u006E\u0052\u006F\u0061\u006D = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u0043\u0061\u006E\u0052\u006F\u0061\u006D;\u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064;\u004B\u0069\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u004B\u0069\u0074;\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069;\u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u004C\u006F\u006F\u0074;\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0048\u006F\u0072\u0073\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0052\u0069\u0064\u0061\u0062\u006C\u0065\u0048\u006F\u0072\u0073\u0065 \u0068\u006F\u0072\u0073\u0065 = _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065 \u0061\u0073 \u0052\u0069\u0064\u0061\u0062\u006C\u0065\u0048\u006F\u0072\u0073\u0065;\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u0068\u006F\u0072\u0073\u0065.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079;\u0041\u0074\u0074\u0061\u0063\u0068\u004C\u0069\u0067\u0068\u0074();\u0062\u0072\u0065\u0061\u006B;\u0063\u0061\u0073\u0065 5:\u006E\u0070\u0063\u0068\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068;\u0072\u0069\u0064\u0061\u0062\u006C\u0065\u0068\u0065\u0061\u006C\u0074\u0068 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0048\u0065\u0061\u006C\u0074\u0068;\u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065;\u0043\u0061\u006E\u0052\u006F\u0061\u006D = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0043\u0061\u006E\u0052\u006F\u0061\u006D;\u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064;\u004B\u0069\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004B\u0069\u0074;\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069;\u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004C\u006F\u006F\u0074;\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069 = _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069;\u0073\u006D = _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065 \u0061\u0073 \u0053\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065;\u0069\u006D.\u0062\u0075\u0074\u0074\u006F\u006E\u0073 = 2;\u0069\u006E\u0070\u0075\u0074.\u0063\u0075\u0072\u0072\u0065\u006E\u0074 = \u0069\u006D;\u0073\u006D.\u0065\u006E\u0067\u0069\u006E\u0065\u004B\u0057 = 50;\u0073\u006D.\u0063\u006F\u006C\u006C\u0069\u0073\u0069\u006F\u006E\u0045\u0066\u0066\u0065\u0063\u0074.\u0067\u0075\u0069\u0064 = \u006E\u0075\u006C\u006C;\u0073\u006D.\u0062\u0061\u0064\u0054\u0065\u0072\u0072\u0061\u0069\u006E\u0044\u0072\u0061\u0067 = 0.5f;\u0073\u006D.\u0069\u0064\u006C\u0065\u0046\u0075\u0065\u006C\u0050\u0065\u0072\u0053\u0065\u0063 = 0f;\u0073\u006D.\u006D\u0061\u0078\u0046\u0075\u0065\u006C\u0050\u0065\u0072\u0053\u0065\u0063 = 0f;\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 = \u0073\u006D.\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0053\u0079\u0073\u0074\u0065\u006D()?.\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072();\u0069\u0066 (\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0041\u0064\u0064\u0049\u0074\u0065\u006D(\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0061\u006C\u006C\u006F\u0077\u0065\u0064\u0049\u0074\u0065\u006D, 1);\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004C\u006F\u0063\u006B\u0065\u0064, \u0074\u0072\u0075\u0065);}\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u0073\u006D.\u0047\u0065\u0074\u0049\u0074\u0065\u006D\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072().\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\