\u0065\u0063\u0074\u006F\u00723(0, 5, 0), 10f, \u0056\u0065\u0063\u0074\u006F\u00723.\u0064\u006F\u0077\u006E, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 10f, 1134625043) || \u0050\u0068\u0079\u0073\u0069\u0063\u0073.\u0053\u0070\u0068\u0065\u0072\u0065\u0043\u0061\u0073\u0074(\u0061\u0067\u0065\u006E\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 5, 0), 10f, \u0056\u0065\u0063\u0074\u006F\u00723.\u0075\u0070, \u006F\u0075\u0074 \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074, 10f, 1134625043)){\u0061\u0067\u0065\u006E\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0072\u0061\u0079\u0063\u0061\u0073\u0074\u0048\u0069\u0074.\u0070\u006F\u0069\u006E\u0074;\u0061\u0067\u0065\u006E\u0074.\u0061\u0072\u0065\u0061\u004D\u0061\u0073\u006B = 1134625043;\u0061\u0067\u0065\u006E\u0074.\u0061\u0067\u0065\u006E\u0074\u0054\u0079\u0070\u0065\u0049\u0044 = -1372625422;\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0044\u0072\u006F\u0070\u004C\u006F\u006F\u0074(){\u0069\u0066 (\u0073\u006D != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0044\u0072\u006F\u0070("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u006D\u0069\u0073\u0063/\u0069\u0074\u0065\u006D \u0064\u0072\u006F\u0070/\u0069\u0074\u0065\u006D_\u0064\u0072\u006F\u0070_\u0062\u0075\u006F\u0079\u0061\u006E\u0074.\u0070\u0072\u0065\u0066\u0061\u0062", _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 5, 0), _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0053\u0065\u0072\u0076\u0065\u0072\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E);\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u006E\u0075\u006C\u006C;}} }\u0076\u006F\u0069\u0064 \u0042\u0061\u0069\u006C\u006F\u0075\u0074(){\u0044\u0072\u006F\u0070\u004C\u006F\u006F\u0074();\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0069\u006C\u004F\u0075\u0074(_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006E\u0070\u0063, 3);\u006E\u0070\u0063 = \u006E\u0075\u006C\u006C;}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0046\u0069\u0078\u0065\u0064\u0055\u0070\u0064\u0061\u0074\u0065(){\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065==\u006E\u0075\u006C\u006C || \u0072\u0062==\u006E\u0075\u006C\u006C || \u0069\u0073\u006C\u0065\u0061\u0076\u0069\u006E\u0067){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0074\u0072\u0079{\u0069\u0066 (!\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065){\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065 = \u0074\u0072\u0075\u0065;}\u0065\u006C\u0073\u0065{\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C || \u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 || !_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0049\u0073\u004D\u006F\u0075\u006E\u0074\u0065\u0064()){\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065 != \u006E\u0075\u006C\u006C){_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E, \u0066\u0061\u006C\u0073\u0065);} \u0072\u0065\u0074\u0075\u0072\u006E;}\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0066\u006C\u006F\u0061\u0074 \u0047\u0072\u006F\u0075\u006E\u0064\u0048 = \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0079 + 0.5f < \u0047\u0072\u006F\u0075\u006E\u0064\u0048){_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u0078, \u0047\u0072\u006F\u0075\u006E\u0064\u0048 + 0.5f, _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E.\u007A);}\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0057\u0061\u0074\u0065\u0072\u0046\u0061\u0063\u0074\u006F\u0072() > 0.4f){_\u0072\u0062.\u0076\u0065\u006C\u006F\u0063\u0069\u0074\u0079 *= -1;}\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0057\u0061\u0074\u0065\u0072\u0046\u0061\u0063\u0074\u006F\u0072() > 0.6f){\u0045\u0078\u0070\u006C\u006F\u0064\u0065();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0048\u0065\u0061\u006C\u0074\u0068() <= 40){\u0042\u0061\u0069\u006C\u006F\u0075\u0074();}\u0069\u0066 (_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0048\u0065\u0061\u006C\u0074\u0068() <= 10){\u0045\u0078\u0070\u006C\u006F\u0064\u0065();}\u0069\u0066 (\u0073\u006D != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0061\u0067\u0065\u006E\u0074==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0061\u0067\u0065\u006E\u0074.\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E, \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) > 8 && \u0049\u0073\u004D\u006F\u0076\u0069\u006E\u0067){\u0069\u006D.\u0062\u0075\u0074\u0074\u006F\u006E\u0073 = 2;}\u0065\u006C\u0073\u0065 {\u0069\u006D.\u0062\u0075\u0074\u0074\u006F\u006E\u0073 = 0;\u0049\u0073\u004D\u006F\u0076\u0069\u006E\u0067 = \u0066\u0061\u006C\u0073\u0065;}\u0073\u006D.\u0050\u006C\u0061\u0079\u0065\u0072\u0053\u0065\u0072\u0076\u0065\u0072\u0049\u006E\u0070\u0075\u0074(\u0069\u006E\u0070\u0075\u0074, \u006E\u0070\u0063);\u0073\u006D.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0053\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E, \u0074\u0072\u0075\u0065);}\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0066\u006C\u006F\u0061\u0074 \u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0069\u0066 (!\u0050\u0075\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 && \u0064\u0069\u0073\u0074\u0061\u006E\u0063\u0065 < 10){\u0050\u0075\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0074\u0072\u0075\u0065;\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(8f, () =>{\u0050\u0075\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065 = \u0066\u0061\u006C\u0073\u0065;});}\u0069\u0066 (\u0050\u0075\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065){\u0069\u0066 (\u0046\u0069\u006E\u0064\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074 < \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065){\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0069\u006E\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0046\u0069\u006E\u0064\u004E\u0061\u0076\u0050\u006F\u0069\u006E\u0074\u0073(\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 20).\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D();\u0073\u0065\u0074\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0070\u006F\u0069\u006E\u0074, 6f);\u0046\u0069\u006E\u0064\u0069\u006E\u0067\u0050\u006F\u0069\u006E\u0074 = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065 + 5;}\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u004D\u006F\u0076\u0065\u0044\u0065\u006C\u0061\u0079 < \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065){\u004D\u006F\u0076\u0065\u0044\u0065\u006C\u0061\u0079 = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065 + 5;\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) > 20){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0053\u0065\u0074\u0041\u0069\u006D\u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E(\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E - \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}\u0073\u0065\u0074\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 8f);}}}\u0065\u006C\u0073\u0065{\u0069\u0066 (\u0043\u0061\u006E\u0052\u006F\u0061\u006D && \u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && \u004E\u0065\u0078\u0074\u0052\u006F\u0061\u006D\u0054\u0069\u0063\u006B < \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065){\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u006C\u0061\u0073\u0074\u0070\u006F\u0073, _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E) < 5f){\u0049\u0073\u004D\u006F\u0076\u0069\u006E\u0067 = \u0074\u0072\u0075\u0065;}\u006C\u0061\u0073\u0074\u0070\u006F\u0073 = _\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u004E\u0065\u0078\u0074\u0052\u006F\u0061\u006D\u0054\u0069\u0063\u006B = \u0054\u0069\u006D\u0065.\u0074\u0069\u006D\u0065 + \u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(10, 30);\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u006F\u0069\u006E\u0074\u0073\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074.\u0043\u006F\u0075\u006E\u0074 != 0){\u0056\u0065\u0063\u0074\u006F\u00723 \u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0067\u0065\u0074\u0050\u004F\u0049(\u006C\u0061\u0073\u0074\u0070\u006F\u0073, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0073\u004C\u0061\u006E\u0064\u0050\u004F\u0049\u0052\u0061\u0064\u0069\u0075\u0073);\u0069\u0066 (\u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074 != \u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F && \u0054\u0065\u0072\u0072\u0061\u0069\u006E\u004D\u0065\u0074\u0061.\u0048\u0065\u0069\u0067\u0068\u0074\u004D\u0061\u0070.\u0047\u0065\u0074\u0048\u0065\u0069\u0067\u0068\u0074(\u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074) > 5f){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0053\u0065\u0074\u0041\u0069\u006D\u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E(\u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074 - \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}\u0073\u0065\u0074\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0050\u006F\u0069\u006E\u0074\u004F\u0066\u0049\u006E\u0074\u0072\u0065\u0073\u0074, \u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064);\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0069\u0066 (\u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0050\u006F\u0069\u006E\u0074\u0073 != \u006E\u0075\u006C\u006C && \u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0050\u006F\u0069\u006E\u0074\u0073.\u0043\u006F\u0075\u006E\u0074 > 0){\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0069\u006E\u0074 = \u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0050\u006F\u0069\u006E\u0074\u0073.\u0047\u0065\u0074\u0052\u0061\u006E\u0064\u006F\u006D();\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C){\u006E\u0070\u0063.\u0053\u0065\u0074\u0041\u0069\u006D\u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E(\u0070\u006F\u0069\u006E\u0074 - \u006E\u0070\u0063.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u006E\u0070\u0063.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}\u0073\u0065\u0074\u0064\u0065\u0073\u0074\u0069\u006E\u0061\u0074\u0069\u006F\u006E(\u0070\u006F\u0069\u006E\u0074, \u004D\u006F\u0076\u0065\u0053\u0070\u0065\u0065\u0064);}\u0065\u006C\u0073\u0065 {\u004E\u0061\u0076\u004D\u0065\u0073\u0068\u0050\u006F\u0069\u006E\u0074\u0073 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0046\u0069\u006E\u0064\u004E\u0061\u0076\u0050\u006F\u0069\u006E\u0074\u0073(_\u0072\u0069\u0064\u0065\u0061\u0062\u006C\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0052\u006F\u006D\u0065\u0052\u0061\u006E\u0067\u0065);}}}}\u0069\u0066 (\u0073\u006D != \u006E\u0075\u006C\u006C){\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u004C\u0061\u006E\u0064\u006C\u0069\u0067\u0068\u0074\u0073){\u0073\u006D.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0053\u006E\u006F\u0077\u006D\u006F\u0062\u0069\u006C\u0065.\u0046\u006C\u0061\u0067_\u0048\u0065\u0061\u0064\u006C\u0069\u0067\u0068\u0074\u0073, \u0054\u004F\u0044_\u0053\u006B\u0079.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0049\u0073\u004E\u0069\u0067\u0068\u0074);}}\u0065\u006C\u0073\u0065 {\u0069\u0066 (!_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0044\u0069\u0073\u0061\u0062\u006C\u0065\u004C\u0061\u006E\u0064\u006C\u0069\u0067\u0068\u0074\u0073){\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E, \u0054\u004F\u0044_\u0053\u006B\u0079.\u0049\u006E\u0073\u0074\u0061\u006E\u0063\u0065.\u0049\u0073\u004E\u0069\u0067\u0068\u0074);\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0055\u0070\u0064\u0061\u0074\u0065\u0048\u0061\u0073\u0050\u006F\u0077\u0065\u0072(\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074._\u006C\u0069\u0067\u0068\u0074.\u0049\u0073\u004F\u006E() ? 10 : 0, 1);}}}}\u0063\u0061\u0074\u0063\u0068 {}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0044\u0065\u0073\u0074\u0072\u006F\u0079(){\u0074\u0072\u0079{\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065();\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0061\u0064()){\u006E\u0070\u0063.\u0044\u0069\u0065();}\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072 != \u006E\u0075\u006C\u006C && !\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u0065\u0072.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0073\u0065\u0061\u0072\u0063\u0068\u004C\u0069\u0067\u0068\u0074.\u0072\u0065\u0073\u0069\u007A\u