\u0072.\u0067\u0072\u006F\u0075\u006E\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0067\u0064\u006F\u006F\u0072.\u0070\u0069\u0063\u006B\u0075\u0070.\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0067\u0064\u006F\u006F\u0072.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(_\u0074\u0072\u0061\u0069\u006E);\u0067\u0064\u006F\u006F\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 1.523f, -11.349f);\u0067\u0064\u006F\u006F\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(\u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 90.000f, 0));\u0067\u0064\u006F\u006F\u0072.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065(\u0074\u0072\u0075\u0065);\u0062\u0072\u0065\u0061\u006B;}\u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065(2f);\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0066\u0069\u006C\u006C\u006C\u006F\u006F\u0074(\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079, -1, \u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069, \u0052\u0061\u006E\u0064\u006F\u006D\u004C\u006F\u006F\u0074);}\u006E\u0070\u0063\u0073 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u004E\u0050\u0043\u0073(\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074, \u0054\u0079\u0070\u0065, \u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068, \u004B\u0069\u0074, \u0041\u0049\u0053\u0068\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069\u0070\u006C\u0079\u0065\u0072, _\u0074\u0072\u0061\u0069\u006E, \u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E);\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u0069\u0072\u0061\u0074\u0065.\u0041\u0064\u0064(_\u0074\u0072\u0061\u0069\u006E.\u006E\u0065\u0074.\u0049\u0044);_\u0074\u0072\u0061\u0069\u006E\u0045\u006E\u0067\u0069\u006E\u0065.\u0041\u0074\u0074\u0065\u006D\u0070\u0074\u004D\u006F\u0075\u006E\u0074(\u006E\u0070\u0063\u0073[0], \u0066\u0061\u006C\u0073\u0065);_\u0074\u0072\u0061\u0069\u006E\u0045\u006E\u0067\u0069\u006E\u0065.\u0065\u006E\u0067\u0069\u006E\u0065\u0043\u006F\u006E\u0074\u0072\u006F\u006C\u006C\u0065\u0072.\u0054\u0072\u0079\u0053\u0074\u0061\u0072\u0074\u0045\u006E\u0067\u0069\u006E\u0065(\u006E\u0070\u0063\u0073[0]);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(\u0043\u006F\u0072\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(2, 10), \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065);\u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 = (_\u0074\u0072\u0061\u0069\u006E \u0061\u0073 \u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065).\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0053\u0079\u0073\u0074\u0065\u006D().\u0047\u0065\u0074\u0046\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072();\u0069\u0066 (\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 != \u006E\u0075\u006C\u006C){\u0066\u0075\u0065\u006C\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004C\u006F\u0063\u006B\u0065\u0064, \u0074\u0072\u0075\u0065);}});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u006C\u0065\u0061\u0076\u0065\u0069\u006E\u0067(){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, \u006C\u0065\u0061\u0076\u0065\u0069\u006E\u0067);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0049\u006E\u0076\u0061\u006C\u0069\u0064\u0061\u0074\u0065\u0043\u0068\u0065\u0063\u006B(_\u0074\u0072\u0061\u0069\u006E);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(60f, \u0044\u0069\u0065);}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u006D\u006F\u0076\u0065\u0074\u0072\u0061\u0069\u006E(){\u0056\u0065\u0063\u0074\u006F\u00723 \u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E = \u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0066\u006F\u0072\u0077\u0061\u0072\u0064;\u0054\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065 \u0070\u0072\u0065\u0066\u0065\u0072\u0072\u0065\u0064\u0041\u006C\u0074\u0054\u0072\u0061\u0063\u006B = (_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0052\u0065\u0061\u0072\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u0063\u0074\u0069\u006F\u006E != _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u0063\u0074\u0069\u006F\u006E) ? _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0052\u0065\u0061\u0072\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u0063\u0074\u0069\u006F\u006E : \u006E\u0075\u006C\u006C;\u0054\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065 \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065;\u0062\u006F\u006F\u006C \u0066\u006C\u0061\u0067;_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074 = _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u0063\u0074\u0069\u006F\u006E.\u0047\u0065\u0074\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074\u0041\u0066\u0074\u0065\u0072\u004D\u006F\u0076\u0065(_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074, \u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E, 1, _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0063\u0075\u0072\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u006C\u0065\u0063\u0074\u0069\u006F\u006E, \u006F\u0075\u0074 \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065, \u006F\u0075\u0074 \u0066\u006C\u0061\u0067, \u0070\u0072\u0065\u0066\u0065\u0072\u0072\u0065\u0064\u0041\u006C\u0074\u0054\u0072\u0061\u0063\u006B);\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0061\u0072\u0067\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0054\u0061\u006E\u0067\u0065\u006E\u0074;\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0041\u006E\u0064\u0054\u0061\u006E\u0067\u0065\u006E\u0074 = \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065.\u0047\u0065\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0041\u006E\u0064\u0054\u0061\u006E\u0067\u0065\u006E\u0074(_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074, \u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E, \u006F\u0075\u0074 \u0074\u0061\u0072\u0067\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0054\u0061\u006E\u0067\u0065\u006E\u0074);_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0053\u0065\u0074\u0054\u0068\u0065\u0052\u0065\u0073\u0074\u0046\u0072\u006F\u006D\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0044\u0061\u0074\u0061(\u0072\u0065\u0066 \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0041\u006E\u0064\u0054\u0061\u006E\u0067\u0065\u006E\u0074, \u0074\u0061\u0072\u0067\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0054\u0061\u006E\u0067\u0065\u006E\u0074);_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u0063\u0074\u0069\u006F\u006E = \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065;\u0066\u006C\u006F\u0061\u0074 \u0066\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074;\u0069\u0066 (\u0054\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065.\u0054\u0072\u0079\u0046\u0069\u006E\u0064\u0054\u0072\u0061\u0063\u006B\u004E\u0065\u0061\u0072\u0062\u0079(_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0047\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0050\u006F\u0073(), 2f, \u006F\u0075\u0074 \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065, \u006F\u0075\u0074 \u0066\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074) && \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065.\u0048\u0061\u0073\u0043\u006C\u0065\u0061\u0072\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0061\u0063\u0065\u004E\u0065\u0061\u0072(_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072)){_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074 = \u0066\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074;\u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0041\u006E\u0064\u0054\u0061\u006E\u0067\u0065\u006E\u00742 = \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065.\u0047\u0065\u0074\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0041\u006E\u0064\u0054\u0061\u006E\u0067\u0065\u006E\u0074(_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0053\u0070\u006C\u0069\u006E\u0065\u0044\u0069\u0073\u0074, \u0044\u0069\u0072\u0065\u0063\u0074\u0069\u006F\u006E, \u006F\u0075\u0074 \u0074\u0061\u0072\u0067\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0054\u0061\u006E\u0067\u0065\u006E\u0074);_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0053\u0065\u0074\u0054\u0068\u0065\u0052\u0065\u0073\u0074\u0046\u0072\u006F\u006D\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0044\u0061\u0074\u0061(\u0072\u0065\u0066 \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065, \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E\u0041\u006E\u0064\u0054\u0061\u006E\u0067\u0065\u006E\u00742, \u0074\u0061\u0072\u0067\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0054\u0061\u006E\u0067\u0065\u006E\u0074);_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0046\u0072\u006F\u006E\u0074\u0054\u0072\u0061\u0063\u006B\u0053\u0065\u0063\u0074\u0069\u006F\u006E = \u0074\u0072\u0061\u0069\u006E\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u006C\u0069\u006E\u0065;\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0044\u0065\u0073\u0074\u0072\u006F\u0079(){\u0074\u0072\u0079{\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065();\u0069\u0066 (\u006E\u0070\u0063\u0073 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0061\u0064()){\u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}} }\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E != \u006E\u0075\u006C\u006C && !_\u0074\u0072\u0061\u0069\u006E.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){_\u0074\u0072\u0061\u0069\u006E.\u004B\u0069\u006C\u006C();}}\u0063\u0061\u0074\u0063\u0068 {}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0044\u0069\u0065(){\u0069\u0066 (\u0074\u0068\u0069\u0073 != \u006E\u0075\u006C\u006C){\u0044\u0065\u0073\u0074\u0072\u006F\u0079(\u0074\u0068\u0069\u0073);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0078\u0070\u006C\u006F\u0064\u0065(){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0045\u0078\u0070\u006C\u006F\u0064\u0065(_\u0074\u0072\u0061\u0069\u006E);}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0046\u0069\u0078\u0065\u0064\u0055\u0070\u0064\u0061\u0074\u0065(){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E==\u006E\u0075\u006C\u006C || _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064==0 || \u0069\u0073\u0044\u0065\u0061\u0064){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E\u0045\u006E\u0067\u0069\u006E\u0065.\u0048\u0061\u0073\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00646)){\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u0075\u0074\u0073("\u0048\u0061\u007A\u007A\u0061\u0072\u0064");}\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E.\u0048\u0065\u0061\u006C\u0074\u0068() < 10){\u0045\u0078\u0070\u006C\u006F\u0064\u0065();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (\u0073\u0074\u006F\u0070\u0070\u0069\u006E\u0067){_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 = 0;}_\u0074\u0072\u0061\u0069\u006E.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00641, \u0074\u0072\u0075\u0065);_\u0074\u0072\u0061\u0069\u006E.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00642, \u0074\u0072\u0075\u0065);_\u0074\u0072\u0061\u0069\u006E.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00645, \u0074\u0072\u0075\u0065);_\u0074\u0072\u0061\u0069\u006E.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0054\u0072\u0061\u0069\u006E\u0045\u006E\u0067\u0069\u006E\u0065.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E, \u0074\u0072\u0075\u0065);_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 = \u0054\u0061\u0072\u0067\u0065\u0074\u0053\u0070\u0065\u0065\u0064;\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0065\u0073\u00740 = _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0047\u0065\u0074\u0046\u0072\u006F\u006E\u0074\u0057\u0068\u0065\u0065\u006C\u0050\u006F\u0073();\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0065\u0073\u00741 = _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0047\u0065\u0074\u0052\u0065\u0061\u0072\u0057\u0068\u0065\u0065\u006C\u0050\u006F\u0073();\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0065\u0073\u00742 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073[\u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074 - 1];\u0056\u0065\u0063\u0074\u006F\u00723 \u0074\u0065\u0073\u00743 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073[0];\u0074\u0065\u0073\u00740.\u0079 = 0;\u0074\u0065\u0073\u00741.\u0079 = 0;\u0074\u0065\u0073\u00742.\u0079 = 0;\u0074\u0065\u0073\u00743.\u0079 = 0;\u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0074\u0065\u0073\u00741, \u0074\u0065\u0073\u00742) < 0.1f){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 < 0){_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073[5];\u006D\u006F\u0076\u0065\u0074\u0072\u0061\u0069\u006E();_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 = \u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0070\u0065\u0065\u0064;\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0074\u0065\u0073\u00740, \u0074\u0065\u0073\u00743) < 0.1f){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 >= 0){_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073[\u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074 - 5];\u006D\u006F\u0076\u0065\u0074\u0072\u0061\u0069\u006E();_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 = \u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0070\u0065\u0065\u0064;\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0074\u0065\u0073\u00740, \u0074\u0065\u0073\u00742) < 0.1f){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 >= 0){_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073[5];\u006D\u006F\u0076\u0065\u0074\u0072\u0061\u0069\u006E();_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 = \u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0070\u0065\u0065\u0064;\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0065\u006C\u0073\u0065 \u0069\u0066 (\u0056\u0065\u0063\u0074\u006F\u00723.\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065(\u0074\u0065\u0073\u00741, \u0074\u0065\u0073\u00743) < 0.1f){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 <= 0){_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073[\u0070\u006C\u0075\u0067\u0069\u006E.\u0072\u0061\u0069\u006C\u006E\u006F\u0064\u0065\u0073.\u0043\u006F\u0075\u006E\u0074 - 5];\u006D\u006F\u0076\u0065\u0074\u0072\u0061\u0069\u006E();_\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064 = \u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0070\u0065\u0065\u0064;\u0072\u0065\u0074\u0075\u0072\u006E;}}\u0043\u0075\u0072\u0072\u0065\u006E\u0074\u0053\u0070\u0065\u0065\u0064 = _\u0074\u0072\u0061\u0069\u006E\u0043\u0061\u0072.\u0054\u0072\u0061\u0063\u006B\u0053\u0070\u0065\u0065\u0064;\u0069\u0066 (!\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065){\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065 = \u0074\u0072\u0075\u0065;}\u0065\u006C\u0073\u0065{\u0069\u0066 (!\u0062\u0075\u0072\u006E\u0069\u006E\u0067){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E.\u0048\u0065\u0061\u006C\u0074\u0068() < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0074\u0061\u0072\u0074\u0046\u0069\u0072\u0065\u0048\u0065\u0061\u006C\u0074\u0068){\u0062\u0075\u0072\u006E\u0069\u006E\u0067 = \u0074\u0072\u0075\u0065;\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0046\u0069\u0072\u0065(60, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0.9f, -1.8f), 0.1f, _\u0074\u0072\u0061\u0069\u006E);}}\u0068\u0061\u006C\u0066\u0074\u0069\u0063\u006B\u0072\u0061\u0074\u0065 = \u0066\u0061\u006C\u0073\u0065;}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065(\u0066\u006C\u006F\u0061\u0074 \u006F\u0066\u0066\u0073\u0065\u0074){\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0063\u006F\u006E\u0074\u0065\u006E\u0074/\u0076\u0065\u0068\u0069\u0063\u006C\u0065\u0073/\u0062\u006F\u0061\u0074\u0073/\u0072\u0068\u0069\u0062/\u0073\u0075\u0062\u0065\u006E\u0074\u0073/\u0072\u0068\u0069\u0062_\u0073\u0074\u006F\u0072\u0061\u0067\u0065.\u0070\u0072\u0065\u0066\u0061\u0062") \u0061\u0073 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072;\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0070\u0061\u0077\u006E();\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(_\u0074\u0072\u0061\u0069\u006E);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, \u006F\u0066\u0066\u0073\u0065\u0074, 0);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u0061\u0070\u0061\u0063\u0069\u0074\u0079 = 30;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0042\u0061\u0069\u006C\u004F\u0075\u0074(){\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0064\u0072\u006F\u0070\u0046\u006C\u006F\u0061\u0074\u0073 = \u0074\u0072\u0075\u0065;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0044\u0072\u006F\u0070\u0049\u0074\u0065\u006D\u0073();}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u006E\u0070\u0063\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063);\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0069\u006C\u004F\u0075\u0074(_\u0074\u0072\u0061\u0069\u006E.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u006E\u0070\u0063, 8);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065(){\u0069\u0066 (\u006E\u0070\u0063\u0073==\u006E\u0075\u006C\u006C || _\u0074\u0072\u0061\u0069\u006E==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u006E\u0074 \u0061\u006C\u0069\u0076\u0065 = 0;\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073.\u0054\u006F\u0041\u0072\u0072\u0061\u0079()){\u0069\u0066 (\u006E\u0070\u0063==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (\u006E\u0070\u0063.\u0049\u0073\u0041\u006C\u0069\u0076\u0065()){\u0061\u006C\u0069\u0076\u0065++;\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0050\u0043\u0048\u0065\u0061\u006C(\u006E\u0070\u0063);\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074==\u006E\u0075\u006C\u006C){\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 = \u006E\u0070\u0063.\u0042\u0072\u0061\u0069\u006E.\u0053\u0065\u006E\u0073\u0065\u0073.\u0047\u0065\u0074\u004E\u0065\u0061\u0072\u0065\u0073\u0074\u0054\u0068\u0072\u0065\u0061\u0074(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0042\u006F\u0061\u0074\u0054\u0061\u0072\u0067\u0065\u0074\u0044\u0069\u0073\u0074\u0061\u006E\u0063\u0065);\u0069\u0066 (\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0070 = \u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074.\u0054\u006F\u0050\u006C\u0061\u0079\u0065\u0072();\u0069\u0066 (\u0070 != \u006E\u0075\u006C\u006C){\u0069\u0066 (\u0070.\u0049\u0073\u0053\u006C\u0065\u0065\u0070\u0069\u006E\u0067() || \u0070.\u0049\u0073\u0044\u0065\u0061\u0064() || \u0070\u006C\u0075\u0067\u0069\u006E.\u0056\u006F\u0069\u0063\u0065.\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0073(\u0070.\u006E\u0065\u0074.\u0049\u0044)){\u0050\u006C\u0061\u0079\u0065\u0072\u0054\u0061\u0072\u0067\u0065\u0074 = \u006E\u0075\u006C\u006C;}}}}}}\u0069\u0066 (\u0061\u006C\u0069\u0076\u0065==0){\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E != \u006E\u0075\u006C\u006C){_\u0074\u0072\u0061\u0069\u006E.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0056\u0065\u0068\u0069\u0063\u006C\u0065.\u0046\u006C\u0061\u0067\u0073.\u0052\u0065\u0073\u0065\u0072\u0076\u0065\u00641, \u0066\u0061\u006C\u0073\u0065);\u0073\u0074\u006F\u0070\u0070\u0069\u006E\u0067 = \u0074\u0072\u0075\u0065;}});\u0069\u0073\u0044\u0065\u0061\u0064 = \u0074\u0072\u0075\u0065;\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u0074\u006F\u0070\u0044\u0065\u006C\u0061\u0079, \u0053\u0074\u006F\u0070);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004E\u0050\u0043\u0054\u0069\u0063\u006B, \u004E\u0050\u0043\u0073\u0041\u006C\u0069\u0076\u0065);}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0053\u0074\u006F\u0070(){\u0069\u0066 (_\u0074\u0072\u0061\u0069\u006E==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079 + _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079, \u0045\u0078\u0070\u006C\u006F\u0064\u0065);\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0046\u0069\u0072\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0044\u0065\u006C\u0061\u0079, \u0046\u0069\u0072\u0065\u004F\u0066\u0066\u0073\u0065\u0074, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0046\u0069\u0072\u0065\u0044\u0065\u006C\u0061\u0079, _\u0074\u0072\u0061\u0069\u006E);}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0063\u006C\u0061\u0073\u0073 \u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065 : \u004D\u006F\u006E\u006F\u0042\u0065\u0068\u0061\u0076\u0069\u006F\u0075\u0072{\u0070\u0075\u0062\u006C\u0069\u0063 \u0069\u006E\u0074 \u0054\u0079\u0070\u0065;\u0070\u0075\u0062\u006C\u0069\u0063 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 _\u0062\u0061\u0073\u0065;\u0070\u0075\u0062\u006C\u0069\u0063 \u004C\u0069\u0073\u0074<\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043> \u006E\u0070\u0063\u0073;\u0070\u0075\u0062\u006C\u0069\u0063 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079> \u0065\u006E\u0074\u0069\u0074\u0079\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079>();\u0070\u0075\u0062\u006C\u0069\u0063 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072 \u0069\u0074\u0065\u006D\u0062\u006F\u0078;\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0041\u0077\u0061\u006B\u0065(){\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{_\u0062\u0061\u0073\u0065 = \u0047\u0065\u0074\u0043\u006F\u006D\u0070\u006F\u006E\u0065\u006E\u0074<\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079>();\u0069\u0066 (_\u0062\u0061\u0073\u0065==\u006E\u0075\u006C\u006C){\u0044\u0069\u0065();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u006C\u0065\u0061\u0072\u0041\u0072\u0065\u0061(_\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0057\u0061\u006C\u006C\u0052\u0061\u0064\u0069\u0075\u0073);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u004C\u0065\u0061\u0076\u0065\u0041\u0066\u0074\u0065\u0072, () =>{\u0069\u0066 (_\u0062\u0061\u0073\u0065 != \u006E\u0075\u006C\u006C){\u0043\u0068\u0065\u0063\u006B\u0045\u006D\u0070\u0074\u0079();}});\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10, () =>{\u0069\u0066 (_\u0062\u0061\u0073\u0065 != \u006E\u0075\u006C\u006C){\u0043\u0068\u0065\u0063\u006B\u004C\u006F\u006F\u0074();}});\u0070\u006C\u0075\u0067\u0069\u006E.\u0050\u0069\u0072\u0061\u0074\u0065.\u0041\u0064\u0064(_\u0062\u0061\u0073\u0065.\u006E\u0065\u0074.\u0049\u0044);\u0065\u006E\u0074\u0069\u0074\u0079\u0073.\u0041\u0064\u0064\u0052\u0061\u006E\u0067\u0065(\u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u0057\u0061\u006C\u006C\u0073(_\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0057\u0061\u006C\u006C\u0052\u0061\u0064\u0069\u0075\u0073));\u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0061\u0073\u0065();\u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065();\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0066\u0069\u006C\u006C\u006C\u006F\u006F\u0074(\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079, -1, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004C\u006F\u006F\u0074\u004D\u0075\u006C\u0074\u0069, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004C\u006F\u006F\u0074);;}\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0065\u0078\u0074\u0046\u0072\u0061\u006D\u0065(() =>{\u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723> \u0070\u006F\u0073 = \u006E\u0065\u0077 \u004C\u0069\u0073\u0074<\u0056\u0065\u0063\u0074\u006F\u00723>();\u0066\u006F\u0072 (\u0069\u006E\u0074 \u0069 = 0;\u0069 < _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074;\u0069++){\u0070\u006F\u0073.\u0041\u0064\u0064(\u0056\u0065\u0063\u0074\u006F\u00723.\u007A\u0065\u0072\u006F);}\u006E\u0070\u0063\u0073 = \u0070\u006C\u0075\u0067\u0069\u006E.\u0043\u0072\u0065\u0061\u0074\u0065\u004E\u0050\u0043\u0073(_\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u0041\u006D\u006F\u0075\u006E\u0074, \u0054\u0079\u0070\u0065, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u0048\u0065\u0061\u006C\u0074\u0068, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u004E\u0050\u0043\u004B\u0069\u0074, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0053\u006E\u006F\u0077\u004D\u006F\u0062\u0069\u006C\u0065\u0041\u0069\u006D\u004D\u0075\u006C\u0074\u0069, _\u0062\u0061\u0073\u0065, \u0070\u006F\u0073);\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0069\u006C\u004F\u0075\u0074(_\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 3, 0), \u006E\u0070\u0063, _\u0053\u0065\u0072\u0076\u0065\u0072\u0053\u0065\u0074\u0074\u0069\u006E\u0067\u0073.\u0050\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065\u0057\u0061\u006C\u006C\u0052\u0061\u0064\u0069\u0075\u0073 - 2, 5.5f, \u0066\u0061\u006C\u0073\u0065);}\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073.\u0041\u0064\u0064(\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u006E\u0065\u0074.\u0049\u0044);\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, () =>{\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062\u0065 \u0069\u006E \u0065\u006E\u0074\u0069\u0074\u0079\u0073){\u0069\u0066 (\u0062\u0065==\u006E\u0075\u006C\u006C || \u0062\u0065.\u006E\u0065\u0074==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073.\u0041\u0064\u0064(\u0062\u0065.\u006E\u0065\u0074.\u0049\u0044);}});});});}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0068\u0065\u0063\u006B\u004C\u006F\u006F\u0074(){\u0069\u0066 (_\u0062\u0061\u0073\u0065 != \u006E\u0075\u006C\u006C && \u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0074\u0069\u006D\u0065\u0072.\u004F\u006E\u0063\u0065(10f, \u0043\u0068\u0065\u0063\u006B\u004C\u006F\u006F\u0074);\u0072\u0065\u0074\u0075\u0072\u006E;}\u0043\u0068\u0065\u0063\u006B\u0045\u006D\u0070\u0074\u0079();}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0042\u0061\u0073\u0065(){\u0076\u0061\u0072 \u0065\u006E\u0074\u0069\u0074\u0079 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0066\u006C\u006F\u006F\u0072, _\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 3.5f, 0), _\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E);\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0065\u006E\u0074\u0069\u0074\u0079\u0073.\u0041\u0064\u0064(\u0065\u006E\u0074\u0069\u0074\u0079);\u0065\u006E\u0074\u0069\u0074\u0079.\u0053\u0070\u0061\u0077\u006E();\u0065\u006E\u0074\u0069\u0074\u0079.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 = (\u0075\u006C\u006F\u006E\u0067)\u0055\u006E\u0069\u0074\u0079\u0045\u006E\u0067\u0069\u006E\u0065.\u0052\u0061\u006E\u0064\u006F\u006D.\u0052\u0061\u006E\u0067\u0065(10000000, 20000000);\u0065\u006E\u0074\u0069\u0074\u0079.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(_\u0062\u0061\u0073\u0065, \u0074\u0072\u0075\u0065, \u0074\u0072\u0075\u0065);\u0076\u0061\u0072 \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B = \u0065\u006E\u0074\u0069\u0074\u0079 \u0061\u0073 \u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B;\u0069\u0066 (\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B != \u006E\u0075\u006C\u006C){\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0053\u0065\u0074\u0047\u0072\u0061\u0064\u0065((\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0047\u0072\u0061\u0064\u0065.\u0045\u006E\u0075\u006D)4);\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0067\u0072\u006F\u0075\u006E\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0041\u0074\u0074\u0061\u0063\u0068\u0054\u006F\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067(\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u004E\u0065\u0077\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0049\u0044());\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0068\u0065\u0061\u006C\u0074\u0068 = \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u004D\u0061\u0078\u0048\u0065\u0061\u006C\u0074\u0068();\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0066\u006C\u006F\u006F\u0072, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 6, 0), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0066\u006F\u0075\u006E\u0064\u0061\u0074\u0069\u006F\u006E, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 3, 0), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-1.5f, 0, 0), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E * \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 180, 0), \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0064\u006F\u006F\u0072\u0066\u0072\u0061\u006D\u0065 = \u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C\u0066\u0072\u0061\u006D\u0065, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(-1.5f, 3, 0), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E * \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 180, 0), \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(1.5f, 0, 0), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(1.5f, 3, 0), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0, -1.5f), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E * \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 90, 0), \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 3, -1.5f), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E * \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 90, 0), \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 0, 1.5f), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E * \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 270, 0), \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0077\u0061\u006C\u006C, \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0f, 3, 1.5f), \u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E * \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E.\u0045\u0075\u006C\u0065\u0072(0, 270, 0), \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B);\u0053\u0074\u0061\u0062\u0069\u006C\u0069\u0074\u0079\u0045\u006E\u0074\u0069\u0074\u0079 \u0067\u0064\u006F\u006F\u0072 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0067\u0061\u0072\u0061\u0067\u0065\u0064\u006F\u006F\u0072) \u0061\u0073 \u0053\u0074\u0061\u0062\u0069\u006C\u0069\u0074\u0079\u0045\u006E\u0074\u0069\u0074\u0079;\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0067\u0064\u006F\u006F\u0072);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0067\u0064\u006F\u006F\u0072);\u0067\u0064\u006F\u006F\u0072.\u0053\u0070\u0061\u0077\u006E();\u0067\u0064\u006F\u006F\u0072.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 = \u0065\u006E\u0074\u0069\u0074\u0079.\u004F\u0077\u006E\u0065\u0072\u0049\u0044;\u0067\u0064\u006F\u006F\u0072.\u0073\u006B\u0069\u006E\u0049\u0044 = 2433668609;\u0070\u006C\u0075\u0067\u0069\u006E.\u0041\u0064\u0064\u004C\u006F\u0063\u006B(\u0067\u0064\u006F\u006F\u0072);\u0067\u0064\u006F\u006F\u0072.\u0067\u0072\u006F\u0075\u006E\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0067\u0064\u006F\u006F\u0072.\u0070\u0069\u0063\u006B\u0075\u0070.\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0067\u0064\u006F\u006F\u0072.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0064\u006F\u006F\u0072\u0066\u0072\u0061\u006D\u0065);\u0067\u0064\u006F\u006F\u0072.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 0, 0);\u0067\u0064\u006F\u006F\u0072.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065(\u0074\u0072\u0075\u0065);\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073.\u0041\u0064\u0064(\u0067\u0064\u006F\u006F\u0072.\u006E\u0065\u0074.\u0049\u0044);\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u006C\u0061\u006E\u0074\u0065\u0072\u006E = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0064\u0065\u0070\u006C\u006F\u0079\u0061\u0062\u006C\u0065/\u006C\u0061\u006E\u0074\u0065\u0072\u006E/\u006C\u0061\u006E\u0074\u0065\u0072\u006E.\u0064\u0065\u0070\u006C\u006F\u0079\u0065\u0064.\u0070\u0072\u0065\u0066\u0061\u0062", _\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 9.6f, 0), _\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E);\u006C\u0061\u006E\u0074\u0065\u0072\u006E.\u0053\u0070\u0061\u0077\u006E();\u006C\u0061\u006E\u0074\u0065\u0072\u006E.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 = \u0065\u006E\u0074\u0069\u0074\u0079.\u004F\u0077\u006E\u0065\u0072\u0049\u0044;\u006C\u0061\u006E\u0074\u0065\u0072\u006E.\u0053\u0065\u0074\u0046\u006C\u0061\u0067(\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079.\u0046\u006C\u0061\u0067\u0073.\u004F\u006E, \u0074\u0072\u0075\u0065);\u0065\u006E\u0074\u0069\u0074\u0079\u0073.\u0041\u0064\u0064(\u006C\u0061\u006E\u0074\u0065\u0072\u006E);\u0070\u006C\u0075\u0067\u0069\u006E.\u0042\u0061\u0073\u0065\u0050\u0061\u0072\u0074\u0073.\u0041\u0064\u0064(\u0065\u006E\u0074\u0069\u0074\u0079.\u006E\u0065\u0074.\u0049\u0044);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0041\u0074\u0074\u0061\u0063\u0068\u0050\u0061\u0072\u0074\u0073(\u0073\u0074\u0072\u0069\u006E\u0067 \u0070\u0072\u0065\u0066\u0061\u0062, \u0056\u0065\u0063\u0074\u006F\u00723 \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, \u0051\u0075\u0061\u0074\u0065\u0072\u006E\u0069\u006F\u006E \u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E, \u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B \u0062\u0061\u0073\u0065\u0070\u0061\u0072\u0074){\u0076\u0061\u0072 \u0065\u006E\u0074\u0069\u0074\u0079 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079(\u0070\u0072\u0065\u0066\u0061\u0062);\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u006E\u0075\u006C\u006C;}\u0065\u006E\u0074\u0069\u0074\u0079.\u0053\u0070\u0061\u0077\u006E();\u0065\u006E\u0074\u0069\u0074\u0079\u0073.\u0041\u0064\u0064(\u0065\u006E\u0074\u0069\u0074\u0079);\u0065\u006E\u0074\u0069\u0074\u0079.\u0053\u0065\u0074\u0050\u0061\u0072\u0065\u006E\u0074(\u0062\u0061\u0073\u0065\u0070\u0061\u0072\u0074, \u0066\u0061\u006C\u0073\u0065, \u0074\u0072\u0075\u0065);\u0065\u006E\u0074\u0069\u0074\u0079.\u004F\u0077\u006E\u0065\u0072\u0049\u0044 = \u0062\u0061\u0073\u0065\u0070\u0061\u0072\u0074.\u004F\u0077\u006E\u0065\u0072\u0049\u0044;\u0076\u0061\u0072 \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B = \u0065\u006E\u0074\u0069\u0074\u0079 \u0061\u0073 \u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B;\u0069\u0066 (\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B != \u006E\u0075\u006C\u006C){\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0053\u0065\u0074\u0047\u0072\u0061\u0064\u0065((\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0047\u0072\u0061\u0064\u0065.\u0045\u006E\u0075\u006D)3);\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0067\u0072\u006F\u0075\u006E\u0064\u0065\u0064 = \u0074\u0072\u0075\u0065;\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0041\u0074\u0074\u0061\u0063\u0068\u0054\u006F\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067(\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u004E\u0065\u0077\u0042\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0049\u0044());\u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u0068\u0065\u0061\u006C\u0074\u0068 = \u0062\u0075\u0069\u006C\u0064\u0069\u006E\u0067\u0042\u006C\u006F\u0063\u006B.\u004D\u0061\u0078\u0048\u0065\u0061\u006C\u0074\u0068();}\u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0050\u006F\u0073\u0069\u0074\u0069\u006F\u006E = \u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E;\u0065\u006E\u0074\u0069\u0074\u0079.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u006C\u006F\u0063\u0061\u006C\u0052\u006F\u0074\u0061\u0074\u0069\u006F\u006E = \u0072\u006F\u0074\u0061\u0074\u0069\u006F\u006E;\u0072\u0065\u0074\u0075\u0072\u006E \u0065\u006E\u0074\u0069\u0074\u0079;}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0043\u0072\u0065\u0061\u0074\u0065\u0053\u0074\u006F\u0072\u0061\u0067\u0065(){\u0069\u0074\u0065\u006D\u0062\u006F\u0078 = \u0047\u0061\u006D\u0065\u004D\u0061\u006E\u0061\u0067\u0065\u0072.\u0073\u0065\u0072\u0076\u0065\u0072.\u0043\u0072\u0065\u0061\u0074\u0065\u0045\u006E\u0074\u0069\u0074\u0079("\u0061\u0073\u0073\u0065\u0074\u0073/\u0070\u0072\u0065\u0066\u0061\u0062\u0073/\u0064\u0065\u0070\u006C\u006F\u0079\u0061\u0062\u006C\u0065/\u006C\u0061\u0072\u0067\u0065 \u0077\u006F\u006F\u0064 \u0073\u0074\u006F\u0072\u0061\u0067\u0065/\u0062\u006F\u0078.\u0077\u006F\u006F\u0064\u0065\u006E.\u006C\u0061\u0072\u0067\u0065.\u0070\u0072\u0065\u0066\u0061\u0062", _\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E + \u006E\u0065\u0077 \u0056\u0065\u0063\u0074\u006F\u00723(0, 6.5f, 0)) \u0061\u0073 \u0053\u0074\u006F\u0072\u0061\u0067\u0065\u0043\u006F\u006E\u0074\u0061\u0069\u006E\u0065\u0072;\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0047\u0072\u006F\u0075\u006E\u0064\u0043\u006F\u006D\u0070(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);\u0070\u006C\u0075\u0067\u0069\u006E.\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u004D\u0065\u0073\u0068\u0043\u006F\u006C\u006C\u0069\u0064\u0065\u0072(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0073\u006B\u0069\u006E\u0049\u0044 = 931816387;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0070\u0061\u0077\u006E();\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0069\u006E\u0076\u0065\u006E\u0074\u006F\u0072\u0079.\u0063\u0061\u0070\u0061\u0063\u0069\u0074\u0079 = 30;\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0053\u0065\u006E\u0064\u004E\u0065\u0074\u0077\u006F\u0072\u006B\u0055\u0070\u0064\u0061\u0074\u0065\u0049\u006D\u006D\u0065\u0064\u0069\u0061\u0074\u0065();\u0070\u006C\u0075\u0067\u0069\u006E.\u0041\u0064\u0064\u004C\u006F\u0063\u006B(\u0069\u0074\u0065\u006D\u0062\u006F\u0078);}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0043\u0068\u0065\u0063\u006B\u0045\u006D\u0070\u0074\u0079(){\u0069\u0066 (_\u0062\u0061\u0073\u0065==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E;}\u0069\u0066 (!\u0050\u006C\u0061\u0079\u0065\u0072\u0073\u004E\u0065\u0061\u0072\u0062\u0079()){\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065("\u0043\u0068\u0065\u0063\u006B\u0045\u006D\u0070\u0074\u0079");\u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0041\u006E\u0064\u0044\u0065\u0073\u0074\u0072\u006F\u0079();\u0072\u0065\u0074\u0075\u0072\u006E;}\u0049\u006E\u0076\u006F\u006B\u0065("\u0043\u0068\u0065\u0063\u006B\u0045\u006D\u0070\u0074\u0079", 15f);}\u0070\u0075\u0062\u006C\u0069\u0063 \u0062\u006F\u006F\u006C \u0050\u006C\u0061\u0079\u0065\u0072\u0073\u004E\u0065\u0061\u0072\u0062\u0079(){\u0069\u0066 (_\u0062\u0061\u0073\u0065==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072> \u006F\u0062\u006A = \u0050\u006F\u006F\u006C.\u0047\u0065\u0074\u004C\u0069\u0073\u0074<\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072>();\u0056\u0069\u0073.\u0045\u006E\u0074\u0069\u0074\u0069\u0065\u0073(_\u0062\u0061\u0073\u0065.\u0074\u0072\u0061\u006E\u0073\u0066\u006F\u0072\u006D.\u0070\u006F\u0073\u0069\u0074\u0069\u006F\u006E, 15, \u006F\u0062\u006A, 131072);\u0062\u006F\u006F\u006C \u0072\u0065\u0073\u0075\u006C\u0074 = \u0066\u0061\u006C\u0073\u0065;\u0069\u0066 (\u006F\u0062\u006A==\u006E\u0075\u006C\u006C){\u0072\u0065\u0074\u0075\u0072\u006E \u0066\u0061\u006C\u0073\u0065;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0050\u006C\u0061\u0079\u0065\u0072 \u0069\u0074\u0065\u006D \u0069\u006E \u006F\u0062\u006A){\u0069\u0066 (\u0069\u0074\u0065\u006D==\u006E\u0075\u006C\u006C){\u0063\u006F\u006E\u0074\u0069\u006E\u0075\u0065;}\u0069\u0066 (!\u0069\u0074\u0065\u006D.\u0049\u0073\u0053\u006C\u0065\u0065\u0070\u0069\u006E\u0067() && \u0069\u0074\u0065\u006D.\u0049\u0073\u0041\u006C\u0069\u0076\u0065() && !\u0069\u0074\u0065\u006D.\u0049\u0073\u004E\u0070\u0063){\u0072\u0065\u0073\u0075\u006C\u0074 = \u0074\u0072\u0075\u0065;\u0062\u0072\u0065\u0061\u006B;}}\u0050\u006F\u006F\u006C.\u0046\u0072\u0065\u0065\u004C\u0069\u0073\u0074(\u0072\u0065\u0066 \u006F\u0062\u006A);\u0072\u0065\u0074\u0075\u0072\u006E \u0072\u0065\u0073\u0075\u006C\u0074;}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0045\u0078\u0070\u006C\u006F\u0064\u0065\u0041\u006E\u0064\u0044\u0065\u0073\u0074\u0072\u006F\u0079(){\u0062\u006F\u006F\u006C \u006B\u0069\u006C\u006C\u0071\u0075\u0069\u0074\u0065 = \u0066\u0061\u006C\u0073\u0065;\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C){\u006B\u0069\u006C\u006C\u0071\u0075\u0069\u0074\u0065 = \u0074\u0072\u0075\u0065;}\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0062 \u0069\u006E \u0065\u006E\u0074\u0069\u0074\u0079\u0073){\u0069\u0066 (!\u006B\u0069\u006C\u006C\u0071\u0075\u0069\u0074\u0065){\u0070\u006C\u0075\u0067\u0069\u006E.\u0045\u0078\u0070\u006C\u006F\u0064\u0065(\u0062);}\u0049\u006E\u0076\u006F\u006B\u0065("\u0044\u0069\u0065", 5f);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u004F\u006E\u0044\u0065\u0073\u0074\u0072\u006F\u0079(){\u0065\u006E\u0061\u0062\u006C\u0065\u0064 = \u0066\u0061\u006C\u0073\u0065;\u0043\u0061\u006E\u0063\u0065\u006C\u0049\u006E\u0076\u006F\u006B\u0065();\u0069\u0066 (\u0070\u006C\u0075\u0067\u0069\u006E != \u006E\u0075\u006C\u006C && \u0074\u0068\u0069\u0073 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0070\u0069\u0072\u0061\u0074\u0065\u0042\u0061\u0073\u0065--;\u0069\u0066 (\u0069\u0074\u0065\u006D\u0062\u006F\u0078 != \u006E\u0075\u006C\u006C && !\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0069\u0074\u0065\u006D\u0062\u006F\u0078.\u004B\u0069\u006C\u006C();}\u0069\u0066 (\u0065\u006E\u0074\u0069\u0074\u0079\u0073 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0042\u0061\u0073\u0065\u0045\u006E\u0074\u0069\u0074\u0079 \u0065 \u0069\u006E \u0065\u006E\u0074\u0069\u0074\u0079\u0073){\u0069\u0066 (\u0065 != \u006E\u0075\u006C\u006C && !\u0065.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064){\u0065.\u004B\u0069\u006C\u006C();}} }\u0069\u0066 (\u006E\u0070\u0063\u0073 != \u006E\u0075\u006C\u006C){\u0066\u006F\u0072\u0065\u0061\u0063\u0068 (\u0053\u0063\u0069\u0065\u006E\u0074\u0069\u0073\u0074\u004E\u0050\u0043 \u006E\u0070\u0063 \u0069\u006E \u006E\u0070\u0063\u0073){\u0069\u0066 (\u006E\u0070\u0063 != \u006E\u0075\u006C\u006C && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0073\u0074\u0072\u006F\u0079\u0065\u0064 && !\u006E\u0070\u0063.\u0049\u0073\u0044\u0065\u0061\u0064()){\u0069\u0066 (\u006E\u0070\u0063.\u006E\u0065\u0074 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);\u0070\u006C\u0075\u0067\u0069\u006E.\u0047\u0072\u006F\u0075\u006E\u0064\u0065\u0064\u004E\u0050\u0043\u0073.\u0052\u0065\u006D\u006F\u0076\u0065(\u006E\u0070\u0063.\u006E\u0065\u0074.\u0049\u0044);} \u006E\u0070\u0063.\u004B\u0069\u006C\u006C();}}}}}\u0070\u0075\u0062\u006C\u0069\u0063 \u0076\u006F\u0069\u0064 \u0044\u0069\u0065(){\u0069\u0066 (\u0074\u0068\u0069\u0073 != \u006E\u0075\u006C\u006C){\u0044\u0065\u0073\u0074\u0072\u006F\u0079(\u0074\u0068\u0069\u0073);}}\u0070\u0072\u0069\u0076\u0061\u0074\u0065 \u0076\u006F\u0069\u0064 \u0045\u0078\u0070\u006C\u006F\u0064\u0065(){\u0069\u0066 (_\u0062\u0061\u0073\u0065 != \u006E\u0075\u006C\u006C){\u0070\u006C\u0075\u0067\u0069\u006E.\u0045\u0078\u0070\u006C\u006F\u0064\u0065(_\u0062\u0061\u0073\u0065);}}}}}